(25, 'Изменение параметров устройства Cisco2921-346-234 с описанием выап выап выапывапывпа ваывпавыпа праьо прлолдлдо прлопрлпрлпр пролпрлопрлпр прлпрлопрлпр прлпрлпрл прлпрлопрлпрл ывапр ывапрырр ваппппппппппппппппп пппппппппппппппп рррррррррррррр рррррррррррррр ррррррррррррррррррр рррррррррррррррррр выап выап выапывапыв.'),
(26, 'Изменение параметров устройства Cisco2921-346-232 с описанием выап выап выапывапывпа ваывпавыпа праьо прлолдлдо прлопрлпрлпр пролпрлопрлпр прлпрлопрлпр прлпрлпрл прлпрлопрлпрл ывапр ывапрырр ваппппппппппппппппп пппппппппппппппп рррррррррррррр рррррррррррррр ррррррррррррррррррр рррррррррррррррррр выап выап выапывапыв.');
INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(2, '<p>Cisco ISR 2900 — серия маршрутизаторов с интеграцией сервисов, разработанная на основании 25-летнего опыта Cisco в области инноваций и создания передовых решений. Архитектура новых платформ обеспечивает поддержку следующего этапа развития филиалов организаций, перенося мультимедийные средства совместной работы и средства виртуализации на уровень филиала и позволяя существенно сократить операционные издержки. Платформы на базе маршрутизаторов Cisco ISR второго поколения позволяют решать не только сегодняшние задачи, но и те задачи, которые возникнут в будущем, поскольку в них используются многоядерные процессоры, поддерживаются высокопроизводительные сигнальные процессоры (DSP) для расширения перспективных возможностей передачи видео, используются мощные сервисные модули с повышенной доступностью, средства коммутации Gigabit Ethernet с поддержкой расширенной спецификации POE, а также новые возможности управления и мониторинга потребления энергии. Кроме того, новый универсальный образ операционной системы Cisco IOS и модуль Services Ready Engine позволяют разделить развертывание оборудования и программного обеспечения, тем самым обеспечивая надежную технологическую основу, способную быстро адаптироваться к постоянно изменяющимся требованиям к сети.</p>\r\n\r\n<p>В целом маршрутизаторы Cisco серии 2900 обеспечивают беспрецедентное снижение совокупной стоимости владения (TCO) и высочайший уровень гибкости сети, которые поддерживаются интеллектуальными средствами интеграции лучших в отрасли средств обеспечения безопасности, системы унифицированных коммуникаций, технологий создания беспроводных сетей и прикладных сервисов.</p>\r\n', 1, '2014-08-18'),
(1, '<p>Cisco 2811 - маршрутизатор с интеграцией сервисов, обеспечивающий все потребности небольших офисов и филиалов (до 36 рабочих мест) в современных коммуникациях.</p>\r\n\r\n<p>Может выполнять функции:</p>\r\n<ul>\r\n<li>маршрутизатора доступа и маршрутизатора локальной сети;</li>\r\n<li>центра IP-телефонии и голосовой почты (в вариантах Voice bundle и Voice Security bundle);</li>\r\n<li>интегрированного решения для обеспечения безопасности (в вариантах Security bundle и Voice Security bundle);</li>\r\n<li>межсетевой экран;</li>\r\n<li>система предотвращения вторжений;</li>\r\n<li>шифрование и создание VPN-туннелей;</li>\r\n<li>система Cisco NAC и фильтрация по URL;</li>\r\n<li>центр беспроводного доступа -беспроводное подключение ноутбуков и WLAN-телефонов. (При установке модулей HWIC-AP-G-E, HWIC-AP-AG-E или подключении точек доступа).</li>\r\n</ul>', 1, '2014-08-18'),
(15, '<p>Интеллектуальные Ethernet-коммутаторы Cisco Catalyst серии 2960 (Cisco Catalyst 2960 Series Intelligent Ethernet Switch) позволяют реализовать расширенные сервисы в локальных сетях крупных и средних предприятий, а также в сетях филиалов. Представители этого семейства автономных коммутаторов с фиксированной конфигурацией обеспечивают подключение рабочих мест на скоростях 10/100 Fast Ethernet и 10/100/1000 Gigabit Ethernet.</p>\r\n<p>Возможности моделей серии:</p>\r\n<ul>\r\n<li>Подключение: подключения Fast Ethernet и Gigabit Ethernet в конфигурациях с 8, 24 и 48 портами</li>\r\n<li>Питание устройств по витой паре: конфигурации с 24 портами с полной поддержкой PoE и 24 портами (с поддержкой PoE на 8 портах)</li>\r\n<li>Интегрированные функции безопасности, включая контроль доступа в сеть (NAC)</li>\r\n<li>Расширенные возможности управления качеством обслуживания (QoS) и обеспечения отказоустойчивости</li>\r\n<li>Интеллектуальные сервисы на границе сети</li>\r\n</ul>\r\n', 1, '2014-08-18'),
(10, 'выапвыа впаывпа.\r\nвпавпа выап выап выапвыап.\r\nвыапвап выпваыпвапвы ывапав ывп ывап.', 1, '2014-08-02'),
(3, '<p>Интеллектуальные Ethernet-коммутаторы Cisco Catalyst серии 2960 (Cisco Catalyst 2960 Series Intelligent Ethernet Switch) позволяют реализовать расширенные сервисы в локальных сетях крупных и средних предприятий, а также в сетях филиалов. Представители этого семейства автономных коммутаторов с фиксированной конфигурацией обеспечивают подключение рабочих мест на скоростях 10/100 Fast Ethernet и 10/100/1000 Gigabit Ethernet.</p>\r\n<p>Возможности моделей серии:</p>\r\n<ul>\r\n<li>Подключение: подключения Fast Ethernet и Gigabit Ethernet в конфигурациях с 8, 24 и 48 портами</li>\r\n<li>Питание устройств по витой паре: конфигурации с 24 портами с полной поддержкой PoE и 24 портами (с поддержкой PoE на 8 портах)</li>\r\n<li>Интегрированные функции безопасности, включая контроль доступа в сеть (NAC)</li>\r\n<li>Расширенные возможности управления качеством обслуживания (QoS) и обеспечения отказоустойчивости</li>\r\n<li>Интеллектуальные сервисы на границе сети</li>\r\n</ul>\r\n', 1, '2014-08-18'),
