(26, '<p>Cisco 3825 - маршрутизатор с интеграцией сервисов, обеспечивающий все потребности в современных коммуникациях для крупных офисов и филиалов (до 168 рабочих мест при использовании IP ATC CallManager Express или до 336 рабочих мест при использовании IP-PBX Survivable Remote Site Telephony).</p>\r\n\r\n<p>Может выполнять функции:</p>\r\n\r\n<ul>\r\n<li>маршрутизатора доступа и маршрутизатора локальной сети.</li>\r\n<li>центра IP-телефонии и голосовой почты.</li>\r\n<li>интегрированного решения для обеспечения безопасности.</li>\r\n<li>высокопроизводительного межсетевого экрана.</li>\r\n<li>системы предотвращения вторжений.</li>\r\n<li>шифрования и создания VPN-туннелей.</li>\r\n<li>системы Cisco NAC и фильтрации по URL.</li>\r\n<li>центра беспроводного доступа (беспроводное подключение ноутбуков и WLAN-телефонов).</li>\r\n</ul>\r\n', 1, '2014-08-18'),
(27, '<p>Cisco 3845 - маршрутизатор с интеграцией сервисов, обеспечивающий все потребности в современных коммуникациях для крупных офисов и филиалов (до 720 рабочих мест при использовании IP ATC CallManager Express или до 720 рабочих мест при использовании IP-PBX Survivable Remote Site Telephony).</p>\r\n\r\n<p>Может выполнять функции:</p>\r\n\r\n<ul>\r\n<li>маршрутизатора доступа и маршрутизатора локальной сети.</li>\r\n<li>центра IP-телефонии и голосовой почты.</li>\r\n<li>интегрированного решения для обеспечения безопасности.</li>\r\n<li>высокопроизводительного межсетевого экрана.</li>\r\n<li>системы предотвращения вторжений.</li>\r\n<li>шифрования и создания VPN-туннелей.</li>\r\n<li>системы Cisco NAC и фильтрации по URL.</li>\r\n<li>центра беспроводного доступа (беспроводное подключение ноутбуков и WLAN-телефонов).</li>\r\n</ul>\r\n', 1, '2014-08-18'),
(28, '<p>Cisco ISR 2900 — серия маршрутизаторов с интеграцией сервисов, разработанная на основании 25-летнего опыта Cisco в области инноваций и создания передовых решений. Архитектура новых платформ обеспечивает поддержку следующего этапа развития филиалов организаций, перенося мультимедийные средства совместной работы и средства виртуализации на уровень филиала и позволяя существенно сократить операционные издержки. Платформы на базе маршрутизаторов Cisco ISR второго поколения позволяют решать не только сегодняшние задачи, но и те задачи, которые возникнут в будущем, поскольку в них используются многоядерные процессоры, поддерживаются высокопроизводительные сигнальные процессоры (DSP) для расширения перспективных возможностей передачи видео, используются мощные сервисные модули с повышенной доступностью, средства коммутации Gigabit Ethernet с поддержкой расширенной спецификации POE, а также новые возможности управления и мониторинга потребления энергии. Кроме того, новый универсальный образ операционной системы Cisco IOS и модуль Services Ready Engine позволяют разделить развертывание оборудования и программного обеспечения, тем самым обеспечивая надежную технологическую основу, способную быстро адаптироваться к постоянно изменяющимся требованиям к сети.</p>\r\n\r\n<p>В целом маршрутизаторы Cisco серии 2900 обеспечивают беспрецедентное снижение совокупной стоимости владения (TCO) и высочайший уровень гибкости сети, которые поддерживаются интеллектуальными средствами интеграции лучших в отрасли средств обеспечения безопасности, системы унифицированных коммуникаций, технологий создания беспроводных сетей и прикладных сервисов.</p>', 1, '2014-08-18'),
