(48, '<p>Интеллектуальные Ethernet-коммутаторы Cisco Catalyst серии 2960 (Cisco Catalyst 2960 Series Intelligent Ethernet Switch) позволяют реализовать расширенные сервисы в локальных сетях крупных и средних предприятий, а также в сетях филиалов. Представители этого семейства автономных коммутаторов с фиксированной конфигурацией обеспечивают подключение рабочих мест на скоростях 10/100 Fast Ethernet и 10/100/1000 Gigabit Ethernet.</p>\r\n<p>Возможности моделей серии:</p>\r\n<ul>\r\n<li>Подключение: подключения Fast Ethernet и Gigabit Ethernet в конфигурациях с 8, 24 и 48 портами</li>\r\n<li>Питание устройств по витой паре: конфигурации с 24 портами с полной поддержкой PoE и 24 портами (с поддержкой PoE на 8 портах)</li>\r\n<li>Интегрированные функции безопасности, включая контроль доступа в сеть (NAC)</li>\r\n<li>Расширенные возможности управления качеством обслуживания (QoS) и обеспечения отказоустойчивости</li>\r\n<li>Интеллектуальные сервисы на границе сети</li>\r\n</ul>\r\n', 1, '2014-08-18'),
(49, '<p>Интеллектуальные Ethernet-коммутаторы Cisco Catalyst серии 2960 (Cisco Catalyst 2960 Series Intelligent Ethernet Switch) позволяют реализовать расширенные сервисы в локальных сетях крупных и средних предприятий, а также в сетях филиалов. Представители этого семейства автономных коммутаторов с фиксированной конфигурацией обеспечивают подключение рабочих мест на скоростях 10/100 Fast Ethernet и 10/100/1000 Gigabit Ethernet.</p>\r\n<p>Возможности моделей серии:</p>\r\n<ul>\r\n<li>Подключение: подключения Fast Ethernet и Gigabit Ethernet в конфигурациях с 8, 24 и 48 портами</li>\r\n<li>Питание устройств по витой паре: конфигурации с 24 портами с полной поддержкой PoE и 24 портами (с поддержкой PoE на 8 портах)</li>\r\n<li>Интегрированные функции безопасности, включая контроль доступа в сеть (NAC)</li>\r\n<li>Расширенные возможности управления качеством обслуживания (QoS) и обеспечения отказоустойчивости</li>\r\n<li>Интеллектуальные сервисы на границе сети</li>\r\n</ul>\r\n', 1, '2014-08-18'),
(50, 'Многофункциональный комплекс защиты Cisco ASA 5505-K8. Интерфейсы: 8 x 10/100 Мбит/с, 3 x USB 2.0. Производительность: межсетевой экран 150 Мбит/с, 3DES/AES VPN 100 Мбит/с, 10000 одновременных сессий. Пользователи: 10, 10 IPsec VPN, 2 SSL VPN. Шифрование: DES.\r\n\r\nМежсетевой экран Cisco ASA 5505 является полнофункциональным комплексом защиты следующего поколения для малого бизнеса, филиалов офисов и корпоративных дистанционных работников. Cisco ASA 5505 имеет высокопроизводительный межсетевой экран, SSL и IPsec VPN, а также большое количество сетевых служб в модульном комплексе, поддерживающем "plug-and-play". Используя встроенный Cisco ASDM, межсетевой экран Cisco ASA 5505 легко устанавливается и настраивается, что позволяет свести к минимуму стоимость операций. Cisco ASA 5505 имеет гибкий коммутатор на 8 портов, которые могут быть динамически сгруппированы для создания 3 отдельных виртуальных сетей, обеспечивая усовершенствованную сетевую фрагментацию и безопасность. Также Cisco ASA 5505 имеет 2 порта Power over Ethernet (PoE), упрощая установку IP-телефонов с безопасными возможностями VoIP и беспроводных точек доступа для расширения сетевой мобильности. Высокопроизводительная система предотвращения вторжений и служба блокирования сетевых червей становятся доступными после добавления AIP SSC. Несколько портов USB могут быть использованы для добавления дополнительных служб и возможностей в будущем.\r\n\r\nПри увеличении потребностей бизнеса предприниматели могут обновить лицензию до Security Plus, что позволит межсетевому экрану Cisco ASA 5505 поддерживать большее количество одновременных подключений и до 25 пользователей IPsec VPN, добавления полной поддержки DMZ и объединяться с коммутируемыми сетями при помощи поддержки магистралей виртуальных сетей. В дальнейшем обновление лицензии поможет максимизировать эффективность бизнеса путем поддержки резервирования ISP и высокой доступности служб активности/режима ожидания.\r\n\r\nПредприниматели могут расширить службы VPN межсетевого экрана Cisco ASA 5505 путем разрешения удаленного доступа для поддержки различных мобильных пользователей и бизнес партнеров. Установка Cisco Secure Remote-Access Solution позволяет увеличить количество пользователей SSL VPN до 25 на каждом межсетевом экране путем обновления лицензии до SSL VPN.\r\n\r\nКомбинация высокой безопасности и служб VPN, усовершенствованных сетевых возможностей, гибких возможностей удаленного управления и дальнейших расширений делает межсетевой экран Cisco ASA 5505 отличным выбором для предпринимателей, требующих безопасное решение, являющееся лучшим в своем классе для малого бизнеса, филиалов офисов или корпоративных дистанционных работников.', 1, '2014-08-19'),
(51, 'Производительность: 300 Мбит/с, 3DES/AES VPN 170 Мбит/с, от 50000 одновременных сессий, Пользователи: 250 IPsec VPN, 2 SSL VPN. Шифрование: DES, 5 портов 10/100BaseT 2 порта 10/100/1000BaseT, 3 x USB 2.0\r\n\r\nМежсетевой экран Cisco ASA 5510 обеспечивает усовершенствованную безопасность и сетевые службы для малого и среднего бизнеса и филиалов офисов, при этом являясь простым решением с эффективной стоимостью. Эти службы могут легко управляться при помощи встроенного приложения Cisco ASDM, тем самым облегчая установку и уменьшая стоимость операций по обеспечению высокой безопасности. Межсетевой экран Cisco ASA 5510 обеспечивает высокую производительность межсетевого экрана и служб VPN, имеет 5 встроенных интерфейсов 10/100 Fast Ethernet. Опционально доступны высокопроизводительная система предотвращения вторжений и служба блокирования сетевых червей при использовании AIP SSM, а также всеобъемлющая служба защиты от вредоносного программного обеспечения при использовании CSC SSM. Эта уникальная комбинация служб в одной платформе делает Cisco ASA 5510 идеальным решением для предпринимателей, требующих рентабельное решение с поддержкой DMZ и возможностью дальнейшего расширения.\r\n\r\nПри увеличении потребностей бизнеса предприниматели могут обновить лицензию до Security Plus, тем самым превратив 2 интерфейса межсетевого экрана Cisco ASA 5510 в интерфейсы Gigabit Ethernet и включив интеграцию в коммутируемую сеть при помощи поддержки виртуальных сетей. Это обновление лицензии поможет максимизировать эффективность бизнеса путем включения служб высокой доступности - активность/активность и активность/режим ожидания. Использование опциональной возможности контекстной безопасности межсетевого экрана Cisco ASA 5510 позволяет установить до 5 виртуальных межсетевых экранов для разобщенного контроля политик безопасности на высоком уровне. Эта виртуализация усиливает безопасность, упрощает общее управление и уменьшает стоимость обслуживания и одновременно позволяет централизованно управлять несколькими устройствами.\r\n\r\nПредприниматели могут расширить возможности SSL и IPsec VPN для поддержки большего количества дистанционных работников, удаленных объектов и бизнес партнеров. Можно увеличить количество пользователей SSL VPN до 250 на каждом межсетевом экране Cisco ASA 5510 при помощи установки обновления лицензии SSL VPN; базовая платформа поддерживает до 250 пользователей IPsec VPN.\r\n\r\nВозможности VPN и отказоустойчивость могут быть увеличены для полного использования интегрированного стекирования Cisco ASA 5510 и возможностей балансировки нагрузки (доступно с лицензией Security Plus). Межсетевой экран Cisco ASA 5510 поддерживает до 10 комплексов в стеке, обеспечивая поддержку 2500 пользователей SSL VPN или 2500 пользователей IPsec VPN одним кластером. Для обеспечения бесперебойной работы и планирования Cisco ASA 5510 также может использовать преимущества лицензий Cisco VPN FLEX, которые дают администратору возможность своевременно реагировать и планировать очереди дистанционных пользователей на период до 2 месяцев.', 1, '2014-08-19'),
(63, 'FXS port is used to connect directly to phones, fax machines, and key systems. Generates battery polarity reversal and caller ID.\r\nDID port is used to provide off-premises DID connection from central office. Serves only incoming calls from the PSTN. Does not support caller ID in DID mode.', 1, '2014-08-30'),
(64, 'FXS port is used to connect directly to phones, fax machines, and key systems. Generates battery polarity reversal and caller ID. VIC3-2FXS-E/DID is designated as an "Off-Premise Extension Lite" product offering. This means that while the module addresses a subset of the off-premise extension applications, it should be noted that the module is not in full compliance for off-premise usage.\r\nDID port is used to provide off-premises DID connection from central office. Serves only incoming calls from the PSTN. Does not support caller ID in DID mode.', 1, '2014-08-30'),
(65, 'FXS port is used to connect directly to phones, fax machines, and key systems. Generates battery polarity reversal and caller ID.\r\nDID port is used to provide off-premises DID connection from central office. Serves only incoming calls from the PSTN. Does not support caller ID in DID mode.', 1, '2014-08-30'),
(66, 'Used to connect as network side or user side to PBX or key system as off-premises connections (ISDN voice BRI). Supports patent-pending flexible Layer 2 and Layer 3 configurations.', 1, '2014-08-30'),
(72, '<p>IP-АТС KX-TDE 100 представляет собой полноценное IP решение, использующее принцип коммутации ip-пакетов. IP-АТС KX-TDE 100 обладают всеми функциями, интерфейсами и абонентскими терминалами АТС KX-TDA. основным отличием и преимуществом данной модели является новая процессорная плата. Она объединяет в себе функционал пяти плат KX-TDA, таких как:</p>\r\n\r\n<ul>\r\n<li>Плата внешних IP-линий </li>\r\n<li>Плата внутренних IP-абонентов </li>\r\n<li>Голосовая почта (2 канала)</li>\r\n<li>Плата удаленного администрирования и CTI интеграции </li>\r\n<li>Карта расширения памяти для поддержки многосторонней конференции.</li>\r\n</ul>\r\n\r\n<p>Возможности:</p>\r\n<ul>\r\n<li>Поддержка всех без исключений функций KX-TDA100</li>\r\n<li>Предельная ёмкость системы: до 128 внешних линий, до 128 внутренних линий, 128 мобильных абонентов</li>\r\n<li>До 32 внешних IP-линий (по протоколу sip) </li>\r\n<li>До 96 внешних IP-линий (по протоколу h.323) </li>\r\n<li>До 64 системных IP-телефонов </li>\r\n<li>До 128 SIP-телефонов сторонних производителей</li>\r\n<li>Поддержка SIP-транков (по протоколам RFC3261, 3262, 3264, 3311, 4028)</li>\r\n<li>Встроенные базовые функции голосовой почты (2-канала)</li>\r\n<li>Большой объем внутренней памяти</li>\r\n<li>Единая система регистрации и учета вызовов АТС (SMDR) в сети</li>\r\n<li>Передача факсов по IP-сети (поддержка протокола T 38)</li>\r\n<li>Совместимость с новыми моделями системных IP-телефонов и консолями серии NT300</li>\r\n<li>Совместимость с новой 8-канальной базовой станцией DECT</li>\r\n<li>Возможность удаленного администрирования и обновления нескольких АТС в сети</li>\r\n<li>Принципы программирования, сходные с KX-TDA</li>\r\n<li>Поддержка многосторонней конференции</li>\r\n<li>Полная совместимость с АТС серии KX-TDA</li>\r\n<li>Работа с пакетом CTI приложений Communication Assistant (с третьей версии внутреннего программного обеспечения)</li>\r\n</ul>\r\n', 1, '2014-09-02'),
(88, '<p>IP-АТС KX-TDE 200 представляет собой полноценное IP решение, использующее принцип коммутации ip-пакетов. IP-АТС KX-TDE 200 обладают всеми функциями, интерфейсами и абонентскими терминалами АТС KX-TDA. основным отличием и преимуществом данной модели является новая процессорная плата. Она объединяет в себе функционал пяти плат KX-TDA, таких как:</p>\r\n\r\n<ul>\r\n<li>Плата внешних IP-линий </li>\r\n<li>Плата внутренних IP-абонентов </li>\r\n<li>Голосовая почта (2 канала)</li>\r\n<li>Плата удаленного администрирования и CTI интеграции </li>\r\n<li>Карта расширения памяти для поддержки многосторонней конференции.</li>\r\n</ul>\r\n\r\n<p>Возможности:</p>\r\n<ul>\r\n<li>Поддержка всех без исключений функций KX-TDA200</li>\r\n<li>Предельная ёмкость системы: до 128 внешних линий, до 256 внутренних линий, 128 мобильных абонентов</li>\r\n<li>До 32 внешних IP-линий (по протоколу sip) </li>\r\n<li>До 96 внешних IP-линий (по протоколу h.323) </li>\r\n<li>До 64 системных IP-телефонов </li>\r\n<li>До 128 SIP-телефонов сторонних производителей</li>\r\n<li>Поддержка SIP-транков (по протоколам RFC3261, 3262, 3264, 3311, 4028)</li>\r\n<li>Встроенные базовые функции голосовой почты (2-канала)</li>\r\n<li>Большой объем внутренней памяти</li>\r\n<li>Единая система регистрации и учета вызовов АТС (SMDR) в сети</li>\r\n<li>Передача факсов по IP-сети (поддержка протокола T 38)</li>\r\n<li>Совместимость с новыми моделями системных IP-телефонов и консолями серии NT300</li>\r\n<li>Совместимость с новой 8-канальной базовой станцией DECT</li>\r\n<li>Возможность удаленного администрирования и обновления нескольких АТС в сети</li>\r\n<li>Принципы программирования, сходные с KX-TDA</li>\r\n<li>Поддержка многосторонней конференции</li>\r\n<li>Полная совместимость с АТС серии KX-TDA</li>\r\n<li>Работа с пакетом CTI приложений Communication Assistant (с третьей версии внутреннего программного обеспечения)</li>\r\n</ul>\r\n', 1, '2014-09-02'),
(89, '<p>IP-АТС KX-TDE600 — многофункциональные офисные АТС для организации телефонной сети на базе современных технологий ip-телефонии. Поддержка основных протоколов IP-телефонии (SIP, H.323) дает возможность построения распределенных телефонных сетей с единым планом нумерации, а также увеличивать емкость системы за счет подключения SIP- или IP-телефонов. СTI интеграция и встроенный модуль голосовой почты позволяют эффективно организовывать бизнес-процессы, а также повышать качество обслуживания клиентов.</p>\r\n\r\n<p>IP-АТС KX-TDE600 — идеальная коммуникационная платформа для решения основных задач бизнеса на сегодняшний день и в будущем, если планируется полный переход на IP-телефонию.</p><p>Возможности:</p>\r\n\r\n<ul>\r\n<li>Поддержка всех без исключений функций предыдущего поколения АТС (KX-TDA600)</li>\r\n<li>Предельная ёмкость системы: до 640 внешних линий, до 1152 внутренних линий, 512 мобильных абонентов</li>\r\n<li>До 640 внешних IP-линий, в том числе не более 32 внешних SIP-линий </li>\r\n<li>До 672 системных IP-телефонов </li>\r\n<li>До 128 SIP-телефонов сторонних производителей</li>\r\n<li>Поддержка SIP-транков (по протоколам RFC3261, 3262, 3264, 3311, 4028)</li>\r\n<li>Встроенные базовые функции голосовой почты (2-канала)</li>\r\n<li>Единой системой регистрации и учета вызовов АТС (SMDR) в сети с увеличенным количеством записей</li>\r\n<li>Передача факсов по IP-сети (поддержка протокола T.38)</li>\r\n<li>Совместимость с новыми моделями системных IP-телефонов и консолями серии NT300</li>\r\n<li>Совместимость с новой 8-канальной базовой станцией DECT</li>\r\n<li>Возможность удаленного администрирования и обновления нескольких АТС в сети</li>\r\n<li>Принципы программирования, сходные с KX-TDA</li>\r\n<li>Поддержка многосторонней конференции</li>\r\n<li>Полная совместимость с АТС серии KX-TDA</li>\r\n<li>Работа с пакетом CTI приложений Communication Assistant</li>\r\n<li>Совместимость с различными интерфейсами, приложениями и сетями.</li>\r\n<li>Встроенный CTI сервер (Communication Assistant)</li>\r\n<li>Поддержка передачи видео для внутренних sip-абонентов (программных и аппаратных)</li>\r\n<li>Мобильная интеграция. Возможность использования gsm телефонов как внутренних абонентов телефонной сети.</li>\r\n<li>Дополнительные возможности по управлению и использованию головой почты и голосового меню благодаря работе с процессорами речевой почты KX-TVM50 и KX-TVM200</li>\r\n</ul>\r\n', 1, '2014-09-02');
INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(95, '<p>Цифровая АТС Aastra MD110</p>\r\n<p>Объединение всех сотрудников в рамках одной системы связи подразумевает обеспечение высокого уровня обслуживания и его доступности персоналу, находящемуся в удаленных филиалах как небольшого, так и среднего размера. Интегрированная система связи Aastra MD110 предназначена именно для решения проблемы объединения всех частей организации: от очень маленьких филиалов до филиалов среднего размера, насчитывающих примерно 1000 сотрудников, и, естественно, любых более крупных подразделений организации.</p>\r\n<p>В основе системы Aastra MD-110 лежит модульная распределенная архитектура, позволяющая создавать сети, поддерживающие приложения по передаче голоса и данных и мультимедийные приложения. Благодаря распределенной архитектуре Aastra MD 110 обеспечивает высокую степень отказоустойчивости и расширяемости, позволяя объединить сетью от 50 до 30000 и более пользователей, работающих в обычном или распределенном офисе, а также на предприятии.</p>\r\n<p>Распределенная системная архитектура цифровой АТС Aastra MD-110 означает, что модули, составляющие станцию могут быть установлены не только рядом, но и на значительном удалении друг от друга, связываясь между собой посредством потоков Е1. Расстояния между модулями ограничиваются лишь средой передачи.</p>\r\n<p>УАТС Aastra MD110 не имеет заранее определенной жесткой системной конфигурации. Напротив, пользователи могут создавать интегрированную сеть, объединяющую соединяющую передачу голоса и данных, используя стандартные элементы (модули). Процессорная обработка (модули PSM) и физическая емкость (РЗМДРМ), могут располагаться там, где это необходимо, в соответствии с уникальными требованиями, предъявляемыми конкретным пользователем к системе связи.</p>\r\n<p>В дополнение к распределенной архитектуре и модульному построению системы Aastra MD-110 предоставляют также существенно расширенные или даже принципиально новые возможности в таких областях как:</p>\r\n<ul>\r\n<li>мобильность абонентов</li>\r\n<li>сетевые возможности</li>\r\n<li>открытые интерфейсы</li>\r\n<li>центры обслуживания вызовов</li>\r\n<li>сетевое управление на базе протокола SNMP</li>\r\n<li>встроенная голосовая почта</li>\r\n<li>персональные номера</li>\r\n</ul>\r\n<p>MD110 Cordless</p>\r\n<p>Беспроводная система Aastra MD110 состоит из плат интерфейсов базовых станций, устанавливаемых в LIM, базовых станций и беспроводных телефонов. Реализована на основе распределенной архитектуры Aastra MD-110, что обеспечивает гибкость, расширяемость и надежность. Базовые станции соединены непосредственно с интерфейсной платой Aastra MD110, что обеспечивает необходимую зону покрытия и рабочие возможности беспроводных телефонов. Каждая база одновременно поддерживает до 8 телефонных каналов, что позволяет обслуживать в среднем до 20 пользователей в часы пиковой нагрузки.</p>\r\n<p>MD110 Hospitality Solution</p>\r\n<p>Цифровая АТС Aastra MD110 Hospitality Solution разработано для использования в гостиницах, больницах, на круизных кораблях, в конференц-центрах и в других организациях, где могут потребовать-ся решения такого типа (например, в уни-верситетских общежитиях). В комплект Hospitality входят все необ-ходимые вам функции по обработке голоса и данных. Эти функции позволяют осуществить полноценную интеграцию с гостиничной системой, делая информацию о гостях доступной по мере необходимости.</p>\r\n		', 1, '2014-09-02'),
(137, '<p>Ubiquiti EdgeRouter Lite — высокопроизводительный роутер серии EdgeMAX с суммарной пропускной способностью 3Gbps.\r\nEdge Router Lite построен на базе сетевого двухъядерного MIPS64 процессора с тактовой частотой в 500MHz снабжен 512MB DDR2 оперативной памяти и имеет 2GB встроенной Flash памяти.</p>\r\n<p>Работой Edge Router Lite управляет встроенная операционная система EdgeOS, которая конфигурируется с помощью удобного графического интерфейса.  Операционная система EdgeOS основана на Debian Vyatta, поэтому, вы имеете полный доступ на системном уровне, включая root права, всю иерархию файловой системы и т.д, это позволяет устанавливать и использовать существующие Debian пакеты, а также создавать свои собственные с помощью стандартных инструментов.</p>\r\n<p>Edge Router Lite поддерживает все основные функции современного маршрутизатора: виртуальные сети VLAN, мосты, агрегацию каналов, туннельные соединения, OSPF, RIP и BGP протоколы маршрутизации, брандмауэр, VPN с использованием протоколов IPsec, OpenVPN, L2TP, PPTP.</p>\r\n<p>Устройство относится к серии роутеров EdgeMAX, которая имеет наилучшее соотношение цены и производительности. Поэтому вы сможете купить EdgeRouter Lite и получить мощный роутер за невысокую плату.</p>', 1, '2014-09-03'),
(138, '<p>Управляемый,гигабитный 16-ти портовый коммутатор, с подачей питания РоЕ как на 24, так и на 48 вольт.</p>\r\n<p>TOUGHSwitch POE CARRIER состоит из двух,обьединённых в одну стойку, 8-ми портовых коммутаторов TOUGHSwitch PoE PRO , имеющих так же 2 Management порта и 2 USB порта.\r\nКоммутатор TOUGHSwitch POE CARRIER применяется для поключения устройств Ubiquiti и предназначен для выполнения задач с большим колличеством блоков питания.</p>\r\n<p>Используйте коммутатор TOUGHSwitch POE CARRIER для построения мощных WIFI сетей UNIFI. Так же подходит и для всей остальной линейки Ubiquiti, в том числе AirMax и AirCam.</p>', 1, '2014-09-03'),
(141, '<p>Ubiquiti UniFi1 - комплект UniFi, состоящий из одной точки доступа 802.11b/g/n со встроенной антенной и программного контроллера, позволяющего организовать централизованную масштабируемую WiFi систему для организации внутренней WiFi сети. Используется как компактное, удобное в использовании, решение для эфективного, быстрого и невероятно дешевого способа развертывания в помещениях WiFi сетей с программным контроллером. Ubiquiti UniFi поддерживает последний стандарт WiFi 802.11n MIMO.</p>\r\n<p>Точка доступа Ubiquiti UniFi легко монтируется к навесному потолку (в комплект поставки входят все необходимые крепления для монтажа) и поддерживает питание POE, благодаря чему точка доступа Ubiquiti UniFi впишется в любой интерьер и избавит от необходимости прокладывать кабельные каналы в помещении (все провода "спрятаны" за навесным потолком).</p>\r\n<p>В комплект поставки входит программный контроллер, позволяющий не просто управлять устройством, но и организовывать централизованную масштабируемую WiFi сеть из нескольких точек доступа Ubiquiti UniFi. Программное обеспечение UniFi устанавливается на любом PC в пределах сети. Управление системой доступно через Web-интерфейс, простота и удобство которого позволяет сконфигурировать сеть с минимальными знаниями об устройстве сетей.</p>\r\n<p>Существует два варианта поставки устройств:</p>\r\n<p>Комплект из одной точки доступа и контроллера - Ubiquiti UniFi</p>\r\n<p>Комплект из трех точек доступа и контроллера - Ubiquiti UniFi-3</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Невероятно низкая стоимость развертывание внутренней WiFi сети</li>\r\n<li>Удобство и высокая скорость монтажа устройств</li>\r\n<li>Интуитивно понятный программный контроллер, входящий в комплект поставки</li>\r\n<li>Неограниченная масштабируемость сети UniFi</li>\r\n</ul>\r\n<p>Используйте Ubiquiti UniFi для организации масштабируемых WiFi сетей внутреннего использования, например, для офисов, ресторанов, складских помещений, загородных домов.	</p>', 1, '2014-09-03'),
(142, '<p>В отличие от традиционных системы Wi-Fi предприятия, использующих аппаратные средства управления сетями WiFi, Ubiquiti Unifi использует виртуальное клиент-серверное приложение, которое не требует дополнительных финансовых затрат и никаких дополнительных устройств.</p>\r\n<p>С помощью интуитивно понятного программного обеспечения вы сможете без труда конфигурировать все ваши точки беспроводного досткпа UniFi.</p>\r\n<p>Точки доступа Ubiquiti UniFi-LR обладают последним в WiFi 802.11n технология MIMO и способны обеспечить линк на 300 Мбит/с. А ещё более мощная антенна увеличивает радиус покрытия до 300 метров.</p>\r\n<p>С помощью Ubiquiti UniFi вы сможете масштабировать вашу сеть до неограниченных размеров. Расширьте свою сеть от одного устройства до тысячи!</p>\r\n<p>Существует два варианта поставки устройств:</p>\r\n<p>Комплект из одной точки доступа и контроллера - Ubiquiti UniFi-LR</p>\r\n<p>Комплект из трех точек доступа и контроллера - Ubiquiti UniFi-LR-3</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Невероятно низкая стоимость развертывание внутренней WiFi сети</li>\r\n<li>Удобство и высокая скорость монтажа устройств</li>\r\n<li>Интуитивно понятный программный контроллер, входящий в комплект поставки</li>\r\n<li>Неограниченная масштабируемость сети UniFi</li>\r\n</ul>\r\n<p>Используйте Ubiquiti UniFi для организации масштабируемых WiFi сетей внутреннего использования, например, для офисов, ресторанов, складских помещений, загородных домов.	</p>', 1, '2014-09-03'),
(143, '<p>Так же как и предыдущие версии использует бесплатное виртуальное клиент-серверное приложение (контроллер), которое входит в комплект поставки данного оборудования.</p>\r\n<p>С помощью интуитивно понятного программного обеспечения вы сможете без труда конфигурировать все ваши точки беспроводного доступа UniFi.</p>\r\n<p>Точки доступа  Ubiquiti UniFi AP Pro  обладают возможностью работы по технологии MIMO 2x2 и MIMO 3x3, что дает возможность обеспечить линк 300 Мбит/с на частоте 5Ггц, а на частоте 2,4 Ггц до 450 Мбит/с. Антенна способна обеспечить в открытой видимости радиус покрытия до 300 метров.</p>\r\n<p>С помощью  Ubiquiti UniFi AP Pro вы сможете масштабировать вашу сеть до размеров, ограниченных лишь производительностью серверного оборудования!</p>\r\n<p>Существует два варианта поставки устройств:</p>\r\n<p>комплект из одной точки доступа  Ubiquiti UniFi AP Pro и контроллера</p>\r\n<p>Комплект из трех точек доступа  Ubiquiti UniFi AP Pro 3 pack и контроллера</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Невероятно низкая стоимость развертывание высокоскоростной WiFi сети</li>\r\n<li>Удобство и высокая скорость монтажа устройств</li>\r\n<li>Интуитивно понятный программный контроллер, входящий в комплект поставки</li>\r\n<li>Неограниченная масштабируемость сети  Ubiquiti UniFi AP Pro</li>\r\n</ul>\r\n<p>Используйте  Ubiquiti UniFi AP Pro  для организации масштабируемых WiFi сетей внутреннего использования, например, для офисов, ресторанов, складских помещений, загородных домов.</p>\r\n<p>Новое в данной модели:</p>\r\n<ul>\r\n<li>Антенна (разделение потоков). UniFi AP Pro обладает абсолютно новой по технологии встроенной круговой антенной MIMO 3x3.</li>\r\n<li>Качественная скорость. В отличии от предыдущих версий возросла в 2 раза, при минимальной мощности достигает 450 Мбит/с.</li>\r\n<li>Питание. Абсолютно новое РОЕ питание в линейке продукции Ubiquiti. Долгожданное питание 48В поставляется в комплекте с точками Ubiquiti UniFi AP Pro, что позволяет протянуть Ethernet кабель длиной до 70-80 метров, что не может не радовать любителей UniFi.</li>\r\n<li>Сетевой интерфейс. UniFi AP Pro имеет 2 порта Ethernet 10/100/1000, помимо того, что наличие гигабитного порта, позволяет пропустить гораздо больший объем трафика, но так же второй (Secondary) порт может запитывать совместимые устройства, например IP камеры напрямую.</li>\r\n</ul>\r\n<p>Функциональность программной платформы действительно включает в себя все необходимые опции. Вот некоторые из них:</p>\r\n<ul>\r\n<li>Централизованное управление WiFi сетью</li>\r\n<li>Легкая установка точек доступа и питание их через PoE.</li>\r\n<li>Большая зона покрытия.</li>\r\n<li>Простая установка контроллера на PC. Интуитивно понятный интерфейс управления сетью </li>\r\n<li>Масштабируемость сети, ограниченная лишь ресурсами сервера/PC. Как следствие минимальные затраты на оборудование и работы по расширению сети. </li>\r\n<li>Автоматического обновления ПО (при желании можно отключить) </li>\r\n<li>Создание групп сетей (подсетей) с возможностью управлениями прав доступа </li>\r\n<li>Управление трафиком</li>\r\n<li>Интерактивное управление с возможностью загрузки карт помещений. Отображение зоны покрытия и расположения точек доступа на картах помещений.</li>\r\n<li>Централизованная аутентификация клиентов на выделенном Radius сервере</li>\r\n</ul>						', 1, '2014-09-03'),
(144, '<p>NanoStation M2 - качественная точка доступа, позволяющая достичь более 100 Мбит/с максимальной пропускной способности TCPIP трафика.  Имеет 11 дБ направленную антенну. Работает по стандарту  802.11 b/g/n с поддержкой технологии MIMO - применение пространственного мультиплексирования с целью одновременной передачи нескольких информационных потоков по одному каналу, а также многолучевое отражение, которое обеспечивает доставку каждого бита информации соответствующему получателю с небольшой вероятностью влияния помех и потерь данных.</p>\r\n<p>Благодаря фирменному протоколу Ubiquiti AirMAX устройство способно пропускать гораздо больше одновременных потоков информации без потери в скорости по сравнению с другими устройствами стандартов 802.11 b/g/n.</p>\r\n<p>Встроенная антенна позволяет использовать данные моделидля создания высокоскоростных мостов до 4 км. Процессор Atheros 400MHzи оперативная память 32MB позволяют использовать устройства дляобъединения малых и средних локальных сетей (до 40 рабочих станций).</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Высокая скорость</li>\r\n<li>Удобство эксплуатации и монтажа</li>\r\n<li>Производительность</li>\r\n</ul>\r\n<p>Используйте Ubiquiti NanoStation M2 при создании беспроводных мостов до 4 км для объединения локальных сетей./<p>', 1, '2014-09-07'),
(145, '<p>Ubiquiti NanoStation Loco M2 - уменьшенный/упрощенный вариант TDMA NanoStation M2. Так же представляет из себя качественную точку доступа с поддержкой стандарта 802.11n, благодаря чему обеспечивается скорость соединения до 150 Мбит/с TCPIP трафиком до 100 Мбит/с. В отличие от NAnoStation M2 данная модель имеет больший угол раскрытия диаграммы направленности, пониженную мощность передатчика и , соответственно меньший габаритный размер, что делает ubiquiti NanoStation Loco M2 идеальным внешним клиентом для подключения к сетям стандарта 802.11n.</p>\r\n<p>Высокую скорость и устойчивость к помехам обеспечивает технология MIMO - применение пространственного мультиплексирования с целью одновременной передачи нескольких информационных потоков по одному каналу, а также многолучевое отражение, которое обеспечивает доставку каждого бита информации соответствующему получателю с небольшой вероятностью влияния помех и потерь данных.</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Высокая скорость</li>\r\n<li>Удобство эксплуатации и монтажа</li>\r\n<li>Производительность</li>\r\n</ul>\r\n<p>Используйте Ubiquiti NanoStation Loco M2 подключения к сетям стандарта 802.11n и 802.11b/g.</p>\r\n		', 1, '2014-09-07'),
(146, '<p>Ubiquiti NanoStation M5 - высокоскоростная точка доступа с поддержкой нового стандарта 802.11n , обеспечивает скорость соединения до 150 Мбит/с TCPIP трафиком до 100 Мбит/с.</p>\r\n<p>Высокую скорость и устойчивость к помехам обеспечивает технология MIMO - применение пространственного мультиплексирования с целью одновременной передачи нескольких информационных потоков по одному каналу, а также многолучевое отражение, которое обеспечивает доставку каждого бита информации соответствующему получателю с небольшой вероятностью влияния помех и потерь данных.</p>\r\n<p>Встроенная 16 Дби антенна позволяет использовать точки NanoStation M5 для создания высокоскоростных мостов до 5 км. Процессор Atheros 400MHz и оперативная память 32MB позволяют использовать устройства для объединения малых и средних локальных сетей (до 40 рабочих станций).</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Высокая скорость</li>\r\n<li>Удобство эксплуатации и монтажа</li>\r\n<li>Производительность</li>\r\n</ul>\r\n<p>Используйте Ubiquiti NanoStation M5 при создании беспроводных мостов до 5 км для объединения локальных сетей.</p>', 1, '2014-09-07'),
(147, '<p>Ubiquiti NanoStation Loco M5 - уменьшенный/упрощенный вариант TDMA NanoStation M5. Так же представляет из себя качественную точку доступа с поддержкой стандарта 802.11n, благодаря чему обеспечивается скорость соединения до 150 Мбит/с TCPIP трафиком до 100 Мбит/с. В отличие от NAnoStation M5 данная модель имеет больший угол раскрытия диаграммы направленности, пониженную мощность передатчика и, соответственно меньший габаритный размер, что делает ubiquiti NanoStation Loco M5 идеальным внешним клиентом для подключения к сетям стандарта 802.11n.</p>\r\n<p>Высокую скорость и устойчивость к помехам обеспечивает технология MIMO - применение пространственного мультиплексирования с целью одновременной передачи нескольких информационных потоков по одному каналу, а также многолучевое отражение, которое обеспечивает доставку каждого бита информации соответствующему получателю с небольшой вероятностью влияния помех и потерь данных.</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Высокая скорость</li>\r\n<li>Удобство эксплуатации и монтажа</li>\r\n<li>Производительность</li>\r\n</ul>\r\n<p>Используйте Ubiquiti NanoStation Loco M5 подключения к сетям стандарта 802.11n и 802.11a.</p>', 1, '2014-09-07'),
(148, '<p>Ubiquiti PicoStation M2 HP используется для быстрого развертывании сети! Точка-ретранслятор мощностью 630 мВт, для покрытия локальных мертвых зон. Самая маленькая в мире точка внешнего исполнения. В комплект входит антенна.\r\n<p>Используйте PicoStation M2-HP для покрытия wi-fi сетью дачных участков или небольших территорий.</p>\r\n<p>Используйте  PicoStation M2-HP в качестве точки-ретранслятора в городских условиях.</p>', 1, '2014-09-07'),
(149, '<p>Новая точка доступа в линейке UniFi  -  UniFi AP AC Outdoor, работающая в самом современном стандарте передачи данных 802.11ac. В отличии от UniFi AC она предназначена для установки на улице или помещениях с более жесткими чем обычно условиями. Имеет 6 антенн с коэффициентом усиления 5 dBi каждая, по три для каждого из основных диапазонов частот (2,4 и 5 ГГц). Антенны спрятаны под специальным колпаком представляющим собой основную часть корпуса устройства.</p>\r\n<p>UniFi AP AC Outdoor Отличается большим весом при сравнительно маленьких габаритах и простым, но симпатичным дизайном.</p>\r\n<p>Стандарт 802.11ac позволяет устанавливать беспроводное соединение с клиентским устройством на скоростях до 1300 Мбит/с, что само по себе выводит данное устройство на совершенно новый уровень, но и кроме прочего добавляет несколько новшеств сопутствующих новому стандарту. Среди них хотелось бы выделить одно особенно приятное для интеграторов и пользователей под названием Beamforming.</p>\r\n<p>Beamforming, встроенный в UniFi AC Outdoor позволяет передатчику определять примерное местонахождение клиента и направлять сигнал в его сторону. Это положительно сказывается на радиусе действия точки доступа и снижает энергопотребление.</p>', 1, '2014-09-07'),
(150, '<p>В отличие от традиционных системы Wi-Fi предприятия, использующих аппаратные средства управления сетями WiFi, Ubiquiti Unifi использует виртуальное клиент-серверное приложение, которое не требует дополнительных финансовых затрат и никаких дополнительных устройств.</p>\r\n<p>С помощью интуитивно понятного программного обеспечения вы сможете без труда конфигурировать все ваши точки беспроводного досткпа UniFi.</p>\r\n<p>Точки доступа Ubiquiti UniFi Outdoor обладают последним в WiFi 802.11n технология MIMO и способны обеспечить линк на 300 Мбит/с. А ещё более мощная антенна и внешнее исполнение увеличивает радиус покрытия до 300 метров.</p>\r\n<p>Преимущества:</p>\r\n<ul>\r\n<li>Низкая стоимость развертывание внешней WiFi сети</li>\r\n<li>Удобство и высокая скорость монтажа устройств</li>\r\n<li>Интуитивно понятный программный контроллер, входящий в комплект поставки</li>\r\n<li>Неограниченная масштабируемость сети Ubiquiti UniFi</li>\r\n</ul>\r\n<p>Используйте Ubiquiti UniFi Outdoor для организации масштабируемых WiFi сетей внешнего использования в совокупности с внутренними устройствами Unifi, например, для территорий предприятий, офисов, ресторанов, складских помещений, промышленных объектов и т.д.</p>\r\n<p>Ubiquiti UniFi Outdoor относится к сегменту корпоративного WiFi. Особенностью систем этого сегмента является наличие ПО ввиде контроллера, который дает возможность организации централизованной WiFi сети. Стоимость программного контроллера измеряется тысячами долларов. К тому же лишь немногие производители сетевого оборудования предлагали решения для сегмента Enterprise. В связи с этими условиями данные решения оставались недоступными для сегментов малого и среднего бизнеса, неговоря уже о домашних сетях. А интеграторы "изыскивали" различные способы для обслуживания такого рода задач, что "усложняло им жизнь", ведь необходимо было не только решить задачу, но и сохранить привлекательность стоимости решения. Это было до сих пор. Ubiquiti UniFi Outdoor занял эту нишу. Компания Ubiquiti Networks продолжает "радовать" интеграторов и конечных пользователей своими решениями, которых отличают низкая стоимость решения, при их функциональности и качестве!<p>', 1, '2014-09-07'),
(151, '<p>Ubiquiti UniFi AC - это новый флагман от компании Ubiquiti, точку доступа WiFi предназначенную для использования в закрытых помещения под названием  UniFi AC. Данное устройство входит в линейку UniFi  специально созданную для сетей Enterprise WiFi. РАБОТАЕТ ОДНОВРЕМЕННО В 2-Х ДИАПАЗОНАХ 2,4 и 5 ГГц.</p>\r\n<p>Точка доступа имеет нестандартную для данной линейки квадратную форму корпуса, но сохранила основное направление дизайна , что хорошо заметно по цвету и материалу корпуса а также расположению индикатора состояния. Не претерпело изменений и исполнение корпуса, по прежнему подразумевающее настенное и потолочное крепление устройства.  Стоит так же отметить, что впервые взяв UniFi AC в руки становится очевидным его большой в сравнении с аналогами вес, не больше не меньше 508 грамм без элементов крепления, при сравнительно небольших габаритах 200 х 204 х 27 мм. Все эти изменения становятся вполне очевидными как только Вы возьметесь за сопроводительную документацию, далее как раз об этом.</p>\r\n<p>UniFi AC кроме уже привычных всем стандартов передачи данных 802.11a,b,g и n обзавелась так называемым WiFi 5-го поколения получившим официальное наименование 802.11ac. Это новшество позволит устанавливать беспроводное соединение с клиентским устройством на скоростях до 1300 Мбит/с, что само по себе выводит данное устройство на совершенно новый уровень, но и кроме прочего добавляет несколько новшеств сопутствующих новому стандарту. Среди них хотелось бы выделить одно особенно приятное для интеграторов и пользователей под названием Beamforming.</p>\r\n<p>Beamforming позволяет передатчику определять примерное местонахождение клиента и направлять сигнал в его направлении. Это положительно скажется на радиусе действия точки доступа и снизит энергопотребление. Новшество стало возможным благодаря увеличенному количеству антенн, а их у UniFi AC аж 6 штук. Конечно не все задействуются в данном процессе, т.к. три из них предназначены для работы в частотном диапазоне 2,4 ГГц и поддержания более старых стандартов, но как выяснилось трех оставшихся вполне для этого хватает.</p>\r\n<p>Вот мы и подошли к тому, что заставило производителя изменить привычную нам всем форму устройства линейки UniFi. Во первых это необходимость во внутреннем пространстве, ведь большое количество антенн и усилителей не только обуславливает вес устройства, но и повышает площадь печатной платы, а это в свою очередь вынуждает либо увеличивать размеры корпуса, либо делать его более эргономичным и соответствующим форме начинки. Последнее мы и наблюдаем. Во вторых позволяет производителю и пользователю провести довольно зримую черту между  UniFi AC и его предшественниками отмечая ею новую ступень в развитии беспроводных технологий передачи данных.</p>', 1, '2014-09-07'),
(152, 'Модуль для 32 цифровых абонентов.', 1, '2015-05-13'),
(154, 'Плата TMU обеспечивает прием и передачу тоновых сигналов, музыку на удержании (Music on Hold) и функции конференции. Максимум 4 таймслота могут быть задействованы для DTMF сигналов. И 3 тамйслота для приемников диалтона (Dialtone). Остальные таймслоты могут быть задействованы для обеспечения конференции и передачи тональных сигналов.\r\nКол-во внутренних аналоговых номеров на на кол-во TMU:\r\n0-119 --- 1\r\n120-239 --- 2\r\n240-359 --- 3\r\n360-479 --- 4\r\n480 --- 5	', 1, '2015-05-13'),
(155, 'Плата предназначена для MX-ONE версии 4.X. Выполняет функцию платы LSU, DSU. Обеспечивает 256 VoIP каналов и 8 интерфейсов E1.', 1, '2015-05-13'),
(159, 'Печатная плата ALU2 устанавливается в любое место в LIM. Плата ALU2 предназначена для приема и передачи внешних алармов и обеспечивает защиту от перенапряжение аварийных интерфейсов.', 1, '2015-05-15'),
(160, 'Это SNMP агент для системы MD-110/MX-One. Агент имеет возможность подключения к Ethernet, интерфейсы RS 232 и память. Rs 232 каналы могут быть использованы для конфигурирования, подключения модема и подключения к системе MD-110/MX-One. Агент будет управляться из SNMP менеджера. Менеджер посылает/принимает SNMP комманды через Ethernet или модем Modem в/из одиного или нескольких агентов.', 1, '2015-05-15'),
(161, 'Коммутация в LIM построена на 2-х главных функциональных блоков. Эти 2 блока реализованы на 2-х различных печатных платах. Они называются LSU (Lim Switch Unit) и DSU (Distributed Switch Unit). 2 функциональности это: распределение сигналов между программным обеспечением и платами. Эта схема реализована на DSU. И коммутация 1024-х однонаправленных каналов для голоса или данных. Реализовано на LSU.', 1, '2015-05-15'),
(162, 'ELU26 - модуль цифровых абонентов. ELU26 обеспечивает уровень 1 и уровень 2 для 4-х ISDN BRI S-интерфейсов. Каждый S-интерфейс имеет скорость 192 кбит/сек. Из которых 2*64 кбит/сек (2 B-канала) предназначены для голоса и данных. 16 кбит/сек (D канал) для сигнализации и 48 кбит/сек для заголовков. Возможно подсоединить до 8 ISDN терминалов на каждую абонентскую линию.\r\n\r\nМаксимальное кол-во портов на LIM - 128.', 1, '2015-05-15'),
(163, 'Это плата DECT-интерфейса для подсоединения DECT радио базовых станций RFP. ELU31 может подключать до 8-ми базовых станций по 2-х парному (4-х проводному) интерфейсу. Каждый интерфейс базовой станции обеспечивает 8 голосовых каналов для абонентов.\r\n\r\nМаксимальное кол-во баз (BS330,BS340) на LIM - 120.\r\n\r\nМаксимальное кол-во плат ELU31 на LIM - 10.\r\n\r\nМаксимальное кол-во плат ELU31 на магазин - 5.	', 1, '2015-05-15'),
(164, 'Плата компьютера. Занимает 2 таймслота. Выполняет различные функции в зависимости от загруженного программного обеспечения. В MD110 и MX-ONE TSW обычно используется для установки MX-ONE Messaging (голосовая почта) на операционной системе Windows. В системе MX-ONE Server так же используется в качестве управляющего сервера (процессора) на основе операционной системы Linux. А, так же, может быть использован с любыми другими приложениями, требующими установки на компьютер.	', 1, '2015-05-15'),
(165, 'Функциональность данной платы заключается в синхронизации коммутационной активности в групповом коммутаторе.', 1, '2015-05-18'),
(166, 'Плата GJUL4 – цифровые соединительные линии LIM и GS. Разработана для обеспечения уровны 1 и уровня 2 SS7. Главная функция – соединение 30 канального PCM-линка между LIM и GS. Так же по одному каналу используется для синхронизации и передачи сигнальных сообщений.', 1, '2015-05-18'),
(167, 'Это плата VoIP Обеспечивает функциональность GW и GK. Поддерживает различные голосовые кодеки, факс over IP, шифрование, DTMF, VLAN и COS. Голосовой процессор поддерживает до 32-х GW и 64-х GK. Общее кол-во вызовов всегда 96. IPLU имеет 2 внешних интерфейса. 1 порт для Ethernet и 1 порт RS232 для отладки.', 1, '2015-05-18'),
(168, 'Плата процессора. Обеспечивающая функциональность LIM. Имеет интерфейс для подключения платы NIU2 и платы LSU. А так же интерфейс для подключения LOG-дисплея для снятия кодов состояния в отсутствии подключенного компьютера с системой управления.', 1, '2015-05-18'),
(169, 'Коммутация в LIM построена на 2-х главных функциональных блоков. Эти 2 блока реализованы на 2-х различных печатных платах. Они называются LSU (Lim Switch Unit) и DSU (Distributed Switch Unit). 2 функциональности это: распределение сигналов между программным обеспечением и платами. Эта схема реализована на DSU. И коммутация 1024-х однонаправленных каналов для голоса или данных. Реализовано на LSU.\r\n\r\nОбеспечивает неблокируемую коммутацию 1024 каналов. Распределяет программные сигналы для абонентских плат.', 1, '2015-05-18'),
(170, 'Коммутация в LIM построена на 2-х главных функциональных блоков. Эти 2 блока реализованы на 2-х различных печатных платах. Они называются LSU (Lim Switch Unit) и DSU (Distributed Switch Unit). 2 функциональности это: распределение сигналов между программным обеспечением и платами. Эта схема реализована на DSU. И коммутация 1024-х однонаправленных каналов для голоса или данных. Реализовано на LSU.\r\n\r\nОбеспечивает неблокируемую коммутацию 1024 каналов. Распределяет программные сигналы для абонентских плат.', 1, '2015-05-18'),
(171, 'Это плата многочастотной сигнализации. Разработана для поддержки приема и предачи различных типов многочастотной сигнализации между MX-ONE и другими станциями. MFU занимает 8 таймслотов 6 из которых он использует для следующих задач (6 для приема и 6 для передачи). Каждый индивидуалов может быть назначен для обработки различных типов многочастотной сигнализации, как R2, 2ВСК и т.д.', 1, '2015-05-18'),
(172, 'Часть системы ввода-вывода и предназначена для обеспечения портов ввода-вывода в в системе. Различные интерфейсы вода вывода поддерживаются. Такие как, например: 3 асинхронных порта (COM порта), 1 LAN порт 10 BaseT, 1 ATA-интерфейс, CF-интерфейс (слот на плате). Главное отличие между NIU и NIU2 заключается в том, что в NIU2 удален SCSI-интерфейс и добавлен CF-интерфейс. Так же, на NIU2 удален интерфейс 10 Base2.\r\n\r\nМаксимальное кол-во плат на LIM - 4.\r\n\r\nМаксимальное кол-во плат на систему - 124.', 1, '2015-05-18'),
(173, 'Это служебная плата для цифровых сигнальных процессов. SPU4 оборудованиа 8-ю DSP, которые могут быть использованы для различных приложения в зависимости от загруженного программного обеспечения. SPU4 имеет внешний интерфейс для подключения ATA HDD, Ethernet, V24 и тестового оборудования. Есть возможность подключения к плате Mobile Extension.\r\n\r\nДля версии станции MD110 выше BC9, требуются лицензии на каждый порт.\r\n\r\nКол-во DTMF портов на плату SPU4 - 32.\r\n\r\nМаксимальное кол-во портов на LIM - 640.\r\n\r\nМаксимальное кол-во плат SPU4 на систему - 744.\r\n\r\nМаксимальное кол-во портов на систему - около 16 000.\r\n\r\nМаксимальное кол-во плат SPU4 на LIM - 6.', 1, '2015-05-18'),
(174, 'Плата цифровых соединительных линий. Обеспечивает уровень 1 и уровень 2 функциональности для 2-х мегабитного интерфейса с сигнализацией ISND PRI 30B+D.\r\n\r\nМаксимальное кол-во портов на LIM - 240.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.', 1, '2015-05-18'),
(175, 'Плата цифровых соединительных линий. Обеспечивает уровень 1 и уровень 2 функциональности для 2-х мегабитного интерфейса с сигнализацией DPNSS и DAS2.\r\n\r\nМаксимальное кол-во портов на LIM - 240.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.', 1, '2015-05-18'),
(176, 'Плата цифровых соединительных линий. Обеспечивает уровень 1 и уровень 2 функциональности для 2-х мегабитного интерфейса с сигнализацией CAS.\r\n\r\nМаксимальное кол-во портов на LIM - 90.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.', 1, '2015-05-18'),
(177, 'Плата цифровых соединительных линий. Обеспечивает уровень 1 и уровень 2 4-х ISDN BRI интерфейсов. T-интерфейс. Каждый BRI-интерфейс на плате TLU79 может быть индивидуально использован на стороне Master(сеть) и на стороне Slave(пользователь). Каждый T-интерфейс имеет скорость 192 кбит/cек. TLU79 имеет 2 различных индекса: /1 с защитой от перенапряжения. /2 без защиты от перенапряжения.\r\n\r\nМаксимальное кол-во портов на LIM - 240.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.		', 1, '2015-05-18'),
(178, 'Плата узловых аналоговых соединительных линий для трафика между АТС использования E&M сигнализации. Плата может поддерживать различные E&M сигнальные схемы. Следующие типы функциональности поддерживаются.\r\n\r\n1 – голосовые каналы по 2-м или 4-м проводам (жилам). E&M сигнализация "с" или "без" блокировки. Тоновая сигнализация на голосовом канале, согласно различным сигнальным схемам.\r\n\r\nМаксимальное кол-во портов на LIM - 99.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.', 1, '2015-05-18'),
(179, 'Плата 2-х проводных аналоговых соединительных линий (СO). Имеет 12 интерфейсов на плате.\r\n\r\nМаксимальное кол-во портов на LIM - 99.\r\n\r\nМаксимальное кол-во портов на систему - около 5 000.', 1, '2015-05-18'),
(180, 'Плата включает функциональность по записи, воспроизведения, копированию и хранению голосовых сообщений. Голосовые сообщения записываются как файлы на плату. На поддерживаемой с помощью батареи диска, контролирующего файловую систему VSU. Для увеличения емкости плата EMU дополнительно устанавливается на плату VSU.	', 1, '2015-05-18'),
(181, 'Основной системный модуль А470.	', 1, '2015-05-19'),
(203, 'Модули DSP располагаются на карте менеджера вызовов друг над другом и не занимают никаких слотов, выделенных под интерфейсные карты.\r\nОтдельным блоков DSP на модулях DSP могут быть назначены одна или больше функций. Для этого в чипы DSP должно загружаться различное микропрограммное обеспечение. Ресурсы DSP могут использоваться для DECT телефонии, голосовой связи типа VoIP, голосовой почты, громкой связи, реализации функций интегрированных мобильных телефонов или передачи факсимильной информации. Это означает, что для каждого чипа DSP под соответствующие функции доступно конкретное количество голосовых каналов. Некоторые из этих функций подлежат лицензированию.\r\n<ul>\r\n<li>DECT<br>\r\nФункционирование DECT-системы на интерфейсах DSI с беспроводными телефонами. В случае соединений между DECT и не DECT конечными пунктами голосовые данные должны быть преобразованы. Этот процесс требует производительности DSP.<br>\r\nКаналы DECT могут использоваться без лицензии.</li>\r\n<li>VoIP<br>\r\nСоединения между IP и не IP конечными точками создаются через IP медиашлюз. Этот процесс выполняется с помощью встроенного стандартного медиа-коммутатора, который переключают каналы VoIP для разговорных соединений в IP-сети. Стандартный медиа-коммутатор (Standard Media Switch) использует ресурсы DSP для обработки данных о вызовах в реальном времени. Каналы VoIP всегда требуется использовать между IP и не IP конечными точками, например, для создания внутренних соединений между SIP/IP телефоном и цифровым системным телефоном или, например, для обслуживания пользователя, который маршрутизируется на внутреннюю систему голосовой почты через SIP сетевой интерфейс.</li>\r\n<li>FoIP<br>\r\nНадежная передача факсимильной информации в реальном времени через IP сеть с использованием протокола факсимильной связи T.38 (ITU-T).<br>\r\nКаналы FoIP могут использоваться без лицензии.</li>\r\n<li>Audio<br>\r\nЭти голосовые каналы используются для воспроизведения и записи аудиоданных. Каждому голосовому каналу также выделяется DTMF приемник, чтобы разрешить ввод данных пользователем во время воспроизведения.<br>\r\nЭто требует наличия ресурсов DSP и лицензии.</li>\r\n<li>GSM<br>\r\nДля интегрированных мобильных телефонов достигается расширенная функциональность за счет предоставления специальных приемников DTMF во время подключения вызова. В результате могут быть выполнены функции суффиксного набора номера (такие как справочные вызовы или функции, необходимые для установления конференции с помощью кодов функций). Количество каналов GSM и, следовательно, количество приемников DTMF зависит от количества пользователей с интегрированными мобильными телефонами, которые хотят использовать эту функциональность одновременно.</li>\r\n<li>FXO<br>\r\nБазовые ресурсы (фиксированные функции DSP на карте менеджера вызовов) занимают 16 интерфейсов FXO. Для конфигураций системы с использованием больше чем 16 интерфейсов FXO такая настройка обеспечивает предоставление функций приемников дополнительного [тонального] сигнал готовности к набору номера и сигнала занятости. Примечание: Значения определяемых пользователем каналов FXO соответствуют количеству интерфейсов FXO, а не количеству приемников дополнительного [тонального] сигнала готовности к набору номера и приемников сигнала занятости.</li>\r\n</ul>\r\n	', 1, '2015-05-29'),
