(205, 'Модули DSP располагаются на карте менеджера вызовов друг над другом и не занимают никаких слотов, выделенных под интерфейсные карты.<br>\r\nОтдельным блоков DSP на модулях DSP могут быть назначены одна или больше функций. Для этого в чипы DSP должно загружаться различное микропрограммное обеспечение. Ресурсы DSP могут использоваться для DECT телефонии, голосовой связи типа VoIP, голосовой почты, громкой связи, реализации функций интегрированных мобильных телефонов или передачи факсимильной информации. Это означает, что для каждого чипа DSP под соответствующие функции доступно конкретное количество голосовых каналов. Некоторые из этих функций подлежат лицензированию.<br>\r\nПо сравнению с модулями DSP модули с обозначением DSPX оборудуются чипами, более мощными в отношении возможностей цифровой обработки сигналов. Они используются для передачи данных VoIP среди других данных с использованием протокола SRTP (Secure VoIP).<br>\r\n<ul>\r\n<li>DECT<br>\r\nФункционирование DECT-системы на интерфейсах DSI с беспроводными телефонами. В случае соединений между DECT и не DECT конечными пунктами голосовые данные должны быть преобразованы. Этот процесс требует производительности DSP.<br>\r\nКаналы DECT могут использоваться без лицензии.</li>\r\n<li>VoIP<br>\r\nСоединения между IP и не IP конечными точками создаются через IP медиашлюз. Этот процесс выполняется с помощью встроенного стандартного медиа-коммутатора, который переключают каналы VoIP для разговорных соединений в IP-сети. Стандартный медиа-коммутатор (Standard Media Switch) использует ресурсы DSP для обработки данных о вызовах в реальном времени. Каналы VoIP всегда требуется использовать между IP и не IP конечными точками, например, для создания внутренних соединений между SIP/IP телефоном и цифровым системным телефоном или, например, для обслуживания пользователя, который маршрутизируется на внутреннюю систему голосовой почты через SIP сетевой интерфейс.</li>\r\n<li>FoIP<br>\r\nНадежная передача факсимильной ин