(236, 'Кабинет  BP 250 (9 сл) в сборе (вкл.материнскую плату, переднюю и нижнюю крышки, кабель соединения системной стойки и блока питания).', 1, '2015-06-16'),
(237, 'Плата предназначена для подключения аналоговых соединительных линий с АТС сети общего пользования. На определенных рынках может использоваться также для DID (прямого входящего набора). В случае нарушения электроснабжения 1-4 соединительные линии могут быть проключены на аналоговые абонентские телефонные аппараты.', 1, '2015-06-16'),
(238, 'Плата предназначена для подключения аналоговых соединительных линий с АТС сети общего пользования. На определенных рынках может использоваться также для DID (прямого входящего набора). В случае нарушения электроснабжения 1-4 соединительные линии могут быть проключены на аналоговые абонентские телефонные аппараты.', 1, '2015-06-16'),
(239, 'Это плата для базового доступа ISDN. Плата обеспечивает цифровое подсоединение в формате 2B+D к АТСсети общего пользования, а также абонентские интерфейсы к S-шинным терминалам.', 1, '2015-06-16'),
(240, 'Это плата для базового доступа ISDN. Плата обеспечивает цифровое подсоединение в формате 2B+D к АТСсети общего пользования, а также абонентские интерфейсы к S-шинным терминалам.', 1, '2015-06-16'),
(241, 'BTU-D обеспечивает соединение по стандарту G.703/G.704 с сигнализацией CAS или DSS1/QSIG (в зависимости от установленного программного обеспечения).\r\n\r\nДополнительно содержит 12 приемников MFC/MFE, DTMF, внешних тональных сигналов.', 1, '2015-06-16'),
(242, 'CPU-D5 имеет следующие функции: центрального процессора, памяти программ и данных; устройства конференц-связи; коммутатора; системных часов истинного времени; 3х портов V.24, которые могут использоваться для целей, таких как, эксплуатации и техническое обслуживание , работа с CIL или с гостиничным компьютером; одного конфигурируемого порта RS 485 для связи на дальние расстояния; модема V.32bis для дистанционного технического обслуживания; средства подключения датчика температуры; подключение FECU; аудиопорта для музыки удержания вызова буфера данных на 500 записей.', 1, '2015-06-16'),
(243, 'CPU-D5 имеет следующие функции: центрального процессора, памяти программ и данных; устройства конференц-связи; коммутатора; системных часов истинного времени; 3х портов V.24, которые могут использоваться для целей, таких как, эксплуатации и техническое обслуживание , работа с CIL или с гостиничным компьютером; одного конфигурируемого порта RS 485 для связи на дальние расстояния; модема V.32bis для дистанционного технического обслуживания; средства подключения датчика температуры; подключение FECU; аудиопорта для музыки удержания вызова буфера данных на 500 записей.', 1, '2015-06-16');
INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(244, 'Позволяет подключать стандартные аналоговые DTMF телефоны или телефоны с дисковым номеронабирателем и имеет 4 DTMF приемника на плате. ELU-A/2 обеспечивает также поддержку реверса полярности линий (переплюсовку) для телефонов со световыми индикаторами ожидания сообщения.', 1, '2015-06-16'),
(245, 'Позволяет подключать стандартные аналоговые DTMF телефоны или телефоны с дисковым номеронабирателем и имеет 4 DTMF приемника на плате. ELU-A/2 обеспечивает также поддержку реверса полярности линий (переплюсовку) для телефонов со световыми индикаторами ожидания сообщения.', 1, '2015-06-16'),
(246, 'Позволяет подключать стандартные аналоговые DTMF телефоны или телефоны с дисковым номеронабирателем и имеет 4 DTMF приемника на плате. ELU-A/2 обеспечивает также поддержку реверса полярности линий (переплюсовку) для телефонов со световыми индикаторами ожидания сообщения.', 1, '2015-06-16'),
(247, 'Плата позволяет подключать цифровые системные телефоны.', 1, '2015-06-16'),
(248, 'Плата позволяет подключать цифровые системные телефоны.', 1, '2015-06-16'),
(249, 'Плата позволяет подключать цифровые системные телефоны.', 1, '2015-06-16'),
(250, 'Модуль IC-CU2 - процессор системы DECT – GАP протокол, обеспечивает до 210 мобильных абонентов.\r\n\r\nНа модуль IC-CU2 можно подключить 4 базовых станции.\r\n\r\nПоддерживает 8 разговорных каналов.', 1, '2015-06-16'),
(251, 'Модуль IC-LU - модуль для подключения 8 базовых станции стандарта DECT.\r\n\r\nПоддерживает 8 разговорных каналов. \r\n\r\nВнутренне или внешние питание базовых станций, если требуется, выбирается переключателем.', 1, '2015-06-16'),
(252, 'Интерфейс Ethernet 10BaseT/100BaseTX.\r\n\r\nПоддержка функций Gatekeeper и Extension-Gateway.\r\n\r\nВозможность управления станцией через плату IPU и для интерфейсов CTI.\r\n\r\nПоддержка H.323 клиентов (только в R13 и выше) и соединительных линий.\r\n\r\nДо 3-х 16 канальных голосовых модулей (DSM).', 1, '2015-06-16'),
(253, 'Представляет модуль BTU-D без возможности подключения потока.', 1, '2015-06-16'),
(254, '8/16 каналов для голосовых функций.\r\n\r\nМогут быть определены 4 регистра для приема DTMF и MFC сигналов(определяется переключателями на плате).', 1, '2015-06-16'),
(262, '<p>Универсальная карта ресурсов и интерфейсов подключения внешних устройств 8DRCF устанавливается в сервисный слот основного кабинета и содержит:</p>\r\n<ul>\r\n<li>8 приемников-декодеров DTMF сигналов;</li>\r\n<li>8 приемников тональных акустических сигналов ("занято", "ответ станции" и т.д.);</li>\r\n<li>56k модем для удаленного администрирования;</li>\r\n<li>3 последовательных интерфейса ввода/вывода (RS232) для программирования и подключения внешних устройств;</li>\r\n<li>2 порта подключения внешних источников музыкального сопровождения;</li>\r\n<li>порт для подключения внешнего устройства системы громкоговорящего оповещения;</li>\r\n<li>3 релейных выхода для управления внешними устройствами;</li>\r\n<li>6 схем трехсторонних конференций с участием цифровых соединительных линий;</li>\r\n<li>схема конференции (селекторного совещания с управляемыми микрофонами) на 6 участников.</li>\r\n</ul>', 1, '2015-11-27'),
(263, '<p>Карта цифровых конференций. 2 порта.</p>\r\n<p>Конфигурация порта – 8 трехсторонних конференций или конференция \r\nна 15 участников.</p> <p>Для создания конференций и селекторных совещаний \r\nс большим числом участников необходимо использование карты ISDN BRI \r\nдля объединения портов карт CNF в общую конференцию.</p>', 1, '2015-11-27'),
(264, '<p>Карта цифровых соединительных линий универсальная, поддержка сигнализаций:</p>\r\n<ul>\r\n<li>EDSS1;</li>\r\n<li>2ВСК (R1.5), ИСЛ/ВСЛ/СЛМ/ЗСЛ, декадный набор / импульсный челнок / импульсный пакет 1,2 / безинтервальный пакет;</li>\r\n<li>2ВСК, комплекты прямых абонентов, декадный набор/DTMF;</li>\r\n<li>1ВСК, индуктивный код /безинтервальный пакет;</li>\r\n<li>E&M, декадные импульсы / DTMF;</li>\r\n<li>поддержка удаленных мультиплексоров ИКМ-30 для работы с каналами ТЧ – 2100 Гц ручной коммутатор, 600+750 Гц, 1200+1600 Гц.</li>\r\n</ul>\r\n<p>4 интерфейса G.703, возможность выделения и вставки каналов в режиме ВСК, прозрачный транзит неиспользуемых каналов, произвольное логическое распределение 30 каналов.\r\n</p>		', 1, '2015-11-27'),
(265, '<p>Карта цифровых соединительных линий универсальная, поддержка сигнализаций:</p>\r\n<ul>\r\n<li>EDSS1;</li>\r\n<li>2ВСК (R1.5), ИСЛ/ВСЛ/СЛМ/ЗСЛ, декадный набор / импульсный челнок / импульсный пакет 1,2 / безинтервальный пакет;</li>\r\n<li>2ВСК, комплекты прямых абонентов, декадный набор/DTMF;</li>\r\n<li>1ВСК, индуктивный код /безинтервальный пакет;</li>\r\n<li>E&M, декадные импульсы / DTMF;</li>\r\n<li>поддержка удаленных мультиплексоров ИКМ-30 для работы с каналами ТЧ – 2100 Гц ручной коммутатор, 600+750 Гц, 1200+1600 Гц.</li>\r\n</ul>\r\n<p>4 интерфейса G.703, возможность выделения и вставки каналов в режиме ВСК, прозрачный транзит неиспользуемых каналов, произвольное логическое распределение 60 каналов.\r\n</p>			', 1, '2015-11-27'),
(266, '<p>Карта цифровых соединительных линий универсальная, поддержка сигнализаций:</p>\r\n<ul>\r\n<li>EDSS1;</li>\r\n<li>2ВСК (R1.5), ИСЛ/ВСЛ/СЛМ/ЗСЛ, декадный набор / импульсный челнок / импульсный пакет 1,2 / безинтервальный пакет;</li>\r\n<li>2ВСК, комплекты прямых абонентов, декадный набор/DTMF;</li>\r\n<li>1ВСК, индуктивный код /безинтервальный пакет;</li>\r\n<li>E&M, декадные импульсы / DTMF;</li>\r\n<li>поддержка удаленных мультиплексоров ИКМ-30 для работы с каналами ТЧ – 2100 Гц ручной коммутатор, 600+750 Гц, 1200+1600 Гц.</li>\r\n</ul>\r\n<p>4 интерфейса G.703, возможность выделения и вставки каналов в режиме ВСК, прозрачный транзит неиспользуемых каналов, произвольное логическое распределение 90 каналов.\r\n</p>		', 1, '2015-11-27'),
(267, '<p>Карта цифровых соединительных линий универсальная, поддержка сигнализаций:</p>\r\n<ul>\r\n<li>EDSS1;</li>\r\n<li>2ВСК (R1.5), ИСЛ/ВСЛ/СЛМ/ЗСЛ, декадный набор / импульсный челнок / импульсный пакет 1,2 / безинтервальный пакет;</li>\r\n<li>2ВСК, комплекты прямых абонентов, декадный набор/DTMF;</li>\r\n<li>1ВСК, индуктивный код /безинтервальный пакет;</li>\r\n<li>E&M, декадные импульсы / DTMF;</li>\r\n<li>поддержка удаленных мультиплексоров ИКМ-30 для работы с каналами ТЧ – 2100 Гц ручной коммутатор, 600+750 Гц, 1200+1600 Гц.</li>\r\n</ul>\r\n<p>4 интерфейса G.703, возможность выделения и вставки каналов в режиме ВСК, прозрачный транзит неиспользуемых каналов, произвольное логическое распределение 120 каналов.\r\n</p>		', 1, '2015-11-27'),
(268, '<p>Карта центрального процессора MEX-Ipx2 является главным управляющим узлом АТС. Через HDLC шины управления центральный процессор связан с процессорами периферийных интерфейсных карт основного кабинета и кабинетов расширения.</p>\r\n<p>Процессор осуществляет управление соединениями в соответствии с информацией поступающей от периферийных карт и конфигурации базы данных настроек АТС, анализирует информацию тестирования периферии для диагностики ее работоспособности и осуществляет взаимодействие с внешними устройствами. Процессор использует микропроцессор Intel I386, который обеспечивает устойчивую работу АТС в условиях высокой нагрузки (до 50000 ВЧНН), без использования принудительной вентиляции.</p>\r\n<p>Для хранения базы данных и программного обеспечения используется модуль SRAM памяти на карте процессора и энергонезависимая память на внешнем носителе – карте flash памяти IMC. При необходимости объем памяти процессора может быть увеличен при помощи дополнительных модулей расширения памяти DBM.</p>\r\n<p>На лицевой панели карты установлен разъем интерфейса RS232, который может использоваться для контроля, программирования и управления АТС. Программное обеспечение является унифицированным для всего семейства АТС Coral FlexiCom.</p>', 1, '2015-11-27'),
(269, '<p>Модуль MAP (Management application control – платформа приложений контроля и управления) позволяет реализовать широкий спектр решений "компьютерной телефонии" путем управления вызовами и получение информации о соединениях внешними CTI приложениями. Кроме этого модуль является интерфейсом между центральным процессором и внешней IP средой, через MAP может осуществляться программирование АТС, получение аварийных сообщений и информации о соединениях для биллинговых программ.</p>\r\n<p>Модуль MAP используется для работы АТС под управлением программного коммутатора (softswitch) Сoral Sea, при этом АТС конфигурируется как шлюз (Coral Wave Gateway) между традиционным абонентским оборудованием и телефонными соединительными линиями и IP средой.</p>', 1, '2015-11-27'),
(270, 'Карта контроллера HDC реализует коммутационную матрицу 512ts, 384 из которых используется для коммутации, периферийные буферы ИКМ шин и HDLC шин управления, генератор тактовой частоты, схему синхронизации генератора от внешнего источника а также цифровой генератор тональных и акустических сигналов. Первый кабинет расширения подключается к ИКМ и HDLC шинам непосредственно через периферийные буферы карты HDC. В случае необходимости подключения второго кабинета в первый кабинет расширения устанавливается карта дополнительных периферийных буферов PX.', 1, '2015-11-27'),
(257, 'Карта для подключения цифровых абонентских терминалов FlexSet, DKT; цифровых терминалов с модулями APA для организации на базе персонального компьютера автоматизированных рабочих мест телефонистки (CAP) и диспетчера (FlexAttendant); модулей APDL для реализации решений "компьютерной телефонии" на базе персонального компьютера с использованием TAPI драйверов. 2-х проводный интерфейс.', 1, '2015-11-27'),
(229, 'Карта для подключения цифровых абонентских терминалов FlexSet, DKT; цифровых терминалов с модулями APA для организации на базе персонального компьютера автоматизированных рабочих мест телефонистки (CAP) и диспетчера (FlexAttendant); модулей APDL для реализации решений "компьютерной телефонии" на базе персонального компьютера с использованием TAPI драйверов. 2-х проводный интерфейс.', 1, '2015-11-27'),
(276, 'Объединение до 20 базовых станций\r\nДо 512 абонентов\r\nПоддержка 8 одновременных голосовых каналов для одной станции, 4 дополнительных канала для режима хэндовер\r\nПоддержка DECT GAP\r\nРадиус действия до 300м (зависит от типов стен и перекрытий)\r\nКодеки G.711/G.723.11/G.729AB\r\nПоддержка QoS - Diffserv/ToS Flag\r\nФункции эхоподавления, компенсации джиттера и VAD\r\nПитание через Ethernet (технология PoE)\r\nРабочая температура -5 °C до +55 °C\r\nВлажность 5-95 процентов (без конденсата)\r\nМонтаж на стену\r\nПорт 100/1000 Мб/с Ethernet\r\nПитание через Ethernet (технология PoE)\r\nРазмер: 195x 200 x 32 [мм]\r\nВес: 417 [г]	', 1, '2016-03-02'),
(227, 'В корзине 8 платомест.', 0, '2016-07-20'),
(284, '<p>Флагманское семейство многоуровневых модульных коммутаторов для интеллектуальных сетей Cisco Catalyst 6500 обеспечивает предоставление защищенных конвергентных услуг от уровня доступа до магистрали, от центра обработки данных до границы распределенной сети. Семейство Cisco Catalyst 6500 включает в себя коммутаторы, имеющие от 48 до 576 портов Ethernet 10/100/1000 Мбит/с или от 48 до 1152 портов Ethernet 10/100 Мбит/с. Они обеспечивают быстродействие на уровне нескольких сотен миллионов пакетов в секунду и могут работать в опорных сетях, обслуживающих несколько магистральных каналов с пропускной способностью 1 и 10 Гбит/с, выполняя функции масштабируемого многоуровневого коммутатора для интеллектуальных корпоративных сетей и сетей провайдеров услуг.</p>\r\n\r\n<p>Коммутаторы семейства Catalyst 6500 обеспечивают оптимальное использование ИТ-инфраструктуры благодаря архитектуре, которая поддерживает широкий спектр услуг (интеграцию сетей голосовой связи и передачи данных, конвергенцию локальных, распределенных и городских сетей). Это способствует улучшению окупаемости инвестиций и предоставляет следующие дополнительные преимущества:</p>\r\n<ul>\r\n<li>Минимизация простоев обеспечивает увеличение производительности работы сотрудников и стабильности работы предприятия</li>\r\n<li>Комплексный подход к обеспечению безопасности сети с использованием испытанной мульти-гигабитной технологии Cisco</li>\r\n<li>Оптимизация инвестиций и продолжительный срок службы продукта благодаря поддержке интерфейсов и систем передачи пакетов нескольких поколений\r\nОперационная совместимость, позволяющая использовать одну стандартную платформу для решения всех задач по развертыванию сети</li>\r\n<li>Высокая степень интеграции услуг с поддержкой конвергенции данных, голоса и видео на прикладном уровнена единой, хорошо управляемой платформы</li>\r\n</ul>', 1, '2016-08-17'),
