(303, '<p>Линейный модуль Cisco Catalyst WS-X6816-10G-2T представляет собой 16ти портовый модуль 10Гбит с возможностью подключения оптических соединений. Коммутационная фабрика формата 2х20Гбит позволяет осуществлять «переподписку» с отношениями 1:1 при использовании 4 портов и 4:1 при использовании всех доступных 16 портов. </p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>16 x 10 Gbps, X2</li>\r\n<li>Переподписка 4:1</li>\r\n<li>Подключение к фабрике - 40 Gbps</li>\r\n<li>180 x 10 Gbps (360 x 10 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>Поддержка L2-4 Jumbo Frame (9216 байт)</li>\r\n<li>Поддержка SFP+ через OneX - адаптер (CVR-X2-SFP10G).</li>\r\n</ul>', 1, '2016-08-17'),
(304, '<p>Линейный модуль Cisco Catalyst WS-X6816-10G-2TXL представляет собой 16ти портовый модуль 10Гбит с возможностью подключения оптических соединений. Коммутационная фабрика формата 2х20Гбит позволяет осуществлять «переподписку» с отношениями 1:1 при использовании 4 портов и 4:1 при использовании всех доступных 16 портов. </p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>16 x 10 Gbps, X2</li>\r\n<li>Переподписка 4:1</li>\r\n<li>Подключение к фабрике - 40 Gbps</li>\r\n<li>180 x 10 Gbps (360 x 10 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>Поддержка L2-4 Jumbo Frame (9216 байт)</li>\r\n<li>Поддержка SFP+ через OneX - адаптер (CVR-X2-SFP10G).</li>\r\n</ul>', 1, '2016-08-17'),
(305, '<p>Модули WS-X6824-SFP-2T(или 2TXL с DFC4XL), WS-X6848-SFP-2T(или 2TXL с DFC4XL), WS-X6848-TX-2T(или 2TXL с DFC4XL) представляют собой модули с 24 и 48 портами 1 Гбит формата SFP, либо с 48 медными портами соответственно. Модули поддерживают форматы передачи данных 1000BASE-SX, 1000BASE-LX/LH, 1000BASE-ZX и 1000BASE-T. Данные модули поддерживают работу с супервизорами 2T и 2TXL и а паре с коммутатором 6513Е появляется возможность использовать до 528 портов в одном шасси. Используется коммутационная фабрика формата 2х20Гбит.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>48 x 1 Gbps, SFP, переподписка 1.2:1</li>\r\n<li>Подключение к фабрике - 40Gbps </li>\r\n<li>534 x 1 Gbps портов (1068 x 1 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n</ul>', 1, '2016-08-17'),
(306, '<p>Модули WS-X6824-SFP-2T(или 2TXL с DFC4XL), WS-X6848-SFP-2T(или 2TXL с DFC4XL), WS-X6848-TX-2T(или 2TXL с DFC4XL) представляют собой модули с 24 и 48 портами 1 Гбит формата SFP, либо с 48 медными портами соответственно. Модули поддерживают форматы передачи данных 1000BASE-SX, 1000BASE-LX/LH, 1000BASE-ZX и 1000BASE-T. Данные модули поддерживают работу с супервизорами 2T и 2TXL и а паре с коммутатором 6513Е появляется возможность использовать до 528 портов в одном шасси. Используется коммутационная фабрика формата 2х20Гбит.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>48 x 1 Gbps, SFP, переподписка 1.2:1</li>\r\n<li>Подключение к фабрике - 40Gbps </li>\r\n<li>534 x 1 Gbps портов (1068 x 1 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n</ul>', 1, '2016-08-17'),
(307, '<p>Модули WS-X6824-SFP-2T(или 2TXL с DFC4XL), WS-X6848-SFP-2T(или 2TXL с DFC4XL), WS-X6848-TX-2T(или 2TXL с DFC4XL) представляют собой модули с 24 и 48 портами 1 Гбит формата SFP, либо с 48 медными портами соответственно. Модули поддерживают форматы передачи данных 1000BASE-SX, 1000BASE-LX/LH, 1000BASE-ZX и 1000BASE-T. Данные модули поддерживают работу с супервизорами 2T и 2TXL и а паре с коммутатором 6513Е появляется возможность использовать до 528 портов в одном шасси. Используется коммутационная фабрика формата 2х20Гбит.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>48 x 1 Gbps, SFP, переподписка 1.2:1</li>\r\n<li>Подключение к фабрике - 40Gbps </li>\r\n<li>534 x 1 Gbps портов (1068 x 1 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n</ul>', 1, '2016-08-17'),
(308, '<p>Модули WS-X6824-SFP-2T(или 2TXL с DFC4XL), WS-X6848-SFP-2T(или 2TXL с DFC4XL), WS-X6848-TX-2T(или 2TXL с DFC4XL) представляют собой модули с 24 и 48 портами 1 Гбит формата SFP, либо с 48 медными портами соответственно. Модули поддерживают форматы передачи данных 1000BASE-SX, 1000BASE-LX/LH, 1000BASE-ZX и 1000BASE-T. Данные модули поддерживают работу с супервизорами 2T и 2TXL и а паре с коммутатором 6513Е появляется возможность использовать до 528 портов в одном шасси. Используется коммутационная фабрика формата 2х20Гбит.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>48 x 1 Gbps, SFP, переподписка 1.2:1</li>\r\n<li>Подключение к фабрике - 40Gbps </li>\r\n<li>534 x 1 Gbps портов (1068 x 1 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n</ul>', 1, '2016-08-17'),
(309, '<p>4-портовый модуль для коммутаторов серии Catalyst 6500, с поддержкой 40 Gbs CFP трансиверов и 10 Gbs SFP+ трансиверов.  Модуль может использоваться для агрегации каналов с уровня распределения или для организации скоростного транспорта на уровне ядра.</p>\r\n\r\n<p>Модуль совместим только с супервизором Catalyst 6500 Supervisor Engine 2T, пропускная способность – до 80 Gbs. В модуле имеется 4 слота, которые в режиме переподписки модуля позволяют установить до 4 трансиверов CFP (40 Gbs) или 8 трансиверов SFP+ (10 Gbs, требуется специальный конвертер). Допускается одновременное использование трансиверов  CFP и SFP+.</p>\r\n\r\n<p>Модуль поддерживает два типа оптических 40 Gbs трансиверов - CFP-40G-LR4 и CFP-40G-SR4, которые соответственно позволяют обеспечить передачу данных на расстояние до 10 км по одномодовому волокну и до 100 м по OM3 многомодовому волокну.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>4 х 40 Gbps, CFP</li>\r\n<li>16x10 Gbps, SFP+ (через адаптер)</li>\r\n<li>Переподписка 2:1</li>\r\n<li>Подключение к фабрике - 80 Gbps</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>IEEE 802.1АЕ (MACSec) - аппаратная поддержка</li>\r\n<li>Поддержка SGT, SGACL</li>\r\n</ul>\r\n', 1, '2016-08-17'),
(310, '<p>4-портовый модуль для коммутаторов серии Catalyst 6500, с поддержкой 40 Gbs CFP трансиверов и 10 Gbs SFP+ трансиверов.  Модуль может использоваться для агрегации каналов с уровня распределения или для организации скоростного транспорта на уровне ядра.</p>\r\n\r\n<p>Модуль совместим только с супервизором Catalyst 6500 Supervisor Engine 2T, пропускная способность – до 80 Gbs. В модуле имеется 4 слота, которые в режиме переподписки модуля позволяют установить до 4 трансиверов CFP (40 Gbs) или 8 трансиверов SFP+ (10 Gbs, требуется специальный конвертер). Допускается одновременное использование трансиверов  CFP и SFP+.</p>\r\n\r\n<p>Модуль поддерживает два типа оптических 40 Gbs трансиверов - CFP-40G-LR4 и CFP-40G-SR4, которые соответственно позволяют обеспечить передачу данных на расстояние до 10 км по одномодовому волокну и до 100 м по OM3 многомодовому волокну.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>4 х 40 Gbps, CFP</li>\r\n<li>16x10 Gbps, SFP+ (через адаптер)</li>\r\n<li>Переподписка 2:1</li>\r\n<li>Подключение к фабрике - 80 Gbps</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>IEEE 802.1АЕ (MACSec) - аппаратная поддержка</li>\r\n<li>Поддержка SGT, SGACL</li>\r\n</ul>\r\n', 1, '2016-08-17'),
(311, '<p>Восьмипортовый 10GE модуль семейства Cisco Catalyst 6900 разработан для уровней агрегации и ядра сети, а так же для агрегации потоков трафика в ЦОД.</p>\r\n\r\n<p>Со своим большим 256Мб буфером на каждый порт, без переподписки, и DFC c высочайшей возможностью масштабирования данный модуль способен обеспечивать безопасную и предсказуемую производительность в высоко нагруженных приложениях, таких как потоки данных в финансовых вертикалях или транслирование видео. С помошью этих модулей можно создать до 88 10GE портов на отдельно взятом 6513-E шасcи и 167 10GE портов в системе VSS 4T.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>8x10 Gbps, X2</li>\r\n<li>Без переподписки</li>\r\n<li>Подключение к фабрике - 80bps</li>\r\n<li>90 х 10 Gbps неблокируемых портов (180 х 10 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>IEEE 802.1 АЕ (MACSec) - аппаратная поддержка</li>\r\n<li>Поддержка SGT, SGACL</li>\r\n<li>Поддержка L2-4 Jumbo Frame (9216 байт)</li>\r\n<li>Поддержка SFP+ через ОпеХ - адаптер (CVR-X2-SFP10G)</li>\r\n</ul>', 1, '2016-08-17'),
(312, '<p>Восьмипортовый 10GE модуль семейства Cisco Catalyst 6900 разработан для уровней агрегации и ядра сети, а так же для агрегации потоков трафика в ЦОД.</p>\r\n\r\n<p>Со своим большим 256Мб буфером на каждый порт, без переподписки, и DFC c высочайшей возможностью масштабирования данный модуль способен обеспечивать безопасную и предсказуемую производительность в высоко нагруженных приложениях, таких как потоки данных в финансовых вертикалях или транслирование видео. С помошью этих модулей можно создать до 88 10GE портов на отдельно взятом 6513-E шасcи и 167 10GE портов в системе VSS 4T.</p>\r\n\r\n<p>Основные особенности:</p>\r\n<ul>\r\n<li>8x10 Gbps, X2</li>\r\n<li>Без переподписки</li>\r\n<li>Подключение к фабрике - 80bps</li>\r\n<li>90 х 10 Gbps неблокируемых портов (180 х 10 Gbps - VSS)</li>\r\n<li>Поддержка DFC4/DFC4XL</li>\r\n<li>IEEE 802.1 АЕ (MACSec) - аппаратная поддержка</li>\r\n<li>Поддержка SGT, SGACL</li>\r\n<li>Поддержка L2-4 Jumbo Frame (9216 байт)</li>\r\n<li>Поддержка SFP+ через ОпеХ - адаптер (CVR-X2-SFP10G)</li>\r\n</ul>', 1, '2016-08-17'),
(359, 'Точки доступа Cisco® Aironet® 3500 лидеры среди промышленных точек доступа с поддержкой 802.11n с автоматической самонастройкой. CleanAir технология позволяет в улавливать интерференцию от других устройств и усиливать или ослаблять сигнал для калибровки беспроводного покрытия. В серии Cisco® Aironet® 3500 включены такие технологии, как ClientLink (увеличивает радиус покрытия для конечных пользователей), BandSelect (помогает в работе в смешанных сетях 2.5-5 ГГц), VideoStream (использует мультикаст для медиа-приложений).', 1, '2016-09-01'),
(405, '<h2>Особенности IP-телефона Atcom A21</h2>\n<ul>\n<li>SIP аккаунтов: 2</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Нет</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Питания POE</li>\n<li>Поддержка IEEE 802.3af Class 2</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A21</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 58</li>\n<li>2 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2 (только для моделей A21/A21W)</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>2 клавиши линий</li>\n<li>2 клавиши регулировки громкости</li>\n<li>7 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>WiFi feature (только в моделях A20W, A21W)</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-09-30'),
(406, '<h2>Особенности IP-телефона Atcom A21W</h2>\n<ul>\n<li>SIP аккаунтов: 2</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Питания POE</li>\n<li>Поддержка IEEE 802.3af Class 2</li>\n</ul>\n<h3>Свойства WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A21W</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 58</li>\n<li>2 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2 (только для моделей A21/A21W)</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>2 клавиши линий</li>\n<li>2 клавиши регулировки громкости</li>\n<li>7 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>WiFi feature (только в моделях A20W, A21W)</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-09-30'),
(408, '<h2>Особенности IP-телефона Atcom A20W</h2>\n<ul>\n<li>SIP аккаунтов: 2</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Питания POE</li>\n<li>Поддержка IEEE 802.3af Class 2</li>\n</ul>\n<h3>Свойства WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A20W</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 58</li>\n<li>2 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2 (только для моделей A21/A21W)</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>2 клавиши линий</li>\n<li>2 клавиши регулировки громкости</li>\n<li>7 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>WiFi feature (только в моделях A20W, A21W)</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-09-30'),
(409, '<h3>Особенности IP-телефона Atcom A10</h3>\nДвухъядерный процессор в телефоне является гарантией высокого качества, одно ядро - для управления функциями в телефоне, сделает возможным свободно запускать более сложные приложения, а другое ядро для лучшей передачи голоса. Декодирование значительно улучшит качество звука.\n<h3>Свойства</h3>\n<ul>\n<li>SIP аккаунт: 1</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n', 1, '2019-10-01'),
(410, '\n<h3>Особенности IP-телефона Atcom A10W</h3>\nДвухъядерный процессор в телефоне является гарантией высокого качества, одно ядро - для управления функциями в телефоне, сделает возможным свободно запускать более сложные приложения, а другое ядро для лучшей передачи голоса. Декодирование значительно улучшит качество звука.\n<h3>Свойства</h3>\n<ul>\n<li>SIP аккаунт: 1</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WiFi: Да</li>\n<li>POE: Нет</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n', 1, '2019-10-01');
