(411, '<h2>Особенности IP-телефона Atcom A20wac</h2>\nIP-телефон Atcom A20wac имеет богатые характеристики, HD качество звука, восхитительные детали, инновационный внешний вид, он является телефоном начального уровня, разработанного специально для сотрудников офиса. На телефоне графический экран, поддержка Wi-Fi локальных сетей доступа и двойной порт, громкоговоритель 3W высокомощный, 5-ти сторонняя конференция, более высокий уровень шифрования ZRTP и новаторский внешний вид. A20wac имеет встроенный в 2.4 г беспроводной Wi-Fi модуль, 5 дБ коэффициент усиления антенны, принимает протокол 802.11 AC, 2.4 G.\n<ul>\n<li>SIP аккаунтов: 2</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Питания POE</li>\n<li>Поддержка IEEE 802.3af Class 2</li>\n</ul>\n<h3>Свойства WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A20wac</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 58</li>\n<li>2 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2 (только для моделей A21/A21W)</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>2 клавиши линий</li>\n<li>2 клавиши регулировки громкости</li>\n<li>7 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>WiFi feature (только в моделях A20W, A21W)</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-10-01'),
(412, '\nAtcom A20LTE - это IP-телефон LTE с 6 учетными записями SIP, используемый в сетевых средах 4G (LTE) и 3G. Он также поддерживает доступ к проводной сети по протоколам IPv4 и IPv6. Его концепция дизайна основана на «визуальном управлении, превосходном качестве голоса, изысканных деталях и уникальном внешнем виде». Это телефон VoLTE начального уровня, специально разработанный для пользователей и операторов SIP. Качество громкой связи, громкоговорителя 3W, 5-сторонняя конференция и  6 учетных записей SIP подчеркнули его достоинства среди IP-телефонах начального уровня.\n<br>A20LTE поддерживает все стандарты технологий 4G (LTE) и 3G из разных стран, но учтите, что в разных странах могут потребоваться разные модули 4G.\n\n<h2>Особенности 4G IP-телефона Atcom A20LTE</h2>\n<ul>\n<li>6 учетных записей SIP (с двухцветными светодиодами)</li>\n<li>132 * 58 графический решетчатый ЖК</li>\n<li>Светодиодный индикатор состояния телефона</li>\n<li>Серебряная металлическая клавиатура</li>\n<li>Серебряная металлическая внешняя поверхность</li>\n<li>HD широкополосный телефонный микрофон</li>\n<li>Мощный громкоговоритель мощностью 3 Вт</li>\n<li>Противоинтерференционный микрофон</li>\n<li>Большая камера, громкая связь</li>\n<li>Возможность крепления на стене</li>\n<li>Встроенный 4G</li>\n</ul>\n<h2>Характеристики 4G IP-телефона Atcom A20LTE</h2>\n<ul>\n<li>ЖК-дисплей с решеткой 132 * 58, 6 учетных записей SIP, переадресация вызова, ожидание вызова, горячая линия, удержание вызова, автоматический ответ, идентификация вызывающего абонента, повторный набор, отключение звука, DND, локальная 5-сторонняя конференц-связь, быстрый набор, голосовая почта, локальная телефонная книга (до 1000 записей), прямой IP-вызов без SIP-прокси, черный список, набранные / полученные / пропущенные / переадресованные звонки (всего 400), режим гарнитур call-центра, поддержка EHS-гарнитуры.</li>\n</ul>\n<b>Быстрые в использовании функции</b>\n<ul>\n<li>14 программируемых клавиш; Одина клавиша для выхода в меню; Одна клавиша для чтения информации о телефоне; быстрая настройка BLF; Поддержка телефонной книги интеллектуального поиска; Помощник.</li>\n</ul>\n<b>Особенности IP-АТС</b>\n<ul>\n<li>Поддерживает интерком, пейджинг, перехват вызовов, парковку вызовов, анонимный вызов, отклонение анонимного вызова, удержание музыки, конференц-связь, групповой прием, DND и синхронизацию состояния переадресации вызовов, запись вызовов.</li>\n</ul>\n<b>Мультиязычность</b>\n<ul>\n<li>Английский, немецкий, итальянский, французский, испанский, португальский, русский, китайский, арабский, польский, турецкий, иврит</li>\n</ul>\n<b>Расширенные возможности</b>\n<ul>\n<li>Многоадресная рассылка, адресная книга LDAP, удаленная адресная книга XML, URL-адрес действия</li>\n</ul>\n<b>Особенности аудио</b>\n<ul>\n<li>10 (встроенных + настраиваемых) мелодий звонка, 8 уровней регулировки громкости + режим отключения звука, узкополосный кодек: G.711 (a / μ), G.729A / B / AB, G.726, iLBC, широкополосный кодек: G. 722, L16, поддержка VAD, CNG, AEC, PLC, AJB, AGC, полнодуплексный динамик с AEC.</li>\n</ul>\n<b>Особенности сети</b>\n<ul>\n<li>IPv4 и IPv6, VLAN, LLDP, OpenVPN, IEEE802.1X, проникновение в интрасеть STUN, Rport; Режим подключения SIP: режим прокси, прямой режим P2P, DNS SRV (RFC3263), 3 режима DTMF: внутриполосный, RFC2833, SIP INFO; Встроенный веб-сервер HTTP / HTTPS, LAN / ПК: режим моста, функция захвата веб-страниц, функция пакета захвата портов ПК, Syslog.</li>\n</ul>\n<b>Особенности 4G (LTE)</b>\n\n<b>Безопасность</b>\n<ul>\n<li>Протокол TLS, HTTPS, SRTP (RFC3711), ZRTP (специальная версия), поддержка функции «Принять только доверенный сервер», поддержка механизма проверки информации MD5 / MD5-SESS, поддержка алгоритма шифрования AES (шифрование профиля), поддержка четырехуровневой блокировки телефона, администратор / пользовательская иерархическая структура</li>\n</ul>\n<b>Конфигурация</b>\n<ul>\n<li>Конфигурация Plug and Play: реализована на базе сервера, ручная настройка: конфигурация локальной веб-страницы, конфигурация интерфейса пользователя на ЖК-дисплее.</li>\n</ul>\n<b>Пакетное развертывание</b>\n<ul>\n</li>HTTPS / HTTP / FTP / TFTP / RPS / PnP / DHCP Option 66, TR069, WEB-шаблоны импорта и экспорта конфигурации, инструмент генерации пакета файла конфигурации, периодическое тестирование и обновление</li>\n</ul>\n<b>Физические характеристики</b>\n<ul>\n<li>Интерфейс питания: DC 5V-1A, источник питания PoE: IEEE 802.3af, класс 2, 2 адаптивных порта Ethernet RJ45 100 / 1000M, 1 разъем для наушников RJ9, 1 разъем для телефонной трубки RJ9. 1 индикатор состояния, 2 линейные клавиши, 3 программные клавиши, 5 клавиш навигации, 2 клавиши регулировки громкости, 7 функциональных клавиш (меню, отмена, удержание, голосовая почта, отключение звука, наушники, повторный набор, громкая связь)</li>\n</ul>\n<b>Температура и влажность</b>\n<ul>\n<li>Рабочая температура: -10 ~ 50 ℃</li>\n<li>Температура хранения: -10 ~ 50 ℃</li>\n<li>Рабочая влажность: 10 ~ 90%</li>\n</ul>\n<b>Сертификаты</b>\n<ul>\n</li>CE: EN60950, EN50332, EN300328 V1.9.1 FCC: часть 15, часть 15.247</li>\n</ul>\n', 1, '2019-10-01'),
(407, '\n<h2>Особенности IP-телефона Atcom A20</h2>\n<ul>\n<li>SIP аккаунтов: 2</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Нет</li>\n<li>POE: Нет</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n<li>Питания POE</li>\n<li>Поддержка IEEE 802.3af Class 2</li>\n</ul>\n<h3>Свойства WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A20</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 58</li>\n<li>2 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2 (только для моделей A21/A21W)</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>2 клавиши линий</li>\n<li>2 клавиши регулировки громкости</li>\n<li>7 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>WiFi feature (только в моделях A20W, A21W)</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-10-03'),
(413, '\n<h2>Особенности IP-телефона Atcom A11W</h2>\n<ul>\n<li>SIP аккаунт: 1</li>\n<li>LCD дисплей: Черно-белый 132х58</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n</ul>\n<h3>Свойства WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Расширенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h2>Характеристики IP телефона Atcom A11W</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>LCD дисплей с подсветкой размером 132 х 52</li>\n<li>1 SIP аккаунт</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режм "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n<h3>Свойства сети</h3>\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>L2TP VPN поддерживает</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>1 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 3 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, удержание, голосовая почта, отключение звука,</li>\n<li>наушники, повторный набор номера, режим громкой связи)</li>\n<li>Настенное крепление</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-10-01'),
