ие</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Окружающая среда</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов</li>\n<li>Передача Microsoft XML удаленной телефонной книги</li>\n</ul>\n<h3>Поддержка безопасности</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Full-duplex спикерфон с AEC</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>PnP настройка: выполняется на сервере</li>\n<li>Ручная настройка:Web, клавиатура</li>\n<li>Развертывание Batch: HTTP/FTP/TFTP/RPS/DHCP Option 66</li>\n</ul>\n', 1, '2019-10-01'),
(415, '\nТелефон оснащен 4 контекстно-ориентированные клавишами с подсветкой и 8 программируемыми клавишами с 2-цветной подсветкой BLF. К телефону можно подключить до 5 дополнительных консолей Rainbow E (до 88 клавиш быстрого набора).\n\n<br><br>На телефоне присутствует 2-портовый коммутатор Ethernet 10/100TX, который можно использовать в режиме Bridging (в том числе с поддержкой tagged VLAN 802.1Q), NAT, VPN (L2TP/PPPoE). \n\n<br><br>Телефон может подключаться к сети через Wi-Fi  (2,4 ГГц 802.11b/g/n) с возможностью авторизации по протоколам: WEP, WPA/WPA2-PSK, а также по самому защищённому – WPA2-Enterprise (через Radius-сервер), который получил распространение в российских компаниях.\n\n<br><br>Дизайн телефон заточен под HD-голос:\n<ul>\n<li>поддержка HD кодеков G.722, iLBC, G.726</li>\n<li>качественный НЧ-тракт, силиконовый уплотнитель в трубке</li>\n<li>HD-спикерфон с большим динамиком и резонатором исключает дребезжание и скрипы</li>\n<li>программные алгоритмы улучшения качества звука: Генерация комфортного шума (CNG), Детектирование активности голоса (VAD), компенсация эхо (Echo cancellation), Автоматическая регулировка громкости (AGC).</li>\n</ul>\nТелефон выполнен на базе высокопроизводительного 2-ядерного чипсета DSPG 9918 (2x400 MHz) и ОС Linux 4.3 + сторожевой таймер (WatchDog), что обеспечивает быструю готовность к работе и стабильное функционирование (без зависаний и залипаний). \n\n<br><br>Телефон полностью русифицирован:\n<ul>\n<li>меню на русском языке</li>\n<li>адресная книга на русском языке (клавиши с русскими буквами)</li>\n<li>интеллектуальный поиск по телефонной книге русских фамилий</li>\n<li>Web-интерфейс на русском языке.</li>\n</ul>\nТелефон получает электропитание по протоколу POE (802.3ah – 5 Вт). При необходимости, электропитание на телефон можно подать через сетевой адаптер AC220->DC5 вольт, 1А (в комплект не входит, приобретается отдельно).\n<h2>Технические характеристики IP-телефона Atcom A41W</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>ЧБ LCD дисплей 3,2" с подсветкой (разрешение 224х128 пикселей)</li>\n<li>4 SIP аккаунта с независимой конфигурацией</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Подключение гарнитуры</li>\n</ul>\n<h3>Свойства сети</h3>\n<ul>\n<li>2xEthernet 10/100TX c поддержкой POE (802.3ah)</li>\n<li>Поддержка Open VPN (L2TP)</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Режим отладки (экспорт внутренних логов и пакетов данных в формате Wiresharsk)</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A (блок питания в комплект не входит, приобретается отдельно)</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M - Ethernet порты</li>\n<li>2 разъёма RJ9: 1 разъем для гарнитуры (jack): 1 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 4 клавиши линий, 4 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Функции WiFi</h3>\n<ul>\n<li>Поддержка IEEE 802.11b/g/n 2,4 ГГц</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2-PSK/Enterprise)</li>\n</ul>\n<h3>Условия работы с устройством</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Поддержка XML (экспорт/импорт, по запросу/автоматически)</li>\n</ul>\n<h3>Безопасность</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>Настройка устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-02'),
(416, '\nТелефон оснащен 4 контекстно-ориентированные клавишами с подсветкой и 8 программируемыми клавишами с 2-цветной подсветкой BLF. К телефону можно подключить до 5 дополнительных консолей Rainbow E (до 88 клавиш быстрого набора).\n\n<br><br>На телефоне присутствует 2-портовый коммутатор Ethernet 10/100TX, который можно использовать в режиме Bridging (в том числе с поддержкой tagged VLAN 802.1Q), NAT, VPN (L2TP/PPPoE). \n\n<br><br>Дизайн телефон заточен под HD-голос:\n<ul>\n<li>поддержка HD кодеков G.722, iLBC, G.726</li>\n<li>качественный НЧ-тракт, силиконовый уплотнитель в трубке</li>\n<li>HD-спикерфон с большим динамиком и резонатором исключает дребезжание и скрипы</li>\n<li>программные алгоритмы улучшения качества звука: Генерация комфортного шума (CNG), Детектирование активности голоса (VAD), компенсация эхо (Echo cancellation), Автоматическая регулировка громкости (AGC).</li>\n</ul>\nТелефон выполнен на базе высокопроизводительного 2-ядерного чипсета DSPG 9918 (2x400 MHz) и ОС Linux 4.3 + сторожевой таймер (WatchDog), что обеспечивает быструю готовность к работе и стабильное функционирование (без зависаний и залипаний). \n\n<br><br>Телефон полностью русифицирован:\n<ul>\n<li>меню на русском языке</li>\n<li>адресная книга на русском языке (клавиши с русскими буквами)</li>\n<li>интеллектуальный поиск по телефонной книге русских фамилий</li>\n<li>Web-интерфейс на русском языке.</li>\n</ul>\nТелефон получает электропитание по протоколу POE (802.3ah – 5 Вт). При необходимости, электропитание на телефон можно подать через сетевой адаптер AC220->DC5 вольт, 1А (в комплект не входит, приобретается отдельно).\n<h2>Технические характеристики IP-телефона Atcom A41</h2>\n<h3>Базовые функции</h3>\n<ul>\n<li>ЧБ LCD дисплей 3,2" с подсветкой (разрешение 224х128 пикселей)</li>\n<li>4 SIP аккаунта с независимой конфигурацией</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Подключение гарнитуры</li>\n</ul>\n<h3>Свойства сети</h3>\n<ul>\n<li>2xEthernet 10/100TX c поддержкой POE (802.3ah)</li>\n<li>Поддержка Open VPN (L2TP)</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Режим отладки (экспорт внутренних логов и пакетов данных в формате Wiresharsk)</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n<ul>\n<li>Интерфейс питания: DC 5V-1A (блок питания в комплект не входит, приобретается отдельно)</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M - Ethernet порты</li>\n<li>2 разъёма RJ9: 1 разъем для гарнитуры (jack): 1 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 4 клавиши линий, 4 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n</ul>\n<h3>Функции IP PBX</h3>\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Условия работы с устройством</h3>\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n<ul>\n<li>LDAP</li>\n<li>Поддержка XML (экспорт/импорт, по запросу/автоматически)</li>\n</ul>\n<h3>Безопасность</h3>\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n<ul>\n<li>Настройка устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-02'),
(419, '\nПрофессиональный IP-телефон с поддержкой 4 SIP-аккаунтов, возможностью подключения к Wi-Fi сети, цветным дисплеем 3,2" и разрешением 462x278. Аппарат оснащен 4 программируемыми клавишами, 8 клавишами быстрого набора. Телефон имеет простой пользовательский интерфейс, позволяет подключать модули расширения.\n\n<br><br>Одним из преимуществ Atcom A48W является поддержка широкополосного голосового стандарта TIA920 с четким звуком в формате HD. Телефон идеально подходит для использования на различных предприятиях и в офисах с большим количеством сотрудников. Телефон отличается элегантным дизайном, устройство станет не только мощным рабочим инструментом, но и изящным дополнением офисной обстановки.\n\n<br><br>Звуковые характеристики Atcom A48W отвечают всем самым высоким требованиям: телефон оснащен мощным динамиком, устройство гарантирует великолепное качество передаваемого голоса в обоих направлениях. Аппарат великолепно работает в режиме громкой связи, тем самым позволяя пользователям освободить руки во время важного совещания. Телефон совместим со всеми ведущими IP-АТС, гарантирует безопасность связи, шифрование сигнала, шифрование медиа файлов.\n\n<h3>Технические характеристики Atcom A48W:</h3>\n\n<ul>\n<li>SIP аккаунтов: 4</li>\n<li>LCD дисплей: цветной дисплей 3,2", 462х278</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n</ul>\n<h3>Характеристики IP телефона Atcom A48W</h3>\n\n<h3>Базовые функции</h3>\n\n<ul>\n<li>Цветной дисплей с подсветкой 3,2", с разрешением 462х278</li>\n<li>4 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n<h3>Свойства сети</h3>\n\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>Поддержка Open VPN</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 4 клавиши линий, 4 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n</ul>\n<h3>Функции IP PBX</h3>\n\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Функции WiFi</h3>\n\n<ul>\n<li>Поддержка IEEE 802.11b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов Microsoft</li>\n<li>Поддержка XML удаленной телефонной книги</li>\n</ul>\n<h3>Безопасность:</h3>\n\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n\n<ul>\n<li>Настройке устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-02'),
(420, '\nПрофессиональный IP-телефон с поддержкой 4 SIP-аккаунтов, возможностью подключения к Wi-Fi сети, цветным дисплеем 3,2" и разрешением 462x278. Аппарат оснащен 4 программируемыми клавишами, 8 клавишами быстрого набора. Телефон имеет простой пользовательский интерфейс, позволяет подключать модули расширения.\n\n<br><br>Одним из преимуществ Atcom A48WAC является поддержка широкополосного голосового стандарта TIA920 с четким звуком в формате HD. Телефон идеально подходит для использования на различных предприятиях и в офисах с большим количеством сотрудников. Телефон отличается элегантным дизайном, устройство станет не только мощным рабочим инструментом, но и изящным дополнением офисной обстановки.\n\n<br><br>Звуковые характеристики Atcom A48WAC отвечают всем самым высоким требованиям: телефон оснащен мощным динамиком, устройство гарантирует великолепное качество передаваемого голоса в обоих направлениях. Аппарат великолепно работает в режиме громкой связи, тем самым позволяя пользователям освободить руки во время важного совещания. Телефон совместим со всеми ведущими IP-АТС, гарантирует безопасность связи, шифрование сигнала, шифрование медиа файлов.\n\n<h3>Технические характеристики Atcom A48WAC:</h3>\n\n<ul>\n<li>SIP аккаунтов: 4</li>\n<li>LCD дисплей: цветной дисплей 3,2", 462х278</li>\n<li>CPU: Dual core</li>\n<li>WIFI: Да</li>\n<li>POE: Да</li>\n<li>HD качество звука: Да</li>\n<li>Телефонная книга: 1000 контактов</li>\n<li>3-х сторонняя конференция: Да</li>\n<li>Многоязычный: Да</li>\n<li>Интерфейс: DC 5V-1A</li>\n</ul>\n<h3>Характеристики IP телефона Atcom A48WAC</h3>\n\n<h3>Базовые функции</h3>\n\n<ul>\n<li>Цветной дисплей с подсветкой 3,2", с разрешением 462х278</li>\n<li>4 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n<h3>Свойства сети</h3>\n\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>Поддержка Open VPN</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 4 клавиши линий, 4 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n</ul>\n<h3>Функции IP PBX</h3>\n\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Функции WiFi</h3>\n\n<ul>\n<li>Поддержка IEEE 802.11ac/b/g/n</li>\n<li>Улучшенная поддержка IEEE 802.11e QoS</li>\n<li>Поддержка APA, APA2, IEEE802.11i (WPA, WPA2)</li>\n</ul>\n<h3>Окружающая среда</h3>\n\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов Microsoft</li>\n<li>Поддержка XML удаленной телефонной книги</li>\n</ul>\n<h3>Безопасность:</h3>\n\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n\n<ul>\n<li>Настройке устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-02'),
(421, '\nAtcom A48LTE - это IP-телефон LTE с 32 учетными записями SIP, используемый в сетевых средах 4G (LTE) и 3G. Его концепция дизайна основана на «более высокой эффективности работы, визуальном управлении, превосходном качестве голоса, изысканных деталях и уникальном внешнем виде. Это телефон VoLTE управленческого уровня, специально разработанный для промышленных пользователей и операторов SIP, с цветным экраном 3,2 " TFT, поддержкой 8 BLF-ключей, доступом к сети 4G (LTE) и 3G, двойным гигабитным сетевым портом, PoE, с поддержкой беспроводной гарнитуры EHS и модуля расширения. Превосходное качество голосовой связи без участия рук, 9-сторонняя конференция и более высокий уровень шифрования ZRTP подчеркнули его возможности в IP-телефонах управленческого уровня.\n\n<br><br>Atcom A48LTE поддерживает все стандарты технологий 4G (LTE) и 3G из разных стран, но учтите, что в разных странах могут потребоваться разные модули 4G.\n\n<h3>Особенности LTE IP-телефона Atcom A48LTE</h3>\n<ul>\n<li>32 SIP-аккаунта (с двухцветными светодиодами)</li>\n<li>4,3 ", цветной дисплей 480x272 оборотов</li>\n<li>Светодиодный индикатор состояния телефона</li>\n<li>Серебряная металлическая клавиатура</li>\n<li>376x96 революционный экран</li>\n<li>8 BLF клавиш (с двухцветными светодиодами)</li>\n<li>Серебряная металлическая поверхность</li>\n<li>Подсвечиваемые полупрозрачные клавиши</li>\n<li>HD широкополосный телефонный приемник</li>\n<li>Мощный динамик в 3 Вт</li>\n<li>Противоинтерференционный микрофон</li>\n<li>Камера, громкая связь</li>\n<li>Поддержка ЖК-модуля расширения</li>\n<li>Встроенный 4G</li>\n</ul>\n\n<h3>Характеристики IP телефона Atcom A48LTE</h3>\n\n<h3>Базовые функции</h3>\n\n<ul>\n<li>Цветной дисплей с подсветкой 3,2", с разрешением 462х278</li>\n<li>4 SIP аккаунта</li>\n<li>Переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова</li>\n<li>Автоответчик, АОН, повторный набор номера, отключение звука, режим "He беспокоить" (DND)</li>\n<li>3-сторонняя конференц-связь, быстрый набор, голосовая почта</li>\n<li>Телефонная книга (1000)</li>\n<li>Прямой вызов без использования SIP</li>\n<li>Черный список, белый список, набранные/принятые/пропущенные вызовы (до 200)</li>\n<li>Режим Call-центра с гарнитурой</li>\n</ul>\n<h3>Свойства сети</h3>\n\n<ul>\n<li>LAN / ПК: поддержка режимов передачи</li>\n<li>Поддержка Open VPN</li>\n<li>SIP режим связи: режим Proxy, and P2P режим</li>\n<li>Поддержка DNS SRV (RFC3263)</li>\n<li>Поддержка NAT transverse: режим STUN</li>\n<li>DTMF: Внутриполосное, RFC2833, SIP INFO</li>\n<li>Поддержка QoS</li>\n<li>HTTP / HTTPS веб-сервер</li>\n<li>Экспорт пакета копий</li>\n<li>Системный журнал</li>\n</ul>\n<h3>Физические характеристики</h3>\n\n<ul>\n<li>Интерфейс питания: DC 5V-1A</li>\n<li>Питание POE: IEEE 802.3af Class 2</li>\n<li>2 RJ45 10/100M адаптация Ethernet портов</li>\n<li>2 RJ9 разъем для наушников (jack), 1 RJ9 разъем для подключения телефонной трубки (jack)</li>\n<li>1 индикатор состояния, 4 клавиши линий, 4 программируемые клавиши, 5 клавиши навигации</li>\n<li>1 клавиша регулировки громкости</li>\n<li>8 функциональных клавиш (меню, отмена, голосовая почта, отключение звука, наушники, повторный набор номера, режим громкой связи)</li>\n</ul>\n<h3>Функции IP PBX</h3>\n\n<ul>\n<li>Внутренняя связь, пейджинг, перехват вызова, журнал звонков</li>\n<li>Анонимный звонок, отмена анонимного звонка</li>\n<li>Музыка на удержании, Конференц-связь</li>\n<li>Общее прослушивание, перехват звонков</li>\n<li>Режим «не беспокоить» DND и переадресация звонков в состоянии синхронизации</li>\n<li>Запись разговоров</li>\n</ul>\n<h3>Окружающая среда</h3>\n\n<ul>\n<li>Рабочая температура: -10 ~ 50°C</li>\n<li>Влажность при эксплуатации: 10 ~ 90%</li>\n</ul>\n<h3>Расширенные возможности</h3>\n\n<ul>\n<li>LDAP</li>\n<li>Каталог активных серверов Microsoft</li>\n<li>Поддержка XML удаленной телефонной книги</li>\n</ul>\n<h3>Безопасность:</h3>\n\n<ul>\n<li>VLAN, LLDP, IEEE802.1X</li>\n<li>Поддержка TLS</li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/μ), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n\n<ul>\n<li>Настройке устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-02');
