/li>\n<li>Поддержка HTTPS</li>\n<li>SRTP (RFC3711)</li>\n<li>проверка подлинности с помощью MD5/MD5-sess</li>\n<li>AES шифрование для файла конфигурации</li>\n<li>Поддержка блокировки телефона, режим администратора / рейтинги пользователей</li>\n</ul>\n<h3>Функции аудио</h3>\n\n<ul>\n<li>8 собственных мелодий, 2 пользовательские мелодии</li>\n<li>8 режимов регулировки громкости + режим без звука (Mute)</li>\n<li>Узкополосные кодеки: G.711(A/?), G.729A/B/AB, G.726, iLBC</li>\n<li>Широкополосные кодеки: G.722, L16</li>\n<li>Поддержка VAD, CNG, AEC, PLC, AJB, AGC</li>\n<li>Полнодуплексный спикерфон с шумоподавлением</li>\n</ul>\n<h3>Настройки</h3>\n\n<ul>\n<li>Настройке устройства через web-интерфейс</li>\n<li>Развертывание: HTTP/FTP/TFTP/RPS/DHCP Option 66, Remote Provisioning Service (RPS)</li>\n</ul>\n', 1, '2019-10-03'),
(426, '\nAtcom A68LTE - IP-телефон LTE с 32 учетными записями SIP, используемый в сетевых средах 4G (LTE) и 3G. Концепция его дизайна основана на «более высокой эффективности работы, визуальном управлении, превосходном качестве голоса, изысканных деталях и уникальном внешнем виде». Это телефон VoLTE управленческого уровня, имеет цветной экран с диагональю 4,3 дюйма (TFT), клавиши 8GL и телефонную карту 4G (LTE), а также доступ к сети 3G, поддерживает беспроводную гарнитуру и модуль расширения.\n<br><br>A68LTE поддерживает все стандарты технологии 4G (LTE) и 3G.\n\n<h2>Особенности LTE IP-телефона Atcom A68LTE</h2>\n<ul>\n<li>32 SIP-аккаунта (с двухцветными светодиодами)</li>\n<li>4,3 ", цветной дисплей 480x272 оборотов</li>\n<li>Светодиодный индикатор состояния телефона</li>\n<li>Серебряная металлическая клавиатура</li>\n<li>376x96 революционный экран</li>\n<li>8 BLF клавиш (с двухцветными светодиодами)</li>\n<li>Серебряная металлическая поверхность</li>\n<li>Подсвечиваемые полупрозрачные клавиши</li>\n<li>HD широкополосный телефонный приемник</li>\n<li>Мощный динамик в 3 Вт</li>\n<li>Противоинтерференционный микрофон</li>\n<li>Камера, громкая связь</li>\n<li>Поддержка ЖК-модуля расширения</li>\n<li>Встроенный 4G</li>\n</ul>\n<h2>Характеристики LTE IP-телефона Atcom A68LTE</h2>\n4,3" TFT LCD, 480 * 272 пикселей, 32 SIP-аккаунта, переадресация вызова, перевод вызова, ожидание вызова, горячая линия, удержание вызова, автоматический ответ, идентификация вызывающего абонента, повторный набор, отключение звука, DND, локальная 9-сторонняя конференц-связь, быстрый набор, голосовая почта, локальная телефонная книга (до 1000 записей), прямой IP-вызов без SIP-прокси, черный список, набранные / полученные / пропущенные / переадресованные звонки (всего 400), режим гарнитур call-центра, поддержка EHS-гарнитуры.\n\n<h3>Быстрые в использовании функции</h3>\n\n39 программируемых клавиш; Одина клавиша для выхода в меню; Одна клавиша для чтения информации о телефоне; быстрая настройка BLF; Поддержка телефонной книги интеллектуального поиска; Помощник.\n<h3>Особенности IP-АТС</h3>\n\nПоддерживает интерком, пейджинг, перехват вызовов, парковку вызовов, анонимный вызов, отклонение анонимного вызова, удержание музыки, конференц-связь, групповой прием, DND и синхронизацию состояния переадресации вызовов, запись вызовов.\n<h3>Мультиязычность</h3>\n\nАнглийский, немецкий, итальянский, французский, испанский, португальский, русский, китайский, арабский, польский, турецкий, иврит\n<h3>Расширенные возможности</h3>\n\nМногоадресная рассылка, адресная книга LDAP, удаленная адресная книга XML, URL-адрес действия\n<h3>Особенности аудио</h3>\n\n10 (встроенных + настраиваемых) мелодий звонка, 8 уровней регулировки громкости + режим отключения звука, узкополосный кодек: G.711 (a / μ), G.729A / B / AB, G.726, iLBC, широкополосный кодек: G. 722, L16, поддержка VAD, CNG, AEC, PLC, AJB, AGC, полнодуплексный динамик с AEC.\n<h3>Особенности сети</h3>\n\nIPv4 и IPv6, VLAN, LLDP, OpenVPN, IEEE802.1X, проникновение в интрасеть STUN, Rport; Режим подключения SIP: режим прокси, прямой режим P2P, DNS SRV (RFC3263), 3 режима DTMF: внутриполосный, RFC2833, SIP INFO; Встроенный веб-сервер HTTP / HTTPS, LAN / ПК: режим моста, функция захвата веб-страниц, функция пакета захвата портов ПК, Syslog.\n<h3>Безопасность</h3>\n\nПротокол TLS, HTTPS, SRTP (RFC3711), ZRTP (специальная версия), поддержка функции «Принять только доверенный сервер», поддержка механизма проверки информации MD5 / MD5-SESS, поддержка алгоритма шифрования AES (шифрование профиля), поддержка четырехуровневой блокировки телефона, администратор / пользовательская иерархическая структура\n<h3>Конфигурация</h3>\n\nКонфигурация Plug and Play: реализована на базе сервера, ручная настройка: конфигурация локальной веб-страницы, конфигурация интерфейса пользователя на ЖК-дисплее.\n<h3>Пакетное развертывание</h3>\n\nHTTPS / HTTP / FTP / TFTP / RPS / PnP / DHCP Option 66, TR069, WEB-шаблоны импорта и экспорта конфигурации, инструмент генерации пакета файла конфигурации, периодическое тестирование и обновление\n<h3>Физические характеристики</h3>\n\nИнтерфейс питания: DC 5V-1A, источник питания PoE: IEEE 802.3af, класс 2, 2 адаптивных порта Ethernet RJ45 100 / 1000M, 1 разъем для наушников RJ9, 1 разъем для телефонной трубки RJ9. 1 индикатор состояния, 2 линейные клавиши, 3 программные клавиши, 5 клавиш навигации, 2 клавиши регулировки громкости, 7 функциональных клавиш (меню, отмена, удержание, голосовая почта, отключение звука, наушники, повторный набор, громкая связь)\n<h3>Температура и влажность</h3>\n\n<ul>\n<li>Рабочая температура: -10 ~ 50 ℃</li>\n<li>Температура хранения: -10 ~ 50 ℃</li>\n<li>Рабочая влажность: 10 ~ 90%</li>\n</ul>\n<h3>Сертификаты</h3>\n\nCE: EN60950 FCC: часть 15\n', 1, '2019-10-03'),
(427, '\nКонсоль расширения Atcom AET совместима c телефонами ATCOM A48x, A68x. Консоль с цветным 4,3 дюймовым LCD-дисплеем. На нем отображается статус и фотографии зарегистрированных абонентов (фотографии должны быть предварительно загружены в телефонную книгу или синхронизированы по LDAP).\n<br><br>Поддерживается подключение до 5 консолей Atcom AET к 1 телефону.\n\n<h3>Особенности Atcom AET:</h3>\n<ul>\n<li>Поддержка телефонов ATCOM A48/A68</li>\n<li>“прокрутки” списка контактов</li>\n<li>16 программируемых клавиш</li>\n<li>Трехцветный светодиод в каждой клавише</li>\n<li>До 44 программируемых действия</li>\n<li>Цветной дисплей 4.3 дюйма 480x272</li>\n<li>Обозначение информации об абоненте (ФИО, фотография, статус)</li>\n<li>Питание от телефона</li>\n<li>Настройка через самостоятельный Web-интерфейс.</li>\n</ul>\n\n<h3>Аппаратные характеристики</h3>\n<ul>\n<li>16 BLF-клавиш, укомплектованных 3-цветными светодиодами;</li>\n<li>2 порта RJ45 для подсоединения к IP-телефону и следующей консоли;</li>\n<li>цветной 4,3˝ LCD-дисплей с расширением 480×272 пикселя для отображения номеров и фотографий абонентов, контакты которых закреплены за определенными BLF-клавишами;</li>\n<li>«прокрутка» списка контактов;</li>\n<li>поддержка 44 действий, заданных программно;</li>\n<li>питание от IP-телефона;</li>\n<li>настройка через web-интерфейс IP-телефона.</li>\n</ul>\n\n<h3>Функциональные характеристики</h3>\n<ul>\n<li>осуществление быстрого набора номера, программно привязанного к BLF-клавише;</li>\n<li>возможность мониторинга статуса BLF-абонентов;</li>\n<li>отслеживание занятых линий;</li>\n<li>выполнение перехвата вызовов, поступающих на номера BLF-абонентов.</li>\n</ul>\n\n<h3>Характеристики эксплуатационной среды</h3>\n<ul>\n<li>допустимая температура: от 10° С до 50° С;</li>\n<li>допустимая влажность (без конденсата): от 10% до 95%.</li>\n</ul>\n', 1, '2019-10-03'),
(428, '\nIP-телефон Cisco Unified 7911G (Cisco Unified IP Phone 7911G) предназначен для работников в офисе, магазинах розничной торговли и цехах. Этот IP-телефон, представляющий собой базовую модель, дополненную определенными усовершенствованиями, обладает следующими функциональными особенностями:\n<ul>\n<li>Поддержка стандарта питания по витой паре IEEE 802.3af и стандарта питания Cisco;</li>\n<li>Дополнительный объем памяти для поддержки усовершенствованных функций и приложений</li>\n<li>Полная защита линий Cisco Unified CallManager;</li>\n<li>Пользовательский интерфейс, схожий с интерфейсами других моделей IP-телефонов семейства Cisco Unified;</li>\n<li>4 программируемые клавиши обеспечивают пользователям CP-7911G доступ к различным функциям и возможностям, в то время как графический дисплей объединяет интуитивное управление, информацию о вызовах и службы XML.</li>\n</ul>\n<h3>Технические характеристики IP-телефона Cisco Unified 7911G</h3>\n<h3>Поддерживаемые кодеки</h3>\n<ul>\n<li>G.711a</li>\n<li>G.711</li>\n<li>G.729a</li>\n<li>G.729b</li>\n<li>G.729ab</li>\n</ul>\n<h3>Сеть</h3>\n<ul>\n<li>Cisco Discovery Protocol; IEEE 802.1 p/q</li>\n<li>10/100BASE-T Ethernet х 2 RJ-45 ports</li>\n<li>SCCP</li>\n<li>DHCP</li>\n<li>TFTP</li>\n</ul>\n<h3>Основные возможности</h3>\n<ul>\n<li>Пиксельный дисплей представляет широкие возможности по отображению информации о вызовах, а также задействованных функциях.</li>\n<li>4 клавиши для вызова различных функций и управления телефоном</li>\n<li>Одна линия (Directory Number) с поддержкой переключения между двумя вызовами через функцию Call Waiting</li>\n<li>Подсвечиваемая клавиша “Hold”</li>\n<li>Возможность прослушивания разговора при подключении спикерфона</li>\n<li>Поддержка кодеков G.711/ G.711a/ G.729a /G.729b /G729ab/ iLBC</li>\n<li>Поддержка протокола SCCP (CUCM 3.3(5)SR2)</li>\n<li>Поддержка протокола SIP (CUCM 5.0(2))</li>\n<li>Автоматическая настройка транкового порта IEEE 802.1q VLAN</li>\n<li>Встроенный коммутатор 10/100 BaseT Ethernet</li>\n<li>Встроенная поддержка inline power</li>\n<li>Поддержка IEEE 803af (PoE)</li>\n<li>Увеличен объём памяти</li>\n<li>Расширенные функции безопасности (TLS, SRTP)</li>\n</ul>\n<h3>Функции телефона</h3>\n<ul>\n<li>Поддержка одной линии или directory number</li>\n<li>Отображение номера и имени вызывающего абонента</li>\n<li>Функция ожидания вызова</li>\n<li>Перевод вызова</li>\n<li>Трехсторонняя конференция</li>\n<li>Набор с положенной и поднятой трубкой</li>\n<li>Набор ранее набранного номера (Redial)</li>\n<li>Удержание вызова</li>\n<li>Прослушивание разговора (Только динамик, без микрофона)</li>\n<li>Клавиша "Messages", которая позволяет быстро попасть в голосовой ящик и прослушать сообщения</li>\n<li>4 номера быстрого набора, которые настраиваются через Cisco CallManager</li>\n<li>Поддержка Cisco Discovery Protocol</li>\n<li>Автоматическая настройка транкового порта IEEE 802.1q (virtual LAN [VLAN])</li>\n<li>Поддержка кодеков G.711a, G.711u, and G.729ab</li>\n<li>Встроенный коммутатор Ethernet</li>\n<li>Порт 10/100BASE-T Ethernet с гнездом RJ-45 для подключения к ЛВС</li>\n<li>Поддержка обновления прошивки телефона с сервера Trivial File Transfer Protocol (TFTP)</li>\n<li>Автоматическая настройка параметров сети через Dynamic Host Configuration Protocol (DHCP)</li>\n<li>Функции детектирования голоса (Voice activity detection), комфортного уровня шумов (comfort-noise generation)</li>\n</ul>\n<h3>Технические характеристики</h3>\n<ul>\n<li>Адаптер питанияпитание через Ethernet, либо через адаптер</li>\n<li>Размеры, вес17.7 x 20.3 x 15.2 см, 0.9 кг</li>\n</ul>\n', 1, '2019-10-03'),
(430, '\nIP-телефон Cisco Unified 7912G (Cisco Unified IP Phone 7912G) предназначен для работников в офисе, магазинах розничной торговли и цехах. Этот IP-телефон, представляющий собой базовую модель, дополненную определенными усовершенствованиями, обладает следующими функциональными особенностями:\n<ul>\n<li>Поддержка стандарта питания по витой паре IEEE 802.3af и стандарта питания Cisco;</li>\n<li>Дополнительный объем памяти для поддержки усовершенствованных функций и приложений</li>\n<li>Полная защита линий Cisco Unified CallManager;</li>\n<li>Пользовательский интерфейс, схожий с интерфейсами других моделей IP-телефонов семейства Cisco Unified;</li>\n<li>4 программируемые клавиши обеспечивают пользователям CP-7912G доступ к различным функциям и возможностям, в то время как графический дисплей объединяет интуитивное управление, информацию о вызовах и службы XML.</li>\n</ul>\n<h3>Технические характеристики IP-телефона Cisco Unified 7912G</h3>\n<h3>Поддерживаемые кодеки</h3>\n<ul>\n<li>G.711a</li>\n<li>G.711</li>\n<li>G.729a</li>\n<li>G.729b</li>\n<li>G.729ab</li>\n</ul>\n<h3>Сеть</h3>\n<ul>\n<li>Cisco Discovery Protocol; IEEE 802.1 p/q</li>\n<li>10/100BASE-T Ethernet х 2 RJ-45 ports</li>\n<li>SCCP</li>\n<li>DHCP</li>\n<li>TFTP</li>\n</ul>\n<h3>Основные возможности</h3>\n<ul>\n<li>Пиксельный дисплей представляет широкие возможности по отображению информации о вызовах, а также задействованных функциях.</li>\n<li>4 клавиши для вызова различных функций и управления телефоном</li>\n<li>Одна линия (Directory Number) с поддержкой переключения между двумя вызовами через функцию Call Waiting</li>\n<li>Подсвечиваемая клавиша “Hold”</li>\n<li>Возможность прослушивания разговора при подключении спикерфона</li>\n<li>Поддержка кодеков G.711/ G.711a/ G.729a /G.729b /G729ab/ iLBC</li>\n<li>Поддержка протокола SCCP (CUCM 3.3(5)SR2)</li>\n<li>Поддержка протокола SIP (CUCM 5.0(2))</li>\n<li>Автоматическая настройка транкового порта IEEE 802.1q VLAN</li>\n<li>Встроенный коммутатор 10/100 BaseT Ethernet</li>\n<li>Встроенная поддержка inline power</li>\n<li>Поддержка IEEE 803af (PoE)</li>\n<li>Увеличен объём памяти</li>\n<li>Расширенные функции безопасности (TLS, SRTP)</li>\n</ul>\n<h3>Функции телефона</h3>\n<ul>\n<li>Поддержка одной линии или directory number</li>\n<li>Отображение номера и имени вызывающего абонента</li>\n<li>Функция ожидания вызова</li>\n<li>Перевод вызова</li>\n<li>Трехсторонняя конференция</li>\n<li>Набор с положенной и поднятой трубкой</li>\n<li>Набор ранее набранного номера (Redial)</li>\n<li>Удержание вызова</li>\n<li>Прослушивание разговора (Только динамик, без микрофона)</li>\n<li>Клавиша "Messages", которая позволяет быстро попасть в голосовой ящик и прослушать сообщения</li>\n<li>4 номера быстрого набора, которые настраиваются через Cisco CallManager</li>\n<li>Поддержка Cisco Discovery Protocol</li>\n<li>Автоматическая настройка транкового порта IEEE 802.1q (virtual LAN [VLAN])</li>\n<li>Поддержка кодеков G.711a, G.711u, and G.729ab</li>\n<li>Встроенный коммутатор Ethernet</li>\n<li>Порт 10/100BASE-T Ethernet с гнездом RJ-45 для подключения к ЛВС</li>\n<li>Поддержка обновления прошивки телефона с сервера Trivial File Transfer Protocol (TFTP)</li>\n<li>Автоматическая настройка параметров сети через Dynamic Host Configuration Protocol (DHCP)</li>\n<li>Функции детектирования голоса (Voice activity detection), комфортного уровня шумов (comfort-noise generation)</li>\n</ul>\n<h3>Технические характеристики</h3>\n<ul>\n<li>Адаптер питанияпитание через Ethernet, либо через адаптер</li>\n<li>Размеры, вес17.7 x 20.3 x 15.2 см, 0.9 кг</li>\n</ul>\n', 1, '2019-10-04'),
(431, '\nCisco IP Phone серии 7940 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров. \n<br><br>IP телефон Cisco 7940G - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7940G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7940G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7940G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 2 (4)</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 20,32 x 26,67 x 15,24 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-04'),
(432, '\nCisco IP Phone серии 7941 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров. \n<br><br>IP телефон Cisco 7941G - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7941G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7941G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7941G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 2 (4)</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 20,32 x 26,67 x 15,24 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-04'),
(433, '\nCisco IP Phone серии 7942 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров. \n<br><br>IP телефон Cisco 7942G - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7942G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7942G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7942G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 2 (4)</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 20,32 x 26,67 x 15,24 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-04'),
(434, '\nIP-телефон Cisco 7945G использует все последние достижения IP-телефонии, включая поддержку широкополосного аудио, цветной дисплей с подсветкой и встроенный порт Gigabit Ethernet. Этот IP-телефон имеет большой цветной дисплей с подсветкой, обеспечивающий простой доступ к коммуникационной информации, приложениям сохранения времени и таким возможности, как дата и время, имя группы вызова, номер группы вызова, набранный номер и информация о присутствии. Поддержка XML-приложений позволяет воспользоваться всеми преимуществами дисплея. Этот телефон предоставляет прямой доступ к 2 телефонным линиям (или комбинации линий), быстрый набор и прямой доступ к телефонным возможностям, 4 программируемые клавиши, обеспечивающие пользователям доступ к возможностям вызова и функциям, а также джойстик для навигации по меню. Спикерфон и телефонная трубка, разработанные специально для высококачественного широкополосного звука, являются стандартом для IP-телефона, как и разъем для подключения наушников.\n<h2>Технические характеристики Cisco CP-7945G</h2>\n<h3></h3>\n\n<h3>Физические характеристики</h3>\n<ul>\n<li>Размеры, см: 26.67 x 15.24 x 20.32</li>\n<li>Вес, кг: 1.6</li>\n\n<li>Тип установки, особенности конструкции<ul>\n<li>Корпус из ABS-пластика</li>\n<li>Подставка с возможностью наклона на 60°</li>\n<li>Возможность крепления на стене при помощи опциональных кронштейнов</li>\n</ul></li>\n\n</ul>\n\n<h3>Интерфейсные порты</h3>\n<ul>\n<li>Сетевые интерфейсы: 2 x RJ-45 10/100/1000 BASE-T</li>\n<li>Другие интерфейсы: 1 порт для подключения наушников</li>\n</ul>\n\n\n\n<h3>Сетевые особенности</h3>\n<ul>\n\n<li>Функциональные возможности<ul>\n<li>Большое количество мелодий звонка: Доступно более 24 мелодий звонка. Мелодии звонка могут быть выбраны при помощи Cisco Unified Phone Application Suite</li>\n<li>Языковая поддержка:Встроенная поддержка более 30 языков (зависит от версии Cisco Unified Communications Manager)</li>\n</ul></li>\n\n<li>Передача данных<ul>\n<li>Функции качества обслуживания (QoS)</li>\n<li>Телефон поддерживает точку кода дифференцированных услуг (DSCP) и стандарты 802.1Q/p</li>\n</ul></li>\n\n<li>Передача голоса<ul>\n<li>Поддержка кодеков: G.711a, G.711µ, G.729a, G.729ab, G.722 и iLBC</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco</li>\n</ul></li>\n\n<li>Безопасность: Идентификация устройств при помощи сертификатов X.509v3, образов с цифровой подписью, зашифрованного безопасного резервирования, безопасной сигнализации и безопасных данных при помощи AES-128. Также телефон поддерживает 802.1X и преодоление EAPOL</li>\n<li>Управление: IP-адрес может быть назначен вручную или автоматически при помощи клиента DHCP</li>\n</ul>\n', 1, '2019-10-04'),
(435, '\nАдаптер питания для телефонов Cisco, используемый на объектах, где нет технологии подачи питания по кабелю Ethernet (Power over Ethernet). CP-PWR-CUBE-3= совместим и может заменять устаревшую модель CP-PWR-CUBE-2=\n', 1, '2019-10-04'),
(436, '\nCisco IP Phone серии 7960 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров.\n<br><br>IP телефон Cisco 7960G - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7960G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7960G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7960G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 6</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 26,7 x 20,3 x 15,2 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-07'),
