(439, '\nCisco IP Phone серии 7965 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров.\n<br><br>IP телефон Cisco 7965G - телефон бизнес уровня с большим цветным графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7965G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7965G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7965G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 6</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 26,7 x 20,3 x 15,2 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-07');
INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(442, '\nКонсоль для IP-телефона Cisco 7916 расширяет возможности IP-телефонов Cisco 7962G, 7965G, и 7975G с помощью дополнительных кнопок и ЖК-дисплея. Используя этот модуль расширения, вы добавляете 12 аппаратных и получаете доступ к 12 дополнительным кнопкам с помощью кнопок страниц, добавляя 24 кнопки к уже имеющимся 6 кнопкам на IP-телефоне Cisco 7962G и 7965G и к имеющимся 8 кнопкам на IP-телефоне Cisco 7975G. Вы можете использовать 2 или более консолей с IP-телефонами Cisco 7962G, 7965G, и 7975G.\n<br><br>Основные особенности\n<ul>\n<li>Дисплей 4.3" высокого разрешения (480 x 272) - графический графический (TFT) цветной. Дисплей поддерживает локализированный интерфейс, требуется двухбайтная Unicode-кодировка для шрифтов;</li>\n<li>12 кнопок - на каждую кнопку можно назначить телефонную линию или быстрый набор;</li>\n<li>2 кнопки страниц.</li>\n</ul>\nТребует наличия подставки CP-SINGLFOOTSTAND= при одном модуле расширения и CP-DOUBLFOOTSTAND= при двух. А так же отдельного блока питания CP-PWR-CUBE-3.</ul>\n', 1, '2019-10-07'),
(443, '\nКонсоль для IP-телефона Cisco 7915 расширяет возможности IP-телефонов Cisco 7962G, 7965G, и 7975G с помощью дополнительных кнопок и ЖК-дисплея. Используя этот модуль расширения, вы добавляете 12 аппаратных и получаете доступ к 12 дополнительным кнопкам с помощью кнопок страниц, добавляя 24 кнопки к уже имеющимся 6 кнопкам на IP-телефоне Cisco 7962G и 7965G и к имеющимся 8 кнопкам на IP-телефоне Cisco 7975G. Вы можете использовать 2 или более консолей с IP-телефонами Cisco 7962G, 7965G, и 7975G.\n<br><br>Основные особенности\n<ul>\n<li>Дисплей 4.3" высокого разрешения (480 x 272) - графический монохромный четырехбитный полутоновой. Дисплей поддерживает локализированный интерфейс, требуется двухбайтная Unicode-кодировка для шрифтов;</li>\n<li>12 кнопок - на каждую кнопку можно назначить телефонную линию или быстрый набор;</li>\n<li>2 кнопки страниц.</li>\n</ul>\nТребует наличия подставки CP-SINGLFOOTSTAND= при одном модуле расширения и CP-DOUBLFOOTSTAND= при двух. А так же отдельного блока питания CP-PWR-CUBE-3.</ul>\n', 1, '2019-10-07'),
(444, '\nКонсоль для IP-телефона Cisco 7914 расширяет возможности IP-телефонов Cisco 7960G, 7961G, 7970G и 7971G-GE с помощью дополнительных кнопок и ЖК-дисплея. Используя этот модуль расширения, вы добавляете 14 кнопок к уже имеющимся 6 кнопкам на IP-телефонах Cisco 7960 и 7961G и к имеющимся 8 кнопкам на IP-телефонах Cisco 7970G и 7971G-GE, а также возможно увеличить общее количество кнопок путем подключения 2 консолей. Вы можете использовать 2 или более консолей с IP-телефонами Cisco 7960G, 7961G, 7970G или 7971G-GE.\n<br><br>Основные особенности\n<ul>\n<li>Дисплей 4.3" высокого разрешения (480 x 272) - графический монохромный четырехбитный полутоновой. Дисплей поддерживает локализированный интерфейс, требуется двухбайтная Unicode-кодировка для шрифтов;</li>\n<li>14 кнопок - на каждую кнопку можно назначить телефонную линию или быстрый набор.</li>\n</ul>\nТребует наличия подставки CP-SINGLFOOTSTAND= при одном модуле расширения и CP-DOUBLFOOTSTAND= при двух. А так же отдельного блока питания CP-PWR-CUBE-3.</ul>\n', 1, '2019-10-07'),
(445, '\n<h2>Физические характеристики:</h2>\nРазмеры (ширина, глубина, высота), см: 26.67 x 15.24 x 23.1\nВес, кг: 1.8\n<h3>Тип установки, особенности конструкции:</h3>\n<ul>\n<li>Корпус из ABS-пластика</li>\n<li>Подставка с возможностью наклона на 60°</li>\n<li>Возможность крепления на стене при помощи опциональных кронштейнов</li>\n</ul>\n<h3>Параметры питания:</h3>\n<ul>\n<li>Получение питания от любого коммутатора, совместимого с IEEE 802.3af PoE (класс III)</li>\n<li>IP-телефон Cisco 7970G может получать питание от коммутатора, поддерживающего предварительный стандарт Cisco PoE, и будет функционировать с уменьшенной яркостью при помощи согласования CDP для того, чтобы не превышать максимальную доступную мощность</li>\n<li>получение питания от блока питания CP-PWR-CUBE-3=</li>\n</ul>\n<h3>Сетевые интерфейсы:</h3>2 x RJ-45 10/100BASE-T\n<h3>Другие интерфейсы:</h3>\n<ul>\n<li>1 порт для подключения наушников</li>\n<li>1 x 3.5 мм стерео порт для подключения внешних динамиков</li>\n<li>1 x 3.5 мм порт для подключения микрофона</li>\n</ul>\n<h2>Сетевые особенности:</h2>\n<h3>Функциональные возможности:</h3>\n<ul>\n<li>Различные мелодии звонка - На выбор пользователя доступно более 24 мелодий звонка</li>\n<li>Многоязыковая поддержка - Встроенная поддержка более 20 языков</li>\n</ul>\n<h3>Передача данных:</h3>\nВозможности качества обслуживания (QoS): телефон поддерживает точку кода дифференцированных услуг (DSCP) и стандарты 802.1Q/p\n<h3>Передача голоса:</h3>\n<ul>\n<li>Поддержка протоколов сигнализации - Телефон поддерживает Cisco Unified CallManager 3.3 и более поздние версии или Cisco Unified CallManager Express 3.2(1) и более поздние версии. Протоколы сигнализации SCCP и SIP поддерживаются телефоном при использовании агента Cisco Call Control</li>\n<li>Поддержка кодеков - Кодеки сжатия аудио G.711µ и G.729a</li>\n<li>Качество передачи голоса - Генерация комфортного шума и определение голосовой активности (VAD)</li>\n</ul>\n<h3>Безопасность:</h3>\n<ul>\n<li>Сертификаты - Телефоны укомплектованы предустановленными сертификатами X.509v3. Есть возможность самостоятельной установки и удаления сертификатов</li>\n<li>Аутентификация устройств и шифрование - Transport layer security (TLS) с шифрованием AES-128 при использовании Cisco Unified CallManager Express Version 4.0(2) и более новых версий</li>\n<li>Шифрование данных - Secure Real-Time Transport Protocol (SRTP) с шифрованием AES-128 при использовании Cisco Unified Communications Manager Express и Cisco Unified Communications Manager поздних версий</li>\n<li>802.1X Link Layer Authentication - Телефоны, использующие прошивку версии 8.2(1) или более позднюю, могут использовать протокол 802.1X Link Layer Authentication для подключения коммутатора Catalyst® с использованием этого механизма безопасности. Устройство, подключенное к порту компьютера, также может использовать протокол 802.1X Link Layer Authentication и телефон будет проходить через запросы EAPoL на основе прокси</li>\n</ul>\n<h3>Управление:</h3>\n<ul>\n<li>Получение IP-адреса может быть настроено вручную или с помощью DHCP</li>\n<li>Поддержка обновления прошивки при помощи сервера Trivial File Transfer Protocol (TFTP)</li>\n</ul>\n', 1, '2019-10-07'),
(446, '\n<h2>Физические характеристики:</h2>\nРазмеры (ширина, глубина, высота), см: 26.67 x 15.24 x 23.1\nВес, кг: 1.8\n<h3>Тип установки, особенности конструкции:</h3>\n<ul>\n<li>Корпус из ABS-пластика</li>\n<li>Подставка с возможностью наклона на 60°</li>\n<li>Возможность крепления на стене при помощи опциональных кронштейнов</li>\n</ul>\n<h3>Параметры питания:</h3>\n<ul>\n<li>Получение питания от любого коммутатора, совместимого с IEEE 802.3af PoE (класс III)</li>\n<li>IP-телефон Cisco 7971G может получать питание от коммутатора, поддерживающего предварительный стандарт Cisco PoE, и будет функционировать с уменьшенной яркостью при помощи согласования CDP для того, чтобы не превышать максимальную доступную мощность</li>\n<li>получение питания от блока питания CP-PWR-CUBE-3=</li>\n</ul>\n<h3>Сетевые интерфейсы:</h3>2 x RJ-45 10/100BASE-T\n<h3>Другие интерфейсы:</h3>\n<ul>\n<li>1 порт для подключения наушников</li>\n<li>1 x 3.5 мм стерео порт для подключения внешних динамиков</li>\n<li>1 x 3.5 мм порт для подключения микрофона</li>\n</ul>\n<h2>Сетевые особенности:</h2>\n<h3>Функциональные возможности:</h3>\n<ul>\n<li>Различные мелодии звонка - На выбор пользователя доступно более 24 мелодий звонка</li>\n<li>Многоязыковая поддержка - Встроенная поддержка более 20 языков</li>\n</ul>\n<h3>Передача данных:</h3>\nВозможности качества обслуживания (QoS): телефон поддерживает точку кода дифференцированных услуг (DSCP) и стандарты 802.1Q/p\n<h3>Передача голоса:</h3>\n<ul>\n<li>Поддержка протоколов сигнализации - Телефон поддерживает Cisco Unified CallManager 3.3 и более поздние версии или Cisco Unified CallManager Express 3.2(1) и более поздние версии. Протоколы сигнализации SCCP и SIP поддерживаются телефоном при использовании агента Cisco Call Control</li>\n<li>Поддержка кодеков - Кодеки сжатия аудио G.711µ и G.729a</li>\n<li>Качество передачи голоса - Генерация комфортного шума и определение голосовой активности (VAD)</li>\n</ul>\n<h3>Безопасность:</h3>\n<ul>\n<li>Сертификаты - Телефоны укомплектованы предустановленными сертификатами X.509v3. Есть возможность самостоятельной установки и удаления сертификатов</li>\n<li>Аутентификация устройств и шифрование - Transport layer security (TLS) с шифрованием AES-128 при использовании Cisco Unified CallManager Express Version 4.0(2) и более новых версий</li>\n<li>Шифрование данных - Secure Real-Time Transport Protocol (SRTP) с шифрованием AES-128 при использовании Cisco Unified Communications Manager Express и Cisco Unified Communications Manager поздних версий</li>\n<li>802.1X Link Layer Authentication - Телефоны, использующие прошивку версии 8.2(1) или более позднюю, могут использовать протокол 802.1X Link Layer Authentication для подключения коммутатора Catalyst® с использованием этого механизма безопасности. Устройство, подключенное к порту компьютера, также может использовать протокол 802.1X Link Layer Authentication и телефон будет проходить через запросы EAPoL на основе прокси</li>\n</ul>\n<h3>Управление:</h3>\n<ul>\n<li>Получение IP-адреса может быть настроено вручную или с помощью DHCP</li>\n<li>Поддержка обновления прошивки при помощи сервера Trivial File Transfer Protocol (TFTP)</li>\n</ul>\n', 1, '2019-10-07'),
(447, '\n<h2>Физические характеристики:</h2>\nРазмеры (ширина, глубина, высота), см: 26.67 x 15.24 x 23.1\nВес, кг: 1.8\n<h3>Тип установки, особенности конструкции:</h3>\n<ul>\n<li>Корпус из ABS-пластика</li>\n<li>Подставка с возможностью наклона на 60°</li>\n<li>Возможность крепления на стене при помощи опциональных кронштейнов</li>\n</ul>\n<h3>Параметры питания:</h3>\n<ul>\n<li>Получение питания от любого коммутатора, совместимого с IEEE 802.3af PoE (класс III)</li>\n<li>IP-телефон Cisco 7971G может получать питание от коммутатора, поддерживающего предварительный стандарт Cisco PoE, и будет функционировать с уменьшенной яркостью при помощи согласования CDP для того, чтобы не превышать максимальную доступную мощность</li>\n<li>получение питания от блока питания CP-PWR-CUBE-3=</li>\n</ul>\n<h3>Сетевые интерфейсы:</h3>2 x RJ-45 10/100/1000BASE-T\n<h3>Другие интерфейсы:</h3>\n<ul>\n<li>1 порт для подключения наушников</li>\n<li>1 x 3.5 мм стерео порт для подключения внешних динамиков</li>\n<li>1 x 3.5 мм порт для подключения микрофона</li>\n</ul>\n<h2>Сетевые особенности:</h2>\n<h3>Функциональные возможности:</h3>\n<ul>\n<li>Различные мелодии звонка - На выбор пользователя доступно более 24 мелодий звонка</li>\n<li>Многоязыковая поддержка - Встроенная поддержка более 20 языков</li>\n</ul>\n<h3>Передача данных:</h3>\nВозможности качества обслуживания (QoS): телефон поддерживает точку кода дифференцированных услуг (DSCP) и стандарты 802.1Q/p\n<h3>Передача голоса:</h3>\n<ul>\n<li>Поддержка протоколов сигнализации - Телефон поддерживает Cisco Unified CallManager 3.3 и более поздние версии или Cisco Unified CallManager Express 3.2(1) и более поздние версии. Протоколы сигнализации SCCP и SIP поддерживаются телефоном при использовании агента Cisco Call Control</li>\n<li>Поддержка кодеков - Кодеки сжатия аудио G.711µ и G.729a</li>\n<li>Качество передачи голоса - Генерация комфортного шума и определение голосовой активности (VAD)</li>\n</ul>\n<h3>Безопасность:</h3>\n<ul>\n<li>Сертификаты - Телефоны укомплектованы предустановленными сертификатами X.509v3. Есть возможность самостоятельной установки и удаления сертификатов</li>\n<li>Аутентификация устройств и шифрование - Transport layer security (TLS) с шифрованием AES-128 при использовании Cisco Unified CallManager Express Version 4.0(2) и более новых версий</li>\n<li>Шифрование данных - Secure Real-Time Transport Protocol (SRTP) с шифрованием AES-128 при использовании Cisco Unified Communications Manager Express и Cisco Unified Communications Manager поздних версий</li>\n<li>802.1X Link Layer Authentication - Телефоны, использующие прошивку версии 8.2(1) или более позднюю, могут использовать протокол 802.1X Link Layer Authentication для подключения коммутатора Catalyst® с использованием этого механизма безопасности. Устройство, подключенное к порту компьютера, также может использовать протокол 802.1X Link Layer Authentication и телефон будет проходить через запросы EAPoL на основе прокси</li>\n</ul>\n<h3>Управление:</h3>\n<ul>\n<li>Получение IP-адреса может быть настроено вручную или с помощью DHCP</li>\n<li>Поддержка обновления прошивки при помощи сервера Trivial File Transfer Protocol (TFTP)</li>\n</ul>\n', 1, '2019-10-07'),
(448, '\n<h2>Физические характеристики:</h2>\nРазмеры (ширина, глубина, высота), см: 26.67 x 15.24 x 23.1\nВес, кг: 1.8\n<h3>Тип установки, особенности конструкции:</h3>\n<ul>\n<li>Корпус из ABS-пластика</li>\n<li>Подставка с возможностью наклона на 60°</li>\n<li>Возможность крепления на стене при помощи опциональных кронштейнов</li>\n</ul>\n<h3>Параметры питания:</h3>\n<ul>\n<li>Получение питания от любого коммутатора, совместимого с IEEE 802.3af PoE (класс III)</li>\n<li>IP-телефон Cisco 7975G может получать питание от коммутатора, поддерживающего предварительный стандарт Cisco PoE, и будет функционировать с уменьшенной яркостью при помощи согласования CDP для того, чтобы не превышать максимальную доступную мощность</li>\n<li>получение питания от блока питания CP-PWR-CUBE-3=</li>\n</ul>\n<h3>Сетевые интерфейсы:</h3>2 x RJ-45 10/100/1000BASE-T\n<h3>Другие интерфейсы:</h3>\n<ul>\n<li>1 порт для подключения наушников</li>\n<li>1 x 3.5 мм стерео порт для подключения внешних динамиков</li>\n<li>1 x 3.5 мм порт для подключения микрофона</li>\n</ul>\n<h2>Сетевые особенности:</h2>\n<h3>Функциональные возможности:</h3>\n<ul>\n<li>Различные мелодии звонка - На выбор пользователя доступно более 24 мелодий звонка</li>\n<li>Многоязыковая поддержка - Встроенная поддержка более 20 языков</li>\n</ul>\n<h3>Передача данных:</h3>\nВозможности качества обслуживания (QoS): телефон поддерживает точку кода дифференцированных услуг (DSCP) и стандарты 802.1Q/p\n<h3>Передача голоса:</h3>\n<ul>\n<li>Поддержка протоколов сигнализации - Телефон поддерживает Cisco Unified CallManager 3.3 и более поздние версии или Cisco Unified CallManager Express 3.2(1) и более поздние версии. Протоколы сигнализации SCCP и SIP поддерживаются телефоном при использовании агента Cisco Call Control</li>\n<li>Поддержка кодеков - Кодеки сжатия аудио G.711µ и G.729a</li>\n<li>Качество передачи голоса - Генерация комфортного шума и определение голосовой активности (VAD)</li>\n</ul>\n<h3>Безопасность:</h3>\n<ul>\n<li>Сертификаты - Телефоны укомплектованы предустановленными сертификатами X.509v3. Есть возможность самостоятельной установки и удаления сертификатов</li>\n<li>Аутентификация устройств и шифрование - Transport layer security (TLS) с шифрованием AES-128 при использовании Cisco Unified CallManager Express Version 4.0(2) и более новых версий</li>\n<li>Шифрование данных - Secure Real-Time Transport Protocol (SRTP) с шифрованием AES-128 при использовании Cisco Unified Communications Manager Express и Cisco Unified Communications Manager поздних версий</li>\n<li>802.1X Link Layer Authentication - Телефоны, использующие прошивку версии 8.2(1) или более позднюю, могут использовать протокол 802.1X Link Layer Authentication для подключения коммутатора Catalyst® с использованием этого механизма безопасности. Устройство, подключенное к порту компьютера, также может использовать протокол 802.1X Link Layer Authentication и телефон будет проходить через запросы EAPoL на основе прокси</li>\n</ul>\n<h3>Управление:</h3>\n<ul>\n<li>Получение IP-адреса может быть настроено вручную или с помощью DHCP</li>\n<li>Поддержка обновления прошивки при помощи сервера Trivial File Transfer Protocol (TFTP)</li>\n</ul>\n', 1, '2019-10-07'),
(449, '\nCisco IP Phone серии 7961 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров.\n<br><br>IP телефон Cisco 7961G - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7961G реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7961G содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7961G</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100/1000BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 6</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 26,7 x 20,3 x 15,2 см</li>\n<li>Вес: 1,6 кг</li>\n</ul>\n', 1, '2019-10-09'),
(450, '\nCisco IP Phone серии 7941 являются представителями второго поколения полнофункциональных IP телефонов для пользователей с низким и средним трафиком, которым требуется минимальное число абонентских номеров.\n<br><br>IP телефон Cisco 7941G-GE - телефон бизнес уровня с большим жидкокристаллическим графическим дисплеем и встроенным Ethernet коммутатором. Дисплей отображает дату и время, имя и номер вызывающего абонента и набираемые цифры. В IP телефоне Cisco 7941G-GE реализована поддержка языка XML и сетевых приложений. Cisco IP Phone 7941G-GE содержит две программируемые кнопки линия/функция, допускающие выполнение до четырех одновременных вызовов, и четыре интерактивные программируемые кнопки, которые помогают пользователю выполнять функции вызова. Управление аудио средствами позволяет изменять громкость и выбирать между телефонной трубкой, головной гарнитурой или высококачественной двухсторонней громкой связью. Доступ в корпоративную директорию, используя протокол LDAP v.3.\n<br><br>Функции телефона могут развиваться совместно с развитием новых технологий путем программной модификации флэш-памяти телефона.\n\n<h3>Основные характеристики IP телефона Cisco 7941G-GE</h3>\n<ul>\n<li>Экран: Большой графический</li>\n<li>Громкоговоритель: Дуплексный</li>\n<li>Поддержка головного телефона: да</li>\n<li>Наличие встроенного Ethernet коммутатора: да</li>\n<li>Тип портов Ethernet: 10/100/1000BASE-T</li>\n<li>Количество поддерживаемых линий (вызовов): 2 (4)</li>\n<li>Поддерживаемые кодеки: G.711, G.729a</li>\n<li>Поддержка сетевых приложений и языка XML: да</li>\n<li>Поддерживаемые протоколы: SCCP, H323, SIP, MGCP</li>\n</ul>\n\n<h3>Технические характеристики</h3>\n<ul>\n<li>Размеры: 20,32 x 26,67 x 15,24 см</li>\n<li>Вес: 1,6 кг</li>\n', 1, '2019-10-09'),
(451, '\nCisco Unified IP Conference Station 7937G - телефон для конференц-зала, который обеспечивает превосходное качество голоса, с упрощенной настройкой и низкой стоимостью. Конференц-станция Cisco Unified IP Conference 7937G предназначена для использования на рабочих местах и в конференц-залах.\n<br><br>Cisco Unified IP Conference Station 7937G предлагает полнодуплексную высококачественную широкополосную технологию громкой связи. В комплект входят автоматическое регулирование усиления, комфортное шумоподавление, подавление тишины / детектирование голосовой активности, подавление эха и динамическое шумоподавление, что снижает уровень шума до 9 дБ от постоянных источников шума, таких как вентиляторы.\n<br><br>Внутренний порт Ethernet позволяет напрямую подключаться к сети Ethernet 10 / 100BASE-T через интерфейс RJ-45 с одним подключением к локальной сети для конференц-станции Cisco Unified IP Conference 7937G. Совместное размещение ПК с Cisco Unified IP Conference Station 7937G не поддерживается.\n<br><br>Cisco Unified IP Conference Station 7937G идентифицирует входящие сообщения и классифицирует их для пользователей на экране. Эта функция позволяет пользователям быстро и эффективно возвращать вызовы с использованием возможности прямого набора номера. Корпоративный каталог интегрируется с стандартным каталогом по LDAPv3.\n<br><br>Cisco Unified IP Conference Station 7937G позволяет пользователям быстро получать доступ к разнообразной информации, такой как погода, акции, котировки дня или любая веб-информация.\n', 1, '2019-10-09'),
(452, '\nСтанция конференц-связи Cisco Unified IP Conference Station 7936 объединяет в себе передовые технологии конференц-связи с использованием динамика и признанные технологии голосовых коммуникаций Cisco.\n<h3>Основные характеристики станции конференц-связиCisco Unified IP Conference Station 7936</h3>\n<ul>\n<li>Для использования в переговорных комнатах</li>\n<li>360 градусная зона охвата обеспечивается высокачественным динамиком и тремя микрофонами</li>\n<li>Обеспечение высокого качества громкой связи</li>\n<li>Жидкокристаллический графический дисплей с подсветкой</li>\n<li>Возможность подключения до 2 внешних микрофонов</li>\n<li>Поддерживает базовый набор функций IP телефона (Hold, Transfer, Mute, Conference, Call Park)</li>\n</ul>\n', 1, '2019-10-09'),
(453, '\nIP-конференц-станция Cisco 7935 - профессиональное полнодуплексное устройство с автоматической установкой соединения, предназначенное для конференц-связи в офисах. Cisco 7935 обеспечивает высочайшее качество голоса, поддерживает подавление пауз и эха, имеет мощный динамик. Три активных микрофона с динамическим изменением чувствительности позволяют участникам конференции передвигаться во время разговора. В дополнение к обычной телефонной панели, Cisco 7935 имеет три программируемых клавиши и клавиши навигации по меню, графический LCD экран.\n', 1, '2019-10-09'),
(459, '\nCisco IP Conference Phone 7832 - это телефон для конференц-связи начального уровня, который обеспечивает превосходную производительность HD-звука для административных офисов и небольших конференций, в которых могут участвовать до шести участников.\n<br><br>Cisco IP Conference Phone 7832 расширяет возможности совместной работы, ориентируясь на людей, предоставляя удобные в использовании аудиоконференции. Он сочетает в себе превосходную производительность звука высокой четкости (HD) и 360-градусный охват микрофона в очень доступной и компактной форме, что делает его идеальным как для небольших конференц-залов, так и для частных комнат, таких как кабинет руководителя.\n<br><br>7832 разработан с уникальной акустической архитектурой, которая позволяет ему захватывать как более низкие частоты, так и более высокие частоты человеческого голоса, что приводит к истинному звучанию. Благодаря полнодуплексной технологии, которая исключает отвлекающие пропуски, а также последние достижения в области эхоподавления, он обеспечивает удобство конференц-связи без компромиссов.\n<br><br>Конференц-связь становится более продуктивной и эффективной благодаря четырем чувствительным микрофонам с охватом 360 градусов, которые позволяют пользователям говорить обычным голосом и быть отчетливо слышимыми на расстоянии до 2,1 м (7 футов). Телефон также оснащен технологией, которая предотвращает помехи от мобильных телефонов и других беспроводных устройств, обеспечивая бесперебойную связь.\n<br><br>Cisco IP Conference Phone 7832 использует первоклассную технологию голосовой связи по IP (VoIP) Cisco для обеспечения простоты использования, «постоянной готовности», шифрованной голосовой связи для беспрецедентной безопасности и доступа к большому набору функций унифицированных коммуникаций от CUCM. (Cisco Unified Communications Manager) или облако Cisco Spark.\n\n<h2>Ключевые особенности Cisco IP Conference Phone 7832</h2>\n<ul>\n<li>Компактный дизайн с охватом комнаты на 360 градусов и приемистостью микрофона не менее 7 футов (2,1 м).</li>\n<li>3,4-дюймовый (8,6 см), 384x128-пиксельный монохромный ЖК-дисплей со светодиодной подсветкой и антибликовой рамкой.</li>\n<li>Большая кнопка отключения звука для быстрого доступа со всех сторон устройства.</li>\n<li>Одна линия с поддержкой нескольких вызовов на линию, как и на других телефонах серии 7800.</li>\n<li>Поддержка кодеков, включая G.711 (u / A), G.729a, G.729ab, iLBC, G.722 и OPUS.</li>\n<li>Безопасный алгоритм кэширования (SHA) -256 включен для расширенных функций безопасности.</li>\n<li>IEEE 802.3af Power over Ethernet (PoE) Class 2 для низкого энергопотребления. Доступен дополнительный внешний универсальный блок питания переменного тока. Продукт сертифицирован организацией Energy Star.</li>\n</ul>\n<h2>Характеристики Cisco IP Conference Phone 7832</h2>\n<h3>Эргономичный дизайн</h3>\n<ul>\n<li>Гладкая форма и доступные материалы для современного внешнего вида</li>\n<li>Интерфейс серии 7800 обеспечивает простой в использовании и традиционный интерфейс телефона</li>\n</ul>\n<h3>Графический дисплей</h3>\n<ul>\n<li>Монохромный дисплей 384x128 (Ш x В) с белой светодиодной подсветкой обеспечивает прокручиваемый доступ к функциям вызова и текстовым XML-приложениям.</li>\n<li>Антибликовая и защищенная от отпечатков пальцев рамка обеспечивает кристально чистый вид ЖК-дисплея высокого разрешения</li>\n</ul>\n<h3>Громкая связь</h3>\nПолнодуплексный громкоговоритель на телефоне обеспечивает гибкость при размещении и приеме вызовов без помощи рук.\n<h3>Контроль громкости</h3>\nПереключатель регулировки громкости обеспечивает легкую настройку уровня громкости динамика и звонка.\n<h3>Коммутатор Ethernet</h3>\n10/100 BASE-T\n<h3>Клавиши</h3>\n<ul>\n<li>Четыре контекстно-зависимые программные клавиши</li>\n<li>Двусторонняя навигация и клавиши выбора</li>\n<li>Стандартная клавиатура</li>\n<li>Клавиша регулировки громкости</li>\n<li>Большой ключ отключения звука доступен со всех сторон</li>\n</ul>\n<h3>Особенности питания</h3>\n<ul>\n<li>IEEE PoE Class 2. Телефон совместим с блейд-коммутаторами IEEE 802.3af и 802.3at и поддерживает как протокол обнаружения Cisco, так и протокол обнаружения канального уровня - питание через Ethernet (LLDP-PoE)</li>\n<li>Если подключенные коммутаторы локальной сети не поддерживают PoE, потребуется запасной кабель питания PoE для работы с Cisco Power Cube 3 / Power Adapter 3 для обеспечения питания от сети переменного тока.</li>\n</ul>\n<h3>Поддержка Call-Control</h3>\n<ul>\n<li>Cisco Unified Communications Manager: 10,5 и выше</li>\n<li>Cisco Hosted Collaboration Solution: 10,5 и выше</li>\n<li>Cisco Spark Call: Поддержка Cisco Spark Call для облачного решения Cisco</li>\n</ul>\n<h3>Поддержка протокола сигнализации</h3>\nПротокол инициации сеанса (SIP)\n<h3>Поддержка аудио кодеков</h3>\nG.711 a-law и mu-law, широкополосный (G.722), G.729a, G.729ab, Интернет-кодек с низкой скоростью передачи битов (iLBC), OPUS\n', 1, '2019-10-10'),
(458, '\n<h3>Особенности</h3>\n<ul>\n\n<li>16 телефонных линий;</li>\n\n<li>Протокол SIP;</li>\n\n<li>Монохромный ЖК-дисплей 396x162;</li>\n\n<li>Полнодуплексный спикерфон;</li>\n\n<li>Поддержка широкополосного аудио;</li>\n\n<li>Поддержка E.164 номерного плана;</li>\n\n<li>Разъем для гарнитуры;</li>\n\n<li>Встроенная поддержка записи разговоров;</li>\n\n<li>Встроенный коммутатор Ethernet 10/100 Мбит/с;</li>\n\n<li>Возможность электропитания PoE Class 1 или Power Cube 3;</li>\n\n<li>Поддержка кодеков G.711a/μ, G.722, G.729ab, iLBC.</li>\n\n</ul>\n<h3>Основные характеристики</h3>\n<ul>\n\n<li>Интерфейс Ethernet: 2 x FE RJ-45</li>\n\n<li>Порт гарнитуры: Разъем RJ-9</li>\n\n<li>Тип питания: DC 48В/PoE</li>\n\n<li>Блок питания в комплекте: Да</li>\n\n<li>Регулировка наклона: 2 позиции регулировки</li>\n\n<li>Кодеки: G.711a/μ, G.722, G.729ab, iLBC</li>\n\n</ul>\n<h3>Дополнительно</h3>\n<ul>\n\n<li>Размеры,мм: 207 x 265 x 28 мм</li>\n\n<li>Вес, г: 1053</li>\n\n<li>Рабочая температура: 0°до 40 ° C</li>\n\n<li>Мелодии: Телефон поддерживает настраиваемые пользователем мелодий.</li>\n</ul>\n', 1, '2019-10-10'),
(457, '\n<h3>Особенности</h3>\n<ul>\n\n<li>4 телефонные линии;</li>\n\n<li>Протокол SIP;</li>\n\n<li>Монохромный ЖК-дисплей 396x162;</li>\n\n<li>Полнодуплексный спикерфон;</li>\n\n<li>Поддержка широкополосного аудио;</li>\n\n<li>Поддержка E.164 номерного плана;</li>\n\n<li>Разъем для гарнитуры;</li>\n\n<li>Встроенная поддержка записи разговоров;</li>\n\n<li>Встроенный коммутатор Ethernet 10/100/1000 Мбит/с;</li>\n\n<li>Возможность электропитания PoE Class 1 или Power Cube 3;</li>\n\n<li>Поддержка кодеков G.711a/μ, G.722, G.729ab, iLBC.</li>\n\n</ul>\n<h3>Основные характеристики</h3>\n<ul>\n\n<li>Интерфейс Ethernet: 2 x FE RJ-45</li>\n\n<li>Порт гарнитуры: Разъем RJ-9</li>\n\n<li>Тип питания: DC 48В/PoE</li>\n\n<li>Блок питания в комплекте: Да</li>\n\n<li>Регулировка наклона: 2 позиции регулировки</li>\n\n<li>Кодеки: G.711a/μ, G.722, G.729ab, iLBC</li>\n\n</ul>\n<h3>Дополнительно</h3>\n<ul>\n\n<li>Размеры,мм: 207 x 265 x 28 мм</li>\n\n<li>Вес, г: 1053</li>\n\n<li>Рабочая температура: 0°до 40 ° C</li>\n\n<li>Мелодии: Телефон поддерживает настраиваемые пользователем мелодий.</li>\n</ul>\n', 1, '2019-10-10'),
(456, '\n<h3>Особенности</h3>\n<ul>\n\n<li>2 телефонные линии;</li>\n\n<li>Протокол SIP;</li>\n\n<li>Монохромный ЖК-дисплей 396x162;</li>\n\n<li>Полнодуплексный спикерфон;</li>\n\n<li>Поддержка широкополосного аудио;</li>\n\n<li>Поддержка E.164 номерного плана;</li>\n\n<li>Разъем для гарнитуры;</li>\n\n<li>Встроенная поддержка записи разговоров;</li>\n\n<li>Встроенный коммутатор Ethernet 10/100 Мбит/с;</li>\n\n<li>Возможность электропитания PoE Class 1 или Power Cube 3;</li>\n\n<li>Поддержка кодеков G.711a/μ, G.722, G.729ab, iLBC.</li>\n\n</ul>\n<h3>Основные характеристики</h3>\n<ul>\n\n<li>Интерфейс Ethernet: 2 x FE RJ-45</li>\n\n<li>Порт гарнитуры: Разъем RJ-9</li>\n\n<li>Тип питания: DC 48В/PoE</li>\n\n<li>Блок питания в комплекте: Да</li>\n\n<li>Регулировка наклона: 2 позиции регулировки</li>\n\n<li>Кодеки: G.711a/μ, G.722, G.729ab, iLBC</li>\n\n</ul>\n<h3>Дополнительно</h3>\n<ul>\n\n<li>Размеры,мм: 207 x 205 x 28 мм</li>\n\n<li>Вес, кг: 0,9</li>\n\n</ul>\n', 1, '2019-10-10'),
(455, '\n<h3>Технические характеристики IP телефона Cisco 7811</h3>\n<ul>\n<li>Дисплей: Монохромный LCD 3,2" (384 x106)\n\n<li>Порт гарнитуры: Разъем RJ-9\n\n<li>Протокол VoIP: SIP\n\n<li>Тип питания: PoE/DC 48В\n\n<li>Протоколы безопасности VoIP: SRTP/TLS/AES\n\n<li>Блок питания в комплекте: Нет\n\n<li>Регулировка наклона: Не регулируется\n\n<li>SOFT клавиши: 4 клавиши\n\n<li>Громкоговоритель: Да\n\n<li>Интерфейс Ethernet: 2 x FE RJ-45\n</ul>\n', 1, '2019-10-10'),
(468, '\nТелефон начального уровня с одной линией с аккуратным дизайном в виде компактной подставки-платформы под трубку. Этот телефон отлично подойдет для тех мест, где поль-зоваться им предстоит достаточно редко: вестибюлей, корпоративных кухонь, коридоров, проходов, лифтов, конференц-залов, ванной гостиничного номера.\n<br><br>IP-телефон Cisco 6901 поддерживает до двух входящих звонков с поддержкой режима ожидания. Фиксированные кнопки обеспечивают быстрый доступ к функциям удержания вызова, повторного вызова или ожидания вызова.\n<br><br>IP-телефон Cisco 6901 поддерживает режимы конференции и передачи звонка.\n<br><br>Большие возможности персонализации делают IP-телефон Cisco 6901 приспосабливаемым к любым запросам клиента. Телефон выпускается в двух цветовых вариантах (черный и белый) и двух видах телефонных трубок (обычная и тонкая).\n', 1, '2019-10-10'),
(469, '\nОсобенностью это модели IP-телефона является программируемая функциональная клавиша обеспечивающая быстрый доступ к современным услугам связи. Трехцветный светодиод линии обеспечивает визуальный мониторинг.\n<br><br>IP телефон Cisco 6911 поставляется на выбор в 2-х цветовых вариантах - черный и белый, и с двумя разными трубками - тонкой и стандартной.\n', 1, '2019-10-11'),
(470, '\nIP-телефон Cisco 6921 является инновационным конечным устройством, обеспечивающим доступную голосовую связь бизнес-класса и поддерживающим службы видео связи для клиентов по всему миру.\n<br><br>IP-телефон поддерживает 2 линии и оснащен полнодуплексным спикерфоном для повышения продуктивности, гибкости и простоты использования. IP-телефон Cisco 6921 обеспечивает поддержку 1 звонка на линию, предлагая телефонию, максимально приближенную к традиционной. Специальные клавиши для удержания, перевода вызова и конференцсвязи; трехцветные светодиодные индикаторы линий и функциональные клавиши также упрощают использование телефона.\n<br><br>При использовании Cisco Unified Video Advantage 2.2 и более новых версий, а также VTIII камеры, Вы можете добавить поддержку видео связи. Ваш монитор обеспечивает поддержку видео связи, а голосовая связь обеспечивается IP-телефоном Cisco 6921. \n<h3>Основные особенности</h3>\n<ul>\n<li>Монохромный дисплей;</li>\n<li>2 телефонных линии;</li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100BASE-T</li>\n<li>Интерфейс для подключения проводной гарнитуры;</li>\n<li>Пользовательские мелодии звонка;</li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP);</li>\n<li>Доступен в двух цветах: чёрном и белом;</li>\n</ul>\n', 1, '2019-10-11'),
(471, '\nCisco 6945 модель IP-телефона бизнес-класса с поддержкой видео-связи и расширенными возможностями (Cisco UC Phone 6945, Standard Handset).\nАппарат поддерживает четыре телефонные линии, имеет полнодуплексную громкую связь, поддерживает удержание вызова на каждой из линий и прекрасно подходит административному персоналу, финансовым структурам, менеджерам и т.д.\nОсновное отличие от модели Cisco 6941 является поддержка G.722 кодека и наличие 1000BASE-T порта.\n<h3>Технические характеристики</h3>\n<ul>\n<li>Небликующий ЖК-дисплей с разрешением 396х162 точки и белой задней подсветкой, что облегчает чтение в различных световых условиях</li>\n<li>4 кнопки линий с трёхцветной индикацией статуса вызова</li>\n<li>2 x RJ-45 10/100/1000BASE-T Ethernet</li>\n<li>Энергосберегающий режим "глубокого сна", снижающий энергопотребление аппаратов на 50% в нерабочие часы</li>\n<li>Возможно подключение видеокамеры VT Camera III и ПО Cisco Unified Video Advantage (приобретаются отдельно) для совершения видеозвонков с помощью ПК</li>\n<li>Поддержка кодеков: G.711a, G.711, G.729a, G.729b и G.729ab, G.722 , iLBC аудио-сжатие</li>\n<li>Напряжение питания 48 В DC, подается при помощи опционального блока питания CP-PWR-CUBE-3 или инжектора питания CP-PWR-INJ</li>\n<li>IEEE 802.3af PoE (класс 2)</li>\n</ul>\n', 1, '2019-10-11'),
(472, '\nCisco 6961 модель IP-телефона бизнес-класса с поддержкой видео-связи и расширенными возможностями (Cisco UC Phone 6945, Standard Handset).\nАппарат поддерживает четыре телефонные линии, имеет полнодуплексную громкую связь, поддерживает удержание вызова на каждой из линий и прекрасно подходит административному персоналу, финансовым структурам, менеджерам и т.д.\nОсновное отличие от модели Cisco 6941 является поддержка G.722 кодека и наличие 100BASE-T порта.\n<h3>Технические характеристики</h3>\n<ul>\n<li>Небликующий ЖК-дисплей с разрешением 396х162 точки и белой задней подсветкой, что облегчает чтение в различных световых условиях</li>\n<li>4 кнопки линий с трёхцветной индикацией статуса вызова</li>\n<li>2 x RJ-45 10/100BASE-T Ethernet</li>\n<li>Энергосберегающий режим "глубокого сна", снижающий энергопотребление аппаратов на 50% в нерабочие часы</li>\n<li>Возможно подключение видеокамеры VT Camera III и ПО Cisco Unified Video Advantage (приобретаются отдельно) для совершения видеозвонков с помощью ПК</li>\n<li>Поддержка кодеков: G.711a, G.711, G.729a, G.729b и G.729ab, G.722 , iLBC аудио-сжатие</li>\n<li>Напряжение питания 48 В DC, подается при помощи опционального блока питания CP-PWR-CUBE-3 или инжектора питания CP-PWR-INJ</li>\n<li>IEEE 802.3af PoE (класс 2)</li>\n</ul>\n', 1, '2019-10-11'),
(473, '\nCisco CP-3905 – настольный IP телефон компании Cisco. IP телефон является базовым IP телефоном, работающим по протоколу SIP. Он имеет строгий универсальный дизайн и минимум необходимых функций для полноценной поддержки IP телефонии. IP телефон Cisco CP-3905 имеет монохромный дисплей с разрешением 128х32 пикселей. Cisco CP-3905 имеет полнодуплексный спикерфон для удобства общения. CP-3905 имеет встроенный коммутатор на 2 порта RJ-45 с поддержкой технологии Fast Ethernet. Один порт из них служит для подключения к локальной сети, а другой – для подключения последующих в сетевой иерархии оконечных устройств. IP телефоном Cisco CP-3905 поддерживается протокол установления сессий SIP, который является наиболее распространенным, удобным и надежным на данный момент. К поддерживаемым звуковым кодекам IP телефона Cisco CP-3905 следует отнести разновидности G.711 и G.729. Кодеки используются для качественной и экономичной передачи речи по сети.\n', 1, '2019-10-14'),
(474, '\nCisco  Unified IP Phone Injector CP-PWR-INJ= - инжектор питания с помощью которого увеличивается гибкость развертывания IP-телефонов Cisco, путем предоставления альтернативного питания.\n<br><br>Cisco Unified IP Phone инжектор питания, ставится между коммутатором и Cisco IP-телефоном,  устанавливается IEEE 802.3af режим для питания подключенного телефона и 10/100/1000BASE-T Ethernet соединение с коммутатором. Максимальное расстояние Cisco инжектора питания, между Cisco Unified IP-телефона и Ethernet коммутатора 100 метров.\n<h3>Основные функции Cisco Unified IP Phone Injector CP-PWR-INJ</h3>\n<ul>\n<li>802.3af/IEEE питания через Ethernet (PoE)</li>\n<li>Gigabit Ethernet поддержка</li>\n<li>Полное соответствие уровня предприятия</li>\n<li>Разработан и испытан для использования с Cisco Unified IP-телефонов</li>\n</ul>\n', 1, '2019-10-14'),
(475, '\nБлок питания не подходит к телефонам CP-7941G, CP-7961G и CP-7971G. Для них используется блок питания CP-PWR-CUBE-3\n', 1, '2019-10-14'),
(476, '\nБлок питания для IP телефонов серии CISCO 8800/8900/9900. Адаптер питания для телефонов Cisco, используемый на объектах, где нет технологии подачи питания по кабелю Ethernet (Power over Ethernet).\n', 1, '2019-10-14'),
(477, '\nВидео IP телефон Cisco 8941 - новый передовой профессиональный мультимедиа IP телефон, обеспечивающий  доступ к услугам голосовой связи. Видео IP телефон Cisco 8941 обладает стильным эргономичным дизайном, удобным пользовательским интерфейсом, цветным LCD экраном с высоким разрешением, встроенной видео камерой и портом проводной гарнитуры. IP телефон Cisco 8941 имеет 4 независимые клавиши линий с 3-х цветной индикацией состояния и 4 контекстно-зависимые клавиши. Встроенный коммутатор обеспечивает доступ к сети со скоростью 10/100 Мбит/с. Видео IP телефон Cisco 8941 поддерживает аудио кодек высокой четкости HD, что позволяет более продуктивно использовать его в  мультимедиа приложениях. Видео IP телефон Cisco 8941  включает в себя поддержку приложений XML и MIDlet-приложений. Cisco 8941 является идеальным решением для специалистов, администраторов, менеджеров и руководителей.\n<h3>Основные особенности</h3>\n<ul>\n<li>Цветной LCD дисплей;</li>\n<li>4 телефонных линии;</li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100BASE-T</li>\n<li>Интерфейс для подключения проводной гарнитуры;</li>\n<li>Большое количество мелодий звонка;</li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco.</li>\n</ul>\n', 1, '2019-10-15'),
(478, '\nВидео IP телефон Cisco 8945 - новый передовой профессиональный мультимедиа IP телефон, обеспечивающий  доступ к услугам голосовой связи. Видео IP телефон Cisco 8941 обладает стильным эргономичным дизайном, удобным пользовательским интерфейсом, цветным LCD экраном с высоким разрешением, встроенной видео камерой и портом проводной гарнитуры. IP телефон Cisco 8941 имеет 4 независимые клавиши линий с 3-х цветной индикацией состояния и 4 контекстно-зависимые клавиши. Встроенный коммутатор обеспечивает доступ к сети со скоростью 10/100 Мбит/с. Видео IP телефон Cisco 8945 поддерживает аудио кодек высокой четкости HD, что позволяет более продуктивно использовать его в  мультимедиа приложениях. Видео IP телефон Cisco 8941  включает в себя поддержку приложений XML и MIDlet-приложений. Cisco 8945 является идеальным решением для специалистов, администраторов, менеджеров и руководителей.\n<h3>Основные особенности</h3>\n<ul>\n<li>Цветной LCD дисплей;</li>\n<li>4 телефонных линии;</li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100/1000BASE-T</li>\n<li>Интерфейс для подключения проводной гарнитуры;</li>\n<li>Большое количество мелодий звонка;</li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco.</li>\n</ul>\n', 1, '2019-10-15'),
(479, '\nIP-телефон Cisco 8961 является инновационным конечным устройством, обеспечивающим доступную голосовую связь бизнес-класса и поддерживающим службы видео связи для клиентов по всему миру. 2 USB-порта для перифирии, гигабитный интернет и HD звук.\n<br><br>IP-телефон Cisco 8961 поддерживает 5 линий и оснащен полнодуплексной громкой связью для повышения продуктивности, гибкости и простоты использования. Специальные клавиши для удержания, перевода вызова и конференцсвязи; трехцветные светодиодные индикаторы линий и функциональные клавиши также упрощают использование телефона. IP-телефоны Cisco 8961 обеспечивает большие возможности персонализации, предлагают выбор из 2 цветов и 2 видов телефонных трубок. \n<br><br>IP-телефоны Cisco 8961 также являются более энергоэффективными и экологичными. Функция глубокого сна обеспечивает экономию энергии. С этой функцией IP-телефон Cisco 8961 потребляет 50 % мощности в режиме простоя. Кроме того, корпус сделан из перерабатываемого пластика\n<br><br>При использовании Cisco Unified Video Advantage 2.2 и более новых версий, а также VTIII камеры, Вы можете добавить поддержку видео связи. Ваш монитор обеспечивает поддержку видео связи, а голосовая связь обеспечивается IP-телефоном Cisco 8961.\n<h3>Основные особенности</h3>\n<ul>\n<li>Большой цветной LCD дисплей;<li>\n<li>5 телефонных линий;<li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100/1000BASE-T<li>\n<li>Встроенные USB порты;<li>\n<li>Большое количество мелодий звонка: доступно более 24 мелодий звонка;<li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;<li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco.<li>\n</ul>\n', 1, '2019-10-15'),
(480, '\nIP видеотелефон Cisco 9951 является передовым конечным устройством, обеспечивающим передачу голоса, видео, поддерживающим приложения.\n<br><br>IP видеотелефон Cisco 9951 поддерживает Gigabit Ethernet, звук HD качества, высокое разрешение. USB порт позволяет подсоединять: Bluetooth беспроводную гарнитуру, USB камеру стандартного расширения. Для увеличения числа линий Unified IP Color Key Expansion Module (модуль расширения).\n<br><br>IP видеотелефон Cisco 9951 поддерживает XML и Java MIDlet приложения.\n<h3>Основные особенности</h3>\n<ul>\n<li>Большой цветной LCD дисплей;</li>\n<li>5 телефонных линий;</li>\n<li>Видеокамера 2.0MP с поддержкой H.264  со скоростью 24к/c @VGA, 30к/с @CIF;</li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100/1000BASE-T</li>\n<li>Встроенный Bluetooth интерфейс для подключения беспроводной гарнитуры;</li>\n<li>Встроенные USB порты;</li>\n<li>Большое количество мелодий звонка: доступно более 24 мелодий звонка;</li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco.</li>\n</ul>\n', 1, '2019-10-15'),
(481, '\nIP видеотелефон Cisco 9971 является передовым конечным устройством, обеспечивающим передачу голоса, видео, поддерживающим приложения.\n<br><br>IP видеотелефон Cisco 9971 поддерживает Gigabit Ethernet, 802.11 a/b/g Wi-Fi, звук HD качества, высокое разрешение. USB порт позволяет подсоединять: Bluetooth беспроводную гарнитуру, USB камеру стандартного расширения (поставляется отдельно). Для увеличения числа линий Unified IP Color Key Expansion Module (модуль расширения).\n<br><br>IP видеотелефон Cisco 9971 поддерживает XML и Java MIDlet приложения.\n<h3>Основные особенности</h3>\n<ul>\n<li>Большой сенсорный цветной LCD дисплей;</li>\n<li>6 телефонных линий;</li>\n<li>Встроенный коммутатор: 2 порта RJ-45 10/100/1000BASE-T</li>\n<li>Встроенный WiFi 802.11 a/b/g интерфейс;</li>\n<li>Встроенный Bluetooth интерфейс для подключения беспроводной гарнитуры;</li>\n<li>Встроенные USB порты;</li>\n<li>Большое количество мелодий звонка: доступно более 24 мелодий звонка;</li>\n<li>Языковая поддержка: встроенная поддержка более 30 языков;</li>\n<li>Поддержка протоколов сигнализации: Skinny Client Control Protocol (SCCP) и Session Initiation Protocol (SIP) с контролем вызовов Cisco.</li>\n</ul>\n', 1, '2019-10-15'),
(482, '\n<h3>Обзор продукта</h3>\nCisco ISR 4000 series – универсальное решение на базе модульной операционной системы IOS XE Software для построения корпоративной распределенной сети, в том числе с использованием технологии Cisco Intelligent WAN (IWAN). С помощью Cisco IWAN осуществляется динамическая маршрутизация трафика приложений с выбором оптимального канала связи на основе сформированной политики и с учетом текущего состояния сети. Это позволяет гарантировать требуемые производительность приложений и конфиденциальность передаваемых данных, контролировать использование полосы пропускания и состояние соединений WAN.\n<br><br>Помимо оптимизации WAN-каналов, в решении объединены возможности унифицированных коммуникаций, поддержка корпоративных распределенных вычислений за счет использования серверных модулей UCS-E. В условиях стремительной трансформации бизнеса, роста трафика данных и перехода большинства бизнес-процессов в онлайн, оборудование предоставляет необходимые скорость, масштабируемость и сервисы.\n<br><br>Маршрутизаторы Cisco ISR 4000 series оптимально подходят не только для подключения небольших офисов с требованиями к пропускной способности от 50 до 300 Мбит/с, но и для крупных организаций с распределенной корпоративной сетью и пропускной способностью до 3 Гбит/с. При этом, платформа основывается на модели «Pay As You Grow» (PAYG) т.е. «Плати по мере роста», что предусматривает поэтапное наращивание функциональности и производительности, которую, по мере обновления лицензии, можно увеличить без аппаратной модернизации и в тот момент, когда это действительно требуется.\n<br><br>В новом поколении маршрутизаторов используются многоядерные процессоры, а также современная архитектура в которой выделяются отдельные ресурсы под control, data и services plane. Разделение трафика данных, контроля и сервисов позволяет достигать максимальной эффективности, а также обеспечивать непрерывное функционирование сервисов, в том числе в случае сбоя. Это дает возможность задействовать на одной платформе такие актуальные технологии, как VPN, межсетевой экран, контроль приложений, выбор маршрута, оптимизация WAN, передача голоса, видеонаблюдение и т. д.\n<h3>Ключевые особенности</h3>\n<ul>\n<li>Маршрутизаторы нового поколения заметно более производительные и мощные, чем маршрутизаторы поколения ISR G2</li>\n<li>Многоядерная процессорная архитектура с использованием динамически адаптируемой модульной операционной системы IOS-XE</li>\n<li>Реализация концепции Pay-As-You-Grow (Плати по мере роста) и предоставляет пользователю заведомо более серьёзное железо за сниженную стоимость, позволяя нарастить производительность докупкой и активацией специальной Performance лицензии.</li>\n<li>Возможность использовать выделенные ресурсы для различных сервисов</li>\n</ul>\n<h3>Архитектура</h3>\nСерия маршрутизаторов Cisco ISR 4000 построена на многоядерной архитектуре процессора. Модульная операционная система Cisco IOS XE позволяет в полной мере использовать распределенную многоядерную архитектуру платформы. Одной из ключевых особенностей архитектуры Cisco ISR 4000 является разделение операций управления (control plane) и обработки данных (data plane), а также внедряет первую в отрасли плоскость обслуживания (services plane). Этот дизайн обеспечивает полнофункциональные интегрированные сервисы до 7 уровня при сохранении стабильности и высокой производительности в периоды интенсивного сетевого трафика.\n', 1, '2019-10-15');
INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(483, '\n<h3>Обзор продукта</h3>\nCisco ISR 4000 series – универсальное решение на базе модульной операционной системы IOS XE Software для построения корпоративной распределенной сети, в том числе с использованием технологии Cisco Intelligent WAN (IWAN). С помощью Cisco IWAN осуществляется динамическая маршрутизация трафика приложений с выбором оптимального канала связи на основе сформированной политики и с учетом текущего состояния сети. Это позволяет гарантировать требуемые производительность приложений и конфиденциальность передаваемых данных, контролировать использование полосы пропускания и состояние соединений WAN.\n<br><br>Помимо оптимизации WAN-каналов, в решении объединены возможности унифицированных коммуникаций, поддержка корпоративных распределенных вычислений за счет использования серверных модулей UCS-E. В условиях стремительной трансформации бизнеса, роста трафика данных и перехода большинства бизнес-процессов в онлайн, оборудование предоставляет необходимые скорость, масштабируемость и сервисы.\n<br><br>Маршрутизаторы Cisco ISR 4000 series оптимально подходят не только для подключения небольших офисов с требованиями к пропускной способности от 50 до 300 Мбит/с, но и для крупных организаций с распределенной корпоративной сетью и пропускной способностью до 3 Гбит/с. При этом, платформа основывается на модели «Pay As You Grow» (PAYG) т.е. «Плати по мере роста», что предусматривает поэтапное наращивание функциональности и производительности, которую, по мере обновления лицензии, можно увеличить без аппаратной модернизации и в тот момент, когда это действительно требуется.\n<br><br>В новом поколении маршрутизаторов используются многоядерные процессоры, а также современная архитектура в которой выделяются отдельные ресурсы под control, data и services plane. Разделение трафика данных, контроля и сервисов позволяет достигать максимальной эффективности, а также обеспечивать непрерывное функционирование сервисов, в том числе в случае сбоя. Это дает возможность задействовать на одной платформе такие актуальные технологии, как VPN, межсетевой экран, контроль приложений, выбор маршрута, оптимизация WAN, передача голоса, видеонаблюдение и т. д.\n<h3>Ключевые особенности</h3>\n<ul>\n<li>Маршрутизаторы нового поколения заметно более производительные и мощные, чем маршрутизаторы поколения ISR G2</li>\n<li>Многоядерная процессорная архитектура с использованием динамически адаптируемой модульной операционной системы IOS-XE</li>\n<li>Реализация концепции Pay-As-You-Grow (Плати по мере роста) и предоставляет пользователю заведомо более серьёзное железо за сниженную стоимость, позволяя нарастить производительность докупкой и активацией специальной Performance лицензии.</li>\n<li>Возможность использовать выделенные ресурсы для различных сервисов</li>\n</ul>\n<h3>Архитектура</h3>\nСерия маршрутизаторов Cisco ISR 4000 построена на многоядерной архитектуре процессора. Модульная операционная система Cisco IOS XE позволяет в полной мере использовать распределенную многоядерную архитектуру платформы. Одной из ключевых особенностей архитектуры Cisco ISR 4000 является разделение операций управления (control plane) и обработки данных (data plane), а также внедряет первую в отрасли плоскость обслуживания (services plane). Этот дизайн обеспечивает полнофункциональные интегрированные сервисы до 7 уровня при сохранении стабильности и высокой производительности в периоды интенсивного сетевого трафика.\n', 1, '2019-10-15'),
