(486, '\n<h3>Обзор продукта</h3>\nCisco ISR 4000 series – универсальное решение на базе модульной операционной системы IOS XE Software для построения корпоративной распределенной сети, в том числе с использованием технологии Cisco Intelligent WAN (IWAN). С помощью Cisco IWAN осуществляется динамическая маршрутизация трафика приложений с выбором оптимального канала связи на основе сформированной политики и с учетом текущего состояния сети. Это позволяет гарантировать требуемые производительность приложений и конфиденциальность передаваемых данных, контролировать использование полосы пропускания и состояние соединений WAN.\n<br><br>Помимо оптимизации WAN-каналов, в решении объединены возможности унифицированных коммуникаций, поддержка корпоративных распределенных вычислений за счет использования серверных модулей UCS-E. В условиях стремительной трансформации бизнеса, роста трафика данных и перехода большинства бизнес-процессов в онлайн, оборудование предоставляет необходимые скорость, масштабируемость и сервисы.\n<br><br>Маршрутизаторы Cisco ISR 4000 series оптимально подходят не только для подключения небольших офисов с требованиями к пропускной способности от 50 до 300 Мбит/с, но и для крупных организаций с распределенной корпоративной сетью и пропускной способностью до 3 Гбит/с. При этом, платформа основывается на модели «Pay As You Grow» (PAYG) т.е. «Плати по мере роста», что предусматривает поэтапное наращивание функциональности и производительности, которую, по мере обновления лицензии, можно увеличить без аппаратной модернизации и в тот момент, когда это действительно требуется.\n<br><br>В новом поколении маршрутизаторов используются многоядерные процессоры, а также современная архитектура в которой выделяются отдельные ресурсы под control, data и services plane. Разделение трафика данных, контроля и сервисов позволяет достигать максимальной эффективности, а также обеспечивать непрерывное функционирование сервисов, в том числе в случае сбоя. Это дает возможность задействовать на одной платформе такие актуальные технологии, как VPN, межсетевой экран, контроль приложений, выбор маршрута, оптимизация WAN, передача голоса, видеонаблюдение и т. д.\n<h3>Ключевые особенности</h3>\n<ul>\n<li>Маршрутизаторы нового поколения заметно более производительные и мощные, чем маршрутизаторы поколения ISR G2</li>\n<li>Многоядерная процессорная архитектура с использованием динамически адаптируемой модульной операционной системы IOS-XE</li>\n<li>Реализация концепции Pay-As-You-Grow (Плати по мере роста) и предоставляет пользователю заведомо более серьёзное железо за сниженную стоимость, позволяя нарастить производительность докупкой и активацией специальной Performance лицензии.</li>\n<li>Возможность использовать выделенные ресурсы для различных сервисов</li>\n</ul>\n<h3>Архитектура</h3>\nСерия маршрутизаторов Cisco ISR 4000 построена на многоядерной архитектуре процессора. Модульная операционная система Cisco IOS XE позволяет в полной мере использовать распределенную многоядерную архитектуру платформы. Одной из ключевых особенностей архитектуры Cisco ISR 4000 является разделение операций управления (control plane) и обработки данных (data plane), а также внедряет первую в отрасли плоскость обслуживания (services plane). Этот дизайн обеспечивает полнофункциональные интегрированные сервисы до 7 уровня при сохранении стабильности и высокой производительности в периоды интенсивного сетевого трафика.\n', 1, '2019-10-15'),
