(497, '\nКоммутаторы Catalyst 3850 серии - это стекируемые коммутаторы доступа следующего поколения для корпоративного сектора, которые обеспечивают конвергенцию проводных и беспроводных сетей.\n<br><br>Одной из инновационных технологий, применяемых на платформе Catalyst 3850, является новая интегральная схема Cisco Unified Access Data Plane (UADP) ASIC, которая обеспечивает поддержку новой архитектуры Cisco Unified Access. Cisco UADP ASIC позволяет объединить обработку проводного и беспроводного трафика на едином уровне (data plane) и обеспечивает высокую производительность и масштабируемость с помощью технологии Cisco StackWise-480.\n<h3>Основные особенности</h3>\n<ul>\n<li>Встроенный контроллер беспроводного доступа с возможностью:</li>\n<ul>\n<li>до 40 Гбит беспроводного траффика на свитч (для 48-портовых моделей)</li>\n<li>поддержка до 50 точек доступа и до 2000 беспроводных клиентов на одно коммутирующее устройство (коммутатор или стек)</li>\n</ul>\n<li>24-портовые и 48-портовые гигабитные порты доступа с поддержкой PoE+ и EEE (energy-efficient Ethernet)</li>\n<li>Cisco StackWise-480 технология обеспечивает масштабируемость и отказоустойчивость с пропускной способностью стека в 480 Гбит/с</li>\n<li>Cisco StackPower технология обеспечивает резервирование и наращивание бюджета электропитания в коммутируемом стеке</li>\n<li>Три опциональных модуля для аплинков: 4 x Gigabit Ethernet, 2 x 10 Gigabit Ethernet или 4 x 10 Gigabit Ethernet</li>\n<li>Два отказоустойчивых модульных блока питания и три блока вентиляторов</li>\n<li>Полный IEEE 802.3at (PoE+) с 30 Вт питания на все порты в 1 RU форм-факторе.</li>\n<li>Высокоэффективная IP-маршрутизация</li>\n</ul>\n', 1, '2019-10-25'),
