(521, '\n<h3>Обзор продукта</h3>\nCisco Catalyst 9500 серии — это коммутаторы корпоративного класса следующего поколения. Данная серия коммутаторов, основанная на процессоре x86, представляет собой ведущую специализированную платформу для уровня ядра и агрегирования, предназначенную для обеспечения безопасности, Интернета вещей, облачных технология и удобства обслуживания. Коммутаторы поставляются с 4-ядерным процессором x86 2,4-ГГц, 16 ГБ памяти DDR4 и 16-ГБ flash памяти.\n<br><br>Cisco Catalyst 9500 - это первая в отрасли специализированная линейка коммутаторов 25, 40 и 100 Gigabit Ethernet, предназначенная для корпоративной сети. Эти коммутаторы обеспечивают непревзойденный размер таблиц (MAC / route / ACL) и буферизацию для корпоративных приложений. Cisco Catalyst серии 9500 включает в себя неблокирующие коммутаторы с малым форм-фактором 40 и 100 Gigabit Ethernet (QSFP+, QSFP28), и 1, 10 и 25 Gigabit Ethernet (SFP / SFP + / SFP28), которые соответствуют различным потребностям предприятия. Коммутаторы поддерживают расширенные службы маршрутизации и инфраструктуры (такие как многопротокольная коммутация по меткам [MPLS] уровня 2 и уровня 3, VPN для многоадресной передачи [MVPN] и трансляция сетевых адресов [NAT]); Программно-определяемые возможности доступа Cisco (такие как база данных отслеживания хоста, междоменное подключение и протокол [VRF] с поддержкой маршрутизации и пересылки, основанный на использовании протокола VRF, LISP); и виртуализация сетевых систем с помощью виртуальной технологии Cisco StackWise, которая имеет решающее значение для их размещения в ядре сети предприятия\n<h3>Основные особенности Cisco Catalyst 9500 серии​:</h3>\n<ul>\n<li>Intel® 2.4-GHz x86 CPU, память DDR4 16 GB, flash память 16 GB</li>\n<li>до 120 ГБ USB 3.0 или до 960 ГБ SATA SSD-хранилища для хостинга приложений</li>\n<li>Коммутационная способность до 6,4 Тбит/с и производительностью до 2 Bpps</li>\n<li>До 36 МБ объединенного буфера на ASIC</li>\n<li>До 32 неблокирующих портов 40 / 100 Gigabit Ethernet (QSFP+ / QSFP28)</li>\n<li>До 48 неблокирующих портов 10 / 25 Gigabit Ethernet (SFP+ / SFP28)</li>\n<li>Поддержка IPv6 аппаратно, обеспечивающая wire-rate переадресацию для сетей IPv6.</li>\n<li>Поддержка двух стеков для IPv4 / IPv6 и динамическое выделение таблиц аппаратной переадресации для упрощения миграции с IPv4 на IPv6.</li>\n<li>Поддержка статического и динамического NAT и трансляции адресов портов (PAT).</li>\n<li>До 212 000 записей маршрутизации (IPv4 / IPv6) для развертывания ядра и агрегации.</li>\n<li>До 512 000 записей Flexible NetFlow (FNF), аппаратно</li>\n<li>До 2 блоков питания (поставляются с одним БП)</li>\n<li>Модули аплинка: C9500-NM-8X (8 портов 1/10GE (SFP / SFP+)) и С9500-NM-2Q (2 порта 40GE (QSFP+)), - подходят только для коммутаторов (С9500-16X и C9500-16X)</li>\n</ul>\n', 1, '2019-10-28'),
