INSERT INTO `ditemtypes` (`itemtype_id`, `description`, `user_id`, `currentdate`) VALUES
(541, '\n<b>В комплект входит:\n<br>Блок питания PWR-C1-350WAC - 1 шт. \n<br>Модуль аплинка в комплект не входит</b>\n<br><br>Коммутаторы Cisco Catalyst серии 9300 — это новое поколение самой популярной в отрасли стекируемой платформы коммутации. Эти сетевые коммутаторы созданы для Интернета вещей, облачных технологий, обеспечения безопасности и являются основой архитектуры уровня предприятия.\n<br><br>Эта серия коммутаторов реализует конвергенцию Интернета вещей с ведущим в индустрии уровнем масштабируемости. Коммутаторы обеспечивают до 384 портов с мощностью до 60Вт для UPOE, а также POE+ и PoE, высокую безопасность, поддержку протокола AVB и стандарта IEEE 1588, анализ сервисов и классификацию для приложений Интернета вещей.\nКоммутаторы Catalyst серии 9300 обеспечивают интеллектуальный, простой и максимально безопасный доступ с помощью интегрированного контроллера беспроводной сети. Они могут работать в условиях высокой плотности по стандарту 802.11ac второй волны (48 точек доступа) и при этом отличаются компактностью (форм-фактор 1 RU).\nКоммутаторы Cisco Catalyst 9300 созданы с применением технологии Cisco StackWise, что позволяет обеспечивать гибкое развертывание рабочих конфигураций, а также способствовать поддержке непрерывного обмена информационными данными без простоя, тем самым повышая эффективность эксплуатации.\n<h3>Основные особенности Cisco Catalyst серии 9300​:</h3>\n<ul>\n<li>Cisco StackWise-480 технология обеспечивает масштабируемость и отказоустойчивость с пропускной способностью стека в 480 Гбит/с</li>\n<li>Cisco StackPower технология обеспечивает резервирование и наращивание бюджета электропитания в коммутируемом стеке</li>\n<li>Пять опциональных модулей для аплинков: 4 x 1G, 4 x Multigigabit (100M,1G, 2.5G, 5G и 10G), 8 x 10G, 2 x 40G, 2 x 25G</li>\n<li>Встроенный контроллер беспроводного доступа по стандарту 802.11ac</li>\n<li>Два отказоустойчивых модульных блока питания и три блока вентиляторов</li>\n<li>Полный IEEE 802.3at (PoE+) с 30 Вт питания на все порты, а также UPOE до 60 Вт в 1 RU форм-факторе</li>\n<li>CPU x86 1.8 GHz, память DRAM 8 GB, внутренняя Flash память 8 GB, буфер 16 MB</li>\n</ul>\n', 1, '2019-10-29'),
