(599, '\nКоммутаторы Cisco Catalyst серии 9200 — это новое поколение стекируемых коммутаторов, которые приходят на смену коммутатором Cisco Catalyst 2960-X/XR.\n<br><br>Коммутаторы Cisco Catalyst 9200 серии обеспечивают функции безопасности, а также отказоустойчивость. Будучи основополагающими строительными блоками для построений цифровой сети, коммутаторы Catalyst 9200 серии помогают заказчикам упростить и оптимизировать структуру сети, а также сократить эксплуатационные расходы.\n<br><br>Коммутаторы Cisco Catalyst 9200 поддерживают технологию StackWise, что позволяет обеспечивать гибкое развёртывание рабочих конфигураций, а также способствовать поддержке непрерывного обмена информационными данными без простоя, тем самым повышая эффективность эксплуатации.\n<h3>Основные особенности Cisco Catalyst 9200 серии:</h3>\n<ul>\n<li>Cisco StackWise-160 и StackWise-80 технология обеспечивает масштабируемость и отказоустойчивость с пропускной способностью стека до 160 Гбит/с</li>\n<li>Полный IEEE 802.3at (PoE+) с 30 Вт питания на все порты в 1 RU форм-фактор</li>\n<li>Два отказоустойчивых модульных блока питания и два блока вентиляторов</li>\n<li>Два опциональных модуля для аплинков: C9200-NM-4G, C9200-NM-4X</li>\n<li>Поддержка функций L3</li>\n<li>Quad core CPU 1.4 GHz, память DRAM 4GB / 2GB, внутренняя Flash память 4 GB, буфер 6 MB</li>\n</ul>\n', 1, '2019-11-05'),
(609, '\nУстройства Cisco Firepower серии 2100 — это семейство из четырех платформ безопасности на базе МСЭ\nнового поколения с ориентацией на защиту от угроз, обеспечивающих непрерывность бизнеса благодаря\nнепревзойденной защите от угроз. При активации расширенных функций защиты от угроз\nпроизводительность системы остается стабильной. Эти платформы уникальным образом сочетают в себе\nинновационную двойную многоядерную архитектуру ЦП, которая оптимизирует одновременную работу\nфункций МСЭ, шифрования и обнаружения угроз. Пропускная способность устройств находится в диапазоне\nот 1,9 до 8,5 Гбит/с, что позволяет использовать их в самых разных вариантах развертывания - от периметра\nИнтернета до ЦОД.\n', 1, '2020-03-04'),
