(613, '\nУстройства Cisco Firepower серии 4100 — это семейство, состоящее из четырех платформ безопасности\nна базе МСЭ нового поколения с ориентацией на защиту от угроз. Пропускная способность устройств\nв диапазоне от 35 до 75 Гбит/с, что позволяет их использовать в самых разных вариантах развертывания\nв ЦОД. Устройства обеспечивают надежную защиту от угроз на быстрых скоростях и не требуют много места\nдля установки.\n', 1, '2020-03-04');
