(620, '\nУстройство Cisco Firepower 9300 представляет собой масштабируемую (более 1 Тбит/с при группировании\nв кластеры) модульную платформу операторского класса, предназначенную для операторов связи,\nвысокопроизводительных вычислительных центров, крупных центров обработки данных, комплексов зданий,\nвысокочастотных торговых и других сред, когда необходима низкая (менее 5 микросекунд) задержка\nи высочайшая пропускная способность. Cisco Firepower 9300 поддерживает разгрузку потока,\nпрограммируемую оркестрацию и управление сервисами безопасности с помощью API-интерфейсов\nRESTful. Устройство также доступно в конфигурациях, поддерживающих стандарты системы построения\nсетевого оборудования (Network Equipment Building Standard, NEBS).\n', 1, '2020-03-05'),
