(627, '\nУстройство Cisco Firepower 9300 представляет собой масштабируемую (более 1 Тбит/с при группировании\nв кластеры) модульную платформу операторского класса, предназначенную для операторов связи,\nвысокопроизводительных вычислительных центров, крупных центров обработки данных, комплексов зданий,\nвысокочастотных торговых и других сред, когда необходима низкая (менее 5 микросекунд) задержка\nи высочайшая пропускная способность. Cisco Firepower 9300 поддерживает разгрузку потока,\nпрограммируемую оркестрацию и управление сервисами безопасности с помощью API-интерфейсов\nRESTful. Устройство также доступно в конфигурациях, поддерживающих стандарты системы построения\nсетевого оборудования (Network Equipment Building Standard, NEBS).\n', 1, '2020-03-05'),
(653, '\nКомпактная всепогодная беспроводная Wi-Fi точка доступа со слотом miniPCI-e. Без предустановленной LTE-карты, Устройство поставляется с одним 10/100Мбит/с портом Ethernet, который можно использовать для подключения проводных устройств.\n<br><br>Точка доступа имеет всепогодный корпус защищенный от атмосферного воздействия, и может быть установлена вне вашего дома, например на мачте, на автомобиле, на крыльце и других местах где необходимо организовать бесрповодной доступа вашему телефону или компьютеру. \n<br><br>Комплект таже включает в себя настольную подставку, поэтому точку доступа легко можно разместить на столе внутри помещения.\n<br><br>Устройство может питаться разными способами: 9-30 В PoE через Ethernet-порт, DC Jack или посредством специального автомобильного разъёма.\n', 1, '2020-07-07'),
(654, '\nКомпактная всепогодная беспроводная Wi-Fi точка доступа со слотом miniPCI-e. С предустановленной LTE-картой. Устройство поставляется с одним 10/100Мбит/с портом Ethernet, который можно использовать для подключения проводных устройств.\n<br><br>Точка доступа имеет всепогодный корпус защищенный от атмосферного воздействия, и может быть установлена вне вашего дома, например на мачте, на автомобиле, на крыльце и других местах где необходимо организовать бесрповодной доступа вашему телефону или компьютеру. \n<br><br>Комплект таже включает в себя настольную подставку, поэтому точку доступа легко можно разместить на столе внутри помещения.\n<br><br>Устройство может питаться разными способами: 9-30 В PoE через Ethernet-порт, DC Jack или посредством специального автомобильного разъёма.\n', 1, '2020-07-07'),
(655, '\nКомпактная всепогодная беспроводная Wi-Fi точка доступа со слотом miniPCI-e. С предустановленной 4G-картой. Устройство поставляется с одним 10/100Мбит/с портом Ethernet, который можно использовать для подключения проводных устройств.\n<br><br>Точка доступа имеет всепогодный корпус защищенный от атмосферного воздействия, и может быть установлена вне вашего дома, например на мачте, на автомобиле, на крыльце и других местах где необходимо организовать бесрповодной доступа вашему телефону или компьютеру. \n<br><br>Комплект таже включает в себя настольную подставку, поэтому точку доступа легко можно разместить на столе внутри помещения.\n<br><br>Устройство может питаться разными способами: 9-30 В PoE через Ethernet-порт, DC Jack или посредством специального автомобильного разъёма.\n', 1, '2020-07-07'),
(658, '\nПоддерживает одновременно два диапазона - 2.4 и 5 ГГц.\n<br><br>Устройство управляется современной мощной операционной системой RouterOS.\n<br><br>Mikrotik hAP AC Lite очень компактен и отлично подойдёт для использования в домашних условиях или в офисе.\nПредусмотрены анкерные отверстия для настенного монтажа.\n<br><br>Особенности:\n<ul>\n<li>Двухмагистральный модуль беспроводной связи на 2.4 ГГц</li>\n<li>Одномагистральный модуль беспроводной связи на 5 ГГц</li>\n<li>Мощный процессор с частотой 650 МГц</li>\n<li>64 МБ оперативной памяти</li>\n<li>5 портов Fast Ethernet</li>\n<li>Выход PoE на 5-ом порту</li>\n<li>USB-порт для подключения 3G/4G модема</li>\n<ul>\nУстройство может быть запитано с помощью блока питания через Jack или по технологии passive PoE от PoE инжектора.\nАдаптер питания входит в комплект поставки.\nИмеется выход PoE на 5-ом порту, благодаря чему можно питать другие PoE устройства с тем же напряжением.\nМаксимальная нагрузка на порт составляет 500 мА.\n', 1, '2021-04-12'),
(659, '\nОсобенности модели Mikrotik RB962UiGS-5HacT2HnT:\n<ul>\n<li>поддержка двух диапазонов беспроводной связи (2.4 и 5 ГГц). </li>\n<li>устройство управляется современной, мощной операционной системой RouterOS.</li>\n<li>5 гигабитных портов, что позволяет в полной мере воспользоваться скоростными преимуществами новейшего стандарта 802.11ac, сохраняя при этом совместимость с устаревшими устройствами, работающими в режимах 2.4 ГГц (802.11 b/g/n) и 5 ГГц (802.11 a/n). </li>\n<li>всенаправленная антенна позволяет установить hAP ac в любом месте, а радиопередатчик, обладающий высокой мощностью, обеспечит хорошее покрытие сигнала для мобильных устройств в Вашем доме, офисе или общественном месте.</li>\n<li>наличие USB-порта для подключения дополнительного устройства хранения данных или 3G/4G модема, раздачу PoE на последнем порту, что позволяет питать другие устройства RouterBOARD без дополнительного блока питания или порта SFP, для подключения активных или пассивных оптических сетевых модулей.</li>\n</ul>\n', 1, '2021-04-12'),
(660, '\nОсобенности модели Mikrotik hEX PoE (RB960PGS):\n<ul>\n<li>Все порты 1000 Мбс. </li>\n<li>Есть USB 2.0 порт для подключения стороннего оборудования. </li>\n<li>Высокомощный процессор с частотой 800 МГц.</li>\n<li>Прием питания по Poe на первом порту устройства. (поддерживается стандарт PoE 802.3at). </li>\n<li>Раздача Poe питания на портах со второго по пятый (2 А на все порты по протоколу Passive PoE).</li>\n<li>SFP вход для оптоволокна. </li>\n<li>Предустановленная операционная система RouterOS level 4. </li>\n</ul>\n', 1, '2021-04-12'),
(661, '\nМаксимальная мощность тока - 1 А на порт или 2 А на все порты, все Ethernet порты экранированы.\n<br><br>Особенности модели Mikrotik hEX PoE lite (RB750UPr2):\n<ul>\n<li>Установлена RouterOS level 4</li>\n<li>Есть USB 2.0 порт</li>\n<li>Высокомощный процессор с частотой 650 МГц (поддерживает разгон до 850 МГц)</li>\n<li>Питание по Poe на первом порту устройства.</li>\n<li>Раздача Poe питания на портах со второго по пятый (только протокол Passive Poe; стандарты 802.3 не поддерживаются! 2 А на все порты)</li>\n<li>Процессор QCA9531, 650 МГц</li>\n</ul>\n', 1, '2021-04-12'),
(662, '\nНа корпусе MikroTik hEX lite расположен разъем для подключения блока питания, кнопка перезагрузки, индикаторы активности и питания.\n<br><br>MikroTik hEX lite идеальное решение для дома или небольшой организации с целью объединения в одну локальную сеть удаленных офисов и филиалов.\n', 1, '2021-04-12'),
(663, '\nТехнические особенности:\n<ul>\n<li>Процессор с частотой 400 МГц</li>\n<li>128 МБ оперативной памяти. Устройство управляется операционной системой </li>\n<li>Программное обеспечение - RouterOS Level 5. </li>\n<li>Питание - 10 - 28 В + по PoE на комбо порту (Passive PoE 24 В).</li>\n<li>9 светодиодных индикаторов.</li>\n<li>В комплект поставки входит адаптер питания.</li>\n</ul>\n', 1, '2021-04-12'),
(665, '\nТехнические особенности:\n<ul>\n<li>полностью управляемый свитч 3-его уровня;</li>\n<li>мощный процессор Qualcomm Atheros AR9344-DC3A-R 600 МГц</li>\n<li>8 Гигабитных портов Ethernet</li>\n<li>1 консольный порт и 1 порт SFP</li>\n<li>можно настроить как для работы в режиме свитча, так и в режиме маршрутизатора (можно часть в режиме коммутации, часть в режиме маршрутизации);</li>\n<li>встроенная операционная система MikroTik Router OS 5-го уровня.</li>\n<li>поставляется в настольном корпусе</li>\n</ul>\n', 1, '2021-04-12'),
(666, '\nPoE-коммутатор имеет 8 гигабитных портов RJ45 с различными вариантами питания на выходе: автоопределение 802.3af/at PoE/PoE+ и Passive PoE. Четыре SFP-порта обеспечивают возможность оптоволоконного подключения для поддержки восходящих соединений до 1 Гбит/с. На задней стороне корпуса есть вторичный разъём DC Jack, который поддерживает источник питания 48–57 В — например, MikroTik 48V2A96W (приобретается отдельно). При питании через него, CRS112-8P-4S-IN может питать устройства 802.3af/at. Максимальная сила тока на порт составляет 1 А при входном напряжении 18–28 В, 450 мА при 48–57 В. Общий лимит 2.8 А при 24 В и 1.4 А при 48–57 В.\n<br><br>Технические особенности:\n<ul>\n<li>Неблокируемая коммутация Layer 2</li>\n<li>Таблица на 16 000 хостов</li>\n<li>IEEE 802.1Q VLAN</li>\n<li>Поддержка до 4 000 одновременных сетей VLAN</li>\n<li>Изоляция портов</li>\n<li>Безопасность портов</li>\n<li>Контроль широковещательного шторма</li>\n<li>Зеркалирование входного/выходного трафика портов </li>\n<li>Протокол RSTP (Rapid Spanning Tree)</li>\n<li>Список контроля доступа (ACL)</li>\n<li>Обнаружение других устройств MikroTik</li>\n<li>SNMP</li>\n<li>Поддержка Jumbo-кадров 9204 байт</li>\n<li>Отслеживание сетевого трафика IGMP</li>\n<li>Статическое агрегирование каналов</li>\n<li>Тихая работа без вентилятора</li>\n<li>Монтируется в стойку или устанавливается на стол</li>\n</ul>\n', 1, '2021-04-12'),
(667, '\nMikroTik CRS125-24G-1S-2HnD-IN имеет встроенную 2,4ГГц беспроводную точку доступа, это означает, что вы можете иметь точку доступа, маршрутизатор с любым количеством портов и полноценный коммутатор Smart Switch в одном устройстве - это идеальное решение для средних и малых предприятий или офисов.\n<br><br>Идеальный SOHO шлюз, маршрутизатор, коммутатор, точка доступа, все в одном устройстве:\n<ul>\n<li>Ethernet, Fiber, или 4G (с дополнительным модемом USB)</li>\n<li>Подключение шлюза к Интернет</li>\n<li>Мощный процессор Qualcomm Atheros AR9344-DC3A-R с частотой 600 МГц</li>\n<li>128 МБ оперативой памяти</li>\n<li>RouterOS шлюз/межсетевой экран/VPN маршрутизатор</li>\nvОперационная система RouterOS 5-го уровня</li>\n<li>До двадцати пяти гигабитных портов коммутатора (1xSFP и 24xRJ45)</li>\n<li>1000 мВт точка доступа на частоте 2,4ГГц</li>\n</ul>\n\n<br><br>Комплектация:\n<ul>\n<li>Настольный корпус</li>\n<li>Сенсорный LCD дисплей</li>\n<li>Две встроенные антенны 4dBi</li>\n<li>Блок питания 24В 1,2А, длина кабеля 2 метра</li>\n<li>Переходник с USB-A на microUSB-B 15 см.</li>\n</ul>\n\n<br><br>Интерфейсы:\n<ul>\n<li>1 SFP разъем, поддерживающий модули 10/100/1000Mbps, 1.25Gbps</li>\n<li>24 Gigabit Ethernet 10/100/1000BASE-T, Auto-MDI/X</li>\n<li>802.11n 2,4ГГц 1Вт радио модуль MIMO 2x2</li>\n<li>1 microUSB (с питанием) для подключения накопителей, адаптеров (serial, ethernet), 3G и 4G модемов, беспроводных адаптеров</li>\n</ul>\n\n<br><br>Управление:\n<ul>\n<li>Console (SSH, Telnet, MAC Telnet)</li>\n<li>Winbox</li>\n<li>WebFig</li>\n</ul>\n', 1, '2021-04-12'),
(668, '\nВзятая за основу операционная система RouterOS Level 5 позволяет использовать множество вариантов настройки, а предел возможностей приятно удивил испытателей. Этот проводной роутер выдерживает максимальные нагрузки, от которых не страдает его производительность, а наличие сразу 10 оптических портов SFP 1,25Gbs и одного дополнительного порта SFP+ 10Gbs делают эту модель незаменимой при построении крупных сетей с использованием оптоволкна. В пользовательском меню можно установить настройки так, чтобы отключить порты и превратить модель в маршрутизатор, пустив трафик через процессор. Из интерфейсов имеются:\n<ul>\n<li>Гигабитный порт Ethernet RJ45;</li>\n<li>10 портов SFP 1.25GB;</li>\n<li>Порт SFP+ 10Gb.</li>\n</ul>\nПомимо физических интерфейсов роутер оснащен продвинутыми «мозгами» - операционной системой Mikrotik RouterOS Level5.\n\n<br><br>Технические особенности:\n<ul>\n<li>Встроенный Firewall и NAT (создавайте правила фильтрации по IP/Mac/URL/DNS – адресам, блокируйте и перенастраивайте стандартные и нестандартные порты)</li>\n<li>Поддержка туннельных протоколов PPTP/PPoE/IPsec/SSTP/L2TP/IP2IP/EoIP (управление отдаленными филиалами/рабочими столами из центрального офиса с организацией шифрования трафика)</li>\n<li>Возможность работы с SIP трафиком для организации IP-телефонии дома или в офисе</li>\n<li>Одновременная работа сразу с несколькими провайдерами на разных интерфейсах устройства (создайте резервный канал интернета для организации стабильной работы своей сети даже при неполадках на стороне поставщика интернета)</li>\n<li>Проброс портов во внутренние и внешние сети (VLAN - на одном физическом сетевом интерфейсе (Ethernet, SFP) можно создать несколько виртуальных локальных сетей).</li>\n<li>Контроль качества работы Вашей сети (сервис QoS позволяет настраивать приоритетность скорости трафика по пользователям и/или по типу используемых приложений: почта и веб-серфинг не будут тормозить, когда кто-то смотрит он-лайн видео в рабочее время).</li>\n<li>Настройка авторизации пользователей с показом Вашей рекламы при подключении к сети (возможность построение plug&play точек коллективного пользования Internet на основе встроенных средств HotSpot с аутентификацией на RADIUS сервере)</li>\n<li>Задание скорости, времени работы клиента и пр. Можно создавать правила идентификации (логин/пароль, SMS/Web/email/ - авторизация, при подключении к устройству как физически, так и через WiFI, при наличии беспроводных точек доступа под управлением роутера).</li>\n<li>Настольный корпус модели рассчитан на то, чтобы не портить своим видом дизайн дома или офиса. Удобное меню пользователя понятно даже новичкам, поэтому вопрос настройки портов в меню Switch не стоит остро: их можно отключить полностью или частично, оставив половину роутера работать как коммутатор, а вторую как маршрутизатор.</li>\n<li>Размеры оборудования - 200 x 144 x 47 мм, поэтому если на рабочем столе роутер и заметен, то не выделяется. При этом его работа рассчитана на температуру от -35 °C в мороз и до +65 °C в жару: то есть, оборудование можно смело поставить в подсобном помещении, чтобы его вообще не было видно.</li>\n<li>Для управления предусмотрен ЖК монитор с удобным и понятным интерфейсом. Чтобы разобраться в настройках, опытным пользователям может даже не понадобиться инструкция, так как в меню все просто и понятно. Для удобства работы производитель установил на CRS212-1G-10S-1S+IN датчики температуры, напряжения, перезагрузки, а также бипер. И в целом: наличие гигабитных портов, ОЗУ в 64 Мб, а также процессора в 400 MHz делает этот роутер практически вечным, хотя гарантия на него дается всего на один год.</li>\n<li>Система охлаждения роутера по умолчанию оборудована вентилятором, но разработчики решили пойти дальше и пустить поток воздуха с максимальным эффектом. По сравнению с аналогичными моделями, охлаждение CRS212-1G-10S-1S+IN сильнее на 3-5%. Этого достаточно, чтобы оборудование могло работать круглосуточно и не доставлять своим хозяевам неприятностей.</li>\n</ul>\n<br>Краткие технические характеристики:\n<ul>\n<li>Свитч 3 уровня. Управляется не частично, а полностью;</li>\n<li>ПЗУ: 128 МБ NAND;</li>\n<li>Серия портов: 1x RJ45;</li>\n<li>Джековое питание: от 8 до 30 V.</li>\n<li>Консольный порт: RJ-45;</li>\n<li>Потребление энернии: 20 Вт - максимум.</li>\n</ul>\nЕдинственное, чем CRS212-1G-10S-1S+IN может огорчить покупателя - отсутствие питания через PoE. Скажем так: разработчики решили пожертвовать этой функцией в пользу производительности модели и усовершенствования других параметров, в том числе долговечности и охлаждения.\n<br><br>Роутер CRS212-1G-10S-1S+IN - неплохое предложение для тех, кто ценит в работе сетевого оборудования именно качество. Большое количество оптических портов делает ее универсальной для небольших и средних сетей как провайдеров, так и крупных компаний. При планировании этого роутера изготовители специально делали акцент на то, чтобы максимально улучшить технические характеристики и в результате выпустить коммутатор, способный не просто занимать место на столе, но и вписываться в комнатную или офисную обстановку.\n', 1, '2021-04-13'),
(669, '\nCRS312-4C+8XG-RM — первый коммутатор с портами 10G RJ45.\n<br><br>Более того — имеются 4 x 10G комбо-порты, которые можно использовать для 10G RJ45 Ethernet или 10G SFP+, когда нужно дополнительное оптоволоконное соединение. Эти порты поддерживают функцию software select — при\nпомощи скриптов RouterOS можно выбирать, какие порты использовать в конкретный момент.\n<br><br>Свитч MikroTik CRS312-4C+8XG-RM — простое и практичное решение для тех, кто работает с большим объемом данных и нуждается в быстром, стабильном соединении 24/7 – для производства мультимедийного контента и игр, научных исследований и многого другого.\n<br><br>Два блока питания для надёжности — никаких неожиданных перебоев, когда сроки поджимают!\n<br><br>У этого свитча есть полноразмерный USB порт, консольный порт для конфигурации и «рэковый кейс» 1U для всех стандартных стоек.\n<br><br>Функция «двойной загрузки» позволяет выбрать одну из двух операционных систем — легендарную RouterOS\nc множеством возможностей или более простую, но тоже мощную SwOS. Для маршрутизации и других\nфункций 3-го уровня используйте RouterOS.\n<br><br>Неблокирующая пропускная способность - 120 Gbps, пропускная способность - 240 Gbps, скорость работы\nкоммутационной матрицы - 178 Mpps.\n', 1, '2021-04-13'),
(670, '\nMikroTik CRS326-24S+2Q+RM - это быстрый коммутатор для ресурсоёмких задач.\n<br><br>Если вы работаете с существенным объёмом данных, например, обеспечиваете подключение к Интернету\nили работаете с крупным дата-центром, это устройство — идеальное обновление для вашей системы.\nCRS326-24S+2Q+RM - наш первый продукт с QSFP+ портами на 40 Gbps для удивительно быстрого и\nстабильного оптоволоконного подключения.\n<br><br>Свитчем CRS326-24S+2Q+RM легко управлять — у него есть полноразмерный USB порт для конфигурации и\nдва блока питания. Долой неожиданные перебои — система должна работать всё время, чтобы ваши клиенты\nи коллеги были довольны.\n<br><br>Функция «двойной загрузки» позволяет выбрать одну из двух операционных систем — легендарную RouterOS\nc множеством возможностей или более простую, но тоже мощную SwOS. Для маршрутизации и других\nфункций 3-го уровня используйте RouterOS.\n<br><br>Это устройство отлично подойдёт как новым, так и существующим сетям — мы разработали ряд аксессуаров, которые помогут насладиться потенциалом этого свитча в полной мере в любой конфигурации.\n', 1, '2021-04-13'),
(673, '\nВозможно подключение до 8 таких клиентских устройств к одной точке доступа 60 ГГц — например, wAP 60G AP или wAP 60Gx3 AP — для получения стабильного радиосигнала без помех от сетей 2,4 и 5 ГГц.\n<br><br>Конструкция Cube Lite60 менее заметна по сравнению с привычным CPE в виде «тарелки». Эффективная дальность радиосвязи в PtMP-схеме достигает 500 м.\n', 1, '2021-04-29'),
(674, '\nДанное устройство подойдет для построения линков в диапазоне 5 ГГц на небольшие расстояния до 1.5 км в прямой видимости или для использования в качестве CPE от базовой станции. \n<br><br>Главные особенности DISC Lite5:\n<ul>\n<li>Встроенный радиомодуль 5ГГц</li>\n<li>Питание по PoE, либо от адаптера.</li>\n<li>MIMO 2x2</li>\n<li>Встроенная RouterOS 3-го уровня</li>\n</ul>\n\n<br>Комплектация:\n<ul>\n<li>радиоустройство</li>\n<li>Адаптер питания 24 В 0.38 A</li>\n<li>Металлический хомут</li>\n<li>PoE-инжектор</li>\n</ul>\n', 1, '2021-04-29'),
(675, '\nУлучшенная конструкция (по сравнению с предыдущей <a href="http://docrec.ru/cat.php?it=674">моделью</a>), гигабитный Ethernet-порт, поддержка стандартов 802.11a/n/ac для обеспечения ещё большей скорости на дальних дистанциях.\n<br><br>DISC Lite5 ac оснащён встроенным радиомодулем, процессором с частотой 716 МГц, оперативной памятью размером 256 МБ, одним гигабитным Ethernet-портом и уже установленной операционной системой RouterOS Level 3.\n<br><br>Устройство поставляется в собранном виде и комплектуется адаптером питания, PoE-инжектором и креплением.\n<br><br>Рекомендуем приобрести крепление на стену MikroTik quickMOUNT pro.\n<br><br>RouterOS Level 3 позволяет использовать продукт в качестве CPE-устройства или для создания линий связи Точка-Точка.\n<br><br>В комплектацию входит:\n<ul>\n<li>DISC Lite5 ac - 1 шт.</li>\n<li>Адаптер питания 24 В, 0.38 A - 1 шт.</li>\n<li>Металлический хомут - 1 шт.</li>\n<li>PoE-инжектор - 1 шт.</li>\n</ul>\n', 1, '2021-04-29'),
(676, '\nПоставляется готовым для монтажа на высоких мачтах и вышках — металлический хомут и две пластиковые стяжки идут в комплекте.\n<br><br>Также FiberBox укомплектован предустановленным на первом порту медным SFP-модулем (S-RJ01) с разъёмом RJ45.\n<br><br>Это даёт возможность выполнить Ethernet-подключение на одном из портов уже после распаковки устройства.\n<br><br>Извлеките S-RJ01, если необходимо использовать все пять SFP-портов для оптоволоконных модулей 1.25 Гбит/с.<br><br>DISC Lite5 ac оснащён встроенным радиомодулем, процессором с частотой 716 МГц, оперативной памятью размером 256 МБ, одним гигабитным Ethernet-портом и уже установленной операционной системой RouterOS Level 3.\n', 1, '2021-04-29'),
(677, '\nБюджетная точка доступа (hАР) являющаяся идеальным небольшим устройством для вашего дома или малого офиса.\n<br><br>Маршрутизатор поддерживает WPS, для удобства ввода сложного пароля, когда кто-то хочет получить быстрый доступ в интернет, так же роутер можно использовать в связке с управляемой сетью CAPsMAN.\n<br><br>Как обычно, устройство работает под управлением RouterOS со всем доступным функционалом: шейпинга, брандмауэра, управления доступом пользователей и многим другим.\n<br><br>hAP оснащена мощным 650 МГц процессором, 64MB RAM, MIMO 2x2 беспроводным 2.4 ГГц адаптером, пятью портами Fast Ethernet и лицензией RouterOS L4. USB порт позволяет подключать 3/4G модемы, увеличивая возможность бесперебойной работы интернета. Кроме того для порта №5 есть функция PoE output - он может питать другие устройства, поддерживающие Passive PoE с тем же напряжением, которое применимо к нему. \n<br><br>Блок питания входит в комплект.\n', 1, '2021-04-29'),
(678, '\nСпутниковая тарелка будет выполнять функцию усиливающего сигнал рефлектора, поэтому — чтобы быстро организовать высокоэффективные беспроводные линии связи для передачи данных на большие расстояния — используйте любую имеющуюся у вас офсетную антенну для приёма программ спутникового телевидения с кронштейном регулировки угла наклона.\n<br><br>Этот универсальный кронштейн диаметром 40 мм позволяет легко встроить в него устройство LDF.\n<br><br>Миниатюрность упаковки делает транспортировку и установку простой и малозатратной.\n<br><br>Используя тарелку достаточно большого диаметра, можно добиться усиления антенны 30 дБи или более.\n<br><br>Устройство из LDF-линейки поставляется с предустановленной операционной системой RouterOS и готово к работе.\n', 1, '2021-05-23'),
(679, '\nСпутниковая тарелка будет выполнять функцию усиливающего сигнал рефлектора, поэтому — чтобы быстро организовать высокоэффективные беспроводные каналы дальней связи — используйте любую имеющуюся у вас офсетную антенну для приёма программ спутникового телевидения с кронштейном регулировки угла наклона. Этот универсальный кронштейн диаметром 40 мм позволяет легко встроить в него устройство LDF\n<br><br>Миниатюрность упаковки делает транспортировку и установку простой и малозатратной. Спутниковая тарелка в комплект поставки не входит.\n<br><br>Линейка состоит из двух моделей: LDF 5 ac и LDF 5. LDF 5 ac поддерживает 802.11ac для повышенной пропускной способности и — по сравнению с LDF 5 n-стандарта — имеет более мощный процессор, увеличенный объём оперативной памяти и гигабитный Ethernet-порт.\n', 1, '2021-05-23'),
(680, '\nСпутниковая тарелка будет выполнять функцию усиливающего сигнал рефлектора, поэтому — чтобы быстро организовать высокоэффективные беспроводные каналы дальней связи — используйте любую имеющуюся у вас офсетную антенну для приёма программ спутникового телевидения с кронштейном регулировки угла наклона. Этот универсальный кронштейн диаметром 40 мм позволяет легко встроить в него устройство LDF\n<br><br>Миниатюрность упаковки делает транспортировку и установку простой и малозатратной. Спутниковая тарелка в комплект поставки не входит.\n<br><br>Линейка состоит из двух моделей: LDF 5 ac и LDF 5. LDF 5 ac поддерживает 802.11ac для повышенной пропускной способности и — по сравнению с LDF 5 n-стандарта — имеет более мощный процессор, увеличенный объём оперативной памяти и гигабитный Ethernet-порт.\n', 1, '2021-05-23'),
(681, '\nУличная беспроводная система со встроенной антенной предназначена для установки на любую спутниковую ТВ-антенну*, которая будет выполнять функцию усиливающего сигнал рефлектора. Используйте имеющуюся у вас офсетную антенну для приёма программ спутникового телевидения с кронштейном регулировки угла наклона. Применяя тарелку достаточно большого диаметра, можно добиться коэффициента усиления антенны 30 дБи и выше.\n<br><br>Это означает, что подключение к интернету возможно даже в тех местах, где мобильная связь обычно отсутствовала бы вообще. Штормовая погода тоже не проблема — прочный корпус со степенью защиты IP68 позволяет LDF LTE6 kit выдерживать воздействие пыли, грязи и песка, а также временное погружение в воду.\n<br><br>LDF LTE6 kit применяется для весьма удалённых мест, находящихся в зоне покрытия сотовой сети. Имеет новый LTE-модем 6-й категории для агрегации несущих частот и одновременной работы устройств в нескольких диапазонах — значительное преимущество при использовании в местах с большим числом LTE-пользователей. Модем повышает скорость отклика в загруженной среде и эффективность передачи слабого сигнала в условиях сельской местности. В зависимости от провайдера после перехода на категорию 6 скорость интернета в сёлах может удвоиться.\n<br><br>Миниатюрность упаковки делает транспортировку и установку быстрой, простой и малозатратной. \n', 1, '2021-05-23');
INSERT INTO `dnews` (`news_id`, `description`) VALUES
(1, 'Сегодня состоялся запуск проекта. Проект представляет собой CMDB-систему документирования сетевого, серверного и прочего оборудования.'),
(2, 'Добавлена возможность фиксировать расположение устройства в определенных юнитах шкафа.'),
(3, 'Изменена подробная форма представления устройства. Теперь для шасси видны все подкюченные к нему модули и порты этих модулей. Причем модули представлены в иерархическом порядке, как они подключены друг к другу.'),
(4, 'Добавлена возможность использования таблиц совместимости при добавлении и перемещении модулей.'),
(5, 'Добавлены параметры вес, мощность и шум устройств. Теперь на странице шкафа эти параметры суммируются автоматически.\r\nСуммарный вес шкафа помогает определить количество оборудования, которое выдержат перекрытия серверной.\r\nСуммарная мощность поможет выбрать источник бесперебойного питания.'),
(6, 'Появилась возможность добавления сетевых параметров: телефонные номера, ip-адреса и MAC-адреса.\r\nСетевые параметры могут принадлежать как порту устройства, так и самому устройству. Например, виртуальный номер группы вызова на АТС не присвоишь ни одному порту. Он относится ко всей АТС. При добавлении телефонного номера проводится проверка на наличие такого же номера и выводится сообщение, где уже есть такой же номер.'),
(7, '<p>Номера могут назначаться как устройству, так и порту устройства. Например, номер на аналоговом порту логично присвоить порту, а группу вызова - устройству. Для назначения номеров нужно назначить телефонные пулы. Назначаться номера будут только подходящие к телефонным пулам устройства. В качестве исключения можно назначить городские телефонные номера, не входящие в телефонные пулы. Для этого первым символом должен быть "+". Телефонный пул может быть назначен как шасси, так и модулю устройства и при проверке все они будут учтены.</p>\r\n<p>В случае географически распределенной системы устройства могут подключены друг к другу. При этом они также будут использовать общие телефонные пулы.</p>\r\n<p>При добавлении телефонных номеров система так же покажет есть ли еще такие же номера. В сообщении можно посмотреть к какому устройству присвоен этот номер. И при необходимости скорректировать назначение номера.</p>\r\n<p>При добавлении телефонных пулов система автоматически проверит совпадение номерного диапазона и сообщит об этом в сообщении.</p>\r\n<p>Также доступен поиск по всем номерам.</p>'),
(8, 'Появилась возможность добавлять заметки для шкафа, устройства или порта. При их просмотре легко вспомнить что было с устройством. События выводятся в хронологическом порядке убывания даты и времени.'),
(9, 'Автоматическая регистрация событий записывает в журнал основные события шкафа, устройства и портов устройства, которые позже можно просмотреть.\r\nТакже можно вручную добавить событие с его описанием.'),
(10, '\nВведен в эксплуатацию сервер для хранения объемных файлов: прошивок и документации.\n');
INSERT INTO `docs` (`doc_id`, `name`, `path`, `description`, `cat_id`, `itemtype_id`, `firstdate`) VALUES
(1, 'Cisco Catalyst 9200 Series Switches Data Sheet', '/docs/cat00078/nb-06-cat9200-ser-data-sheet-cte-en.pdf', 'Подробное описание коммутаторов серии 9200', 78, 0, '2019-11-05'),
(2, 'Подключение панели расширения AET', '/docs/it000427/how to use Atcom AET module.pdf', 'Инструкция по подключению панели расширения AET', 0, 427, '2019-11-05'),
(3, 'Курс 1. Часть 1. Общие сведения.', '/docs/cat00018/Курс_1_Общие сведения.pdf', 'Обучающий курс Коралл-Р. Курс 1. Часть 1. Общие сведения.', 18, 0, '2019-11-19'),
(4, 'Курс 1. Часть 2. Программный интерфейс.', '/docs/cat00018/Курс_1_Программный интерфейс.pdf', 'Обучающий курс Коралл-Р. Курс 1. Часть 2. Программный интерфейс.', 18, 0, '2019-11-19'),
(5, 'Курс 2. Часть 1. VoIP.', '/docs/cat00018/Курс_2_Voip.pdf', 'Обучающий курс Коралл-Р. Курс 2. Часть 1. VoIP.', 18, 0, '2019-11-19'),
(6, 'Курс 2. Часть 2. Потоки Е1.', '/docs/cat00018/Курс_2_Потоки Е1.pdf', 'Обучающий курс Коралл-Р. Курс 2. Часть 2. Потоки Е1.', 18, 0, '2019-11-19'),
(7, 'Руководство по эксплуатации УАТС UCx_144.', '/docs/cat00018/Руководство по эксплуатации УАТС UCx_144.pdf', 'Руководство по эксплуатации УАТС UCx_144.', 18, 0, '2019-11-19'),
(8, 'Инструкция по монтажу АТС Коралл-Р 4000', '/docs/cat00018/Инструкция по монтажу АТС Коралл-Р 4000.pdf', 'Инструкция по монтажу АТС Коралл-Р 4000', 18, 0, '2019-11-19'),
(9, 'Руководство по эксплуатации Коралл-Р', '/docs/cat00018/Руководство по эксплуатации Коралл-Р.pdf', 'Руководство по эксплуатации Коралл-Р', 18, 0, '2019-11-19'),
(10, 'Инструкция по монтажу Коралл-Р 200', '/docs/cat00018/ИМ Коралл-Р 200.pdf', 'Инструкция по монтажу Коралл-Р 200', 18, 0, '2019-11-19'),
