(661, 'hEX PoE lite', 12, 2, 'RB750UPr2', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Небольшой 5-ти портовый Ethernet-роутер c USB-портом и выходом PoE, вышел на замену модели Mikrotik RB750Up. Порты 2-5 могут питать другие PoE-совместимые устройства с таким же вольтажем, что и на этом роутере.', '/itpict/it0000066100.jpg', 0, 0, 0, 94, 0, 'it0000066120.jpg'),
(662, 'hEX lite', 12, 2, 'RB750r2', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Маршрутизатор MikroTik hEX lite с 5х10/100 Мбит/с портами, с поддержкой Auto-MDI/X. Оснащен мощным сетевым процессором QCA9531-BL3A-R - 850MHz, и установлено 64MB DDR RAM.', '/itpict/it0000066200.jpg', 0, 0, 0, 94, 0, 'it0000066220.jpg'),
(663, 'MikroTik CRS106-1C-5S', 12, 2, 'CRS106-1C-5S', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'В модели есть один гигабитный комбинированный порт Ethernet / SFP и пять 1.25 Гбит/с SFP-слотов.', '/itpict/it0000066300.jpg', 0, 0, 0, 94, 0, 'it0000066320.jpg'),
(664, 'MikroTik CRS112-8G-4S-IN', 12, 2, 'CRS112-8G-4S-IN', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'CRS112-8G-4S-IN - это полноценный коммутатор 3-его уровня, который работает на уже знакомой операционной системе RouterOS.', '/itpict/it0000066400.jpg', 0, 0, 0, 94, 0, 'it0000066420.jpg'),
(665, 'MikroTik CRS109-8G-1S-2HnD-IN', 12, 2, 'CRS109-8G-1S-2HnD-IN', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'MikroTik CRS109-8G-1S-2HnD-IN - многофункциональный Wi-Fi коммутатор 3-го уровня на операционной системе RouterOS level 5.', '/itpict/it0000066500.jpg', 0, 0, 0, 94, 0, 'it0000066520.jpg'),
(666, 'MikroTik CRS112-8P-4S-IN', 12, 2, 'CRS112-8P-4S-IN', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Полнофункциональный коммутатор 3-го уровня на базе операционной системы RouterOS.', '/itpict/it0000066600.jpg', 0, 0, 0, 94, 0, 'it0000066620.jpg'),
(667, 'MikroTik CRS125-24G-1S-2HnD-IN', 12, 2, 'CRS125-24G-1S-2HnD-IN', '2021-04-12', '2021-04-12', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Полнофункциональный коммутатор 3-го уровня на базе операционной системы RouterOS.', '/itpict/it0000066700.jpg', 0, 0, 0, 94, 0, 'it0000066720.jpg'),
(668, 'MikroTik CRS212-1G-10S-1S+IN', 12, 2, 'CRS212-1G-10S-1S+IN', '2021-04-13', '2021-04-13', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Полнофункциональный коммутатор 3-го уровня на базе операционной системы RouterOS.', '/itpict/it0000066800.jpg', 0, 0, 0, 94, 0, 'it0000066820.jpg'),
(669, 'MikroTik CRS312-4C+8XG-RM', 12, 2, 'CRS312-4C+8XG-RM', '2021-04-13', '2021-04-13', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Полнофункциональный коммутатор 3-го уровня на базе операционной системы RouterOS.', '/itpict/it0000066900.jpg', 0, 0, 0, 94, 0, 'it0000066920.jpg'),
(670, 'MikroTik CRS326-24S+2Q+RM', 12, 2, 'CRS326-24S+2Q+RM', '2021-04-13', '2021-04-13', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Полнофункциональный коммутатор 3-го уровня на базе операционной системы RouterOS.', '/itpict/it0000067000.jpg', 0, 0, 0, 94, 0, 'it0000067020.jpg'),
(671, 'MikroTik CRS354-48G-4S+2Q+RM', 12, 2, 'CRS354-48G-4S+2Q+RM', '2021-04-13', '2021-04-13', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Коммутатор имеет 48 портов 1G RJ45 и 4 порта 10G SFP +, 2 x 40G QSFP +. Общая неблокирующая пропускная способность составляет 168 Гбит/с, коммутационная емкость составляет 336 Гбит / с, скорость до 235 Mpps.', '/itpict/it0000067100.jpg', 0, 0, 0, 94, 0, 'it0000067120.jpg'),
(672, 'MikroTik CRS354-48P-4S+2Q+RM', 12, 2, 'CRS354-48P-4S+2Q+RM', '2021-04-13', '2021-04-13', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Коммутатор PoE+ в стойку, 48х 1G RJ45, 4x SFP+, 2x QSFP+, раздача 700 Вт.', '/itpict/it0000067200.jpg', 0, 0, 0, 94, 0, 'it0000067220.jpg'),
(673, 'Cube Lite60', 12, 2, 'RBCube-60ad', '2021-04-29', '2021-04-29', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Бюджетное CPE-устройство для работы в беспроводном диапазоне передачи данных 60 ГГц позволяет запускать сверхэкономичные установки для корпоративных нужд — в торговых центрах, промышленных парках, на стадионах и т. д.', '/itpict/it0000067300.jpg', 0, 0, 0, 94, 0, 'it0000067320.jpg'),
(674, 'DISC Lite5', 12, 2, 'RBDisc-5nD', '2021-04-29', '2021-04-29', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Mikrotik DISC Lite5 (RBDisc-5nD) - 5 ГГц CPE-устройство, разработанное на основе LHG от Mikrotik. Обладает высоким коэффициентом усиления антенны - 21 дБи.', '/itpict/it0000067400.jpg', 0, 0, 0, 94, 0, 'it0000067420.jpg'),
(675, 'DISC Lite5 ac', 12, 2, 'RBDiscG-5acD', '2021-04-29', '2021-04-29', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'MikroTik DISC Lite5 ac - CPE-устройство, работающее в диапазоне диапазона 5 ГГц, с высоким коэффициентом усиления антенны (21 дБи).', '/itpict/it0000067400.jpg', 0, 0, 0, 94, 0, 'it0000067420.jpg'),
(676, 'FiberBox', 12, 2, 'CRS105-5S-FB', '2021-04-29', '2021-04-29', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Всепогодный уличный коммутатор MikroTik FiberBox с возможностями маршрутизатора с 5 SFP-портами идеально подойдет для местности, где расстояние не позволяет применять стандартные Ethernet-кабели.', '/itpict/it0000067600.jpg', 0, 0, 0, 94, 0, 'it0000067620.jpg'),
(677, 'hAP', 12, 2, 'RB951Ui-2nD', '2021-04-29', '2021-04-29', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Универсальный беспроводной маршрутизатор MikroTik hAP, который подойдет как дома, так и в маленьком офисе.', '/itpict/it0000067700.jpg', 0, 0, 0, 94, 0, 'it0000067720.jpg'),
(678, 'MikroTik LDF 2', 12, 2, 'RBLDF-2nD', '2021-05-23', '2021-05-23', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Уличная беспроводная система MikroTik LDF 2 (Lite Dish Feed) со встроенной антенной предназначена для установки на офсетные параболические спутниковые антенны.', '/itpict/it0000067800.jpg', 0, 0, 0, 94, 0, 'it0000067820.jpg'),
(679, 'MikroTik LDF 5', 12, 2, 'RBLDF-5nD', '2021-05-23', '2021-05-23', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Уличная беспроводная система MikroTik LDF 5 (Lite Dish Feed) со встроенной антенной предназначена для установки на офсетные параболические спутниковые антенны.', '/itpict/it0000067800.jpg', 0, 0, 0, 94, 0, 'it0000067820.jpg'),
(680, 'MikroTik LDF 5 ac', 12, 2, 'RBLDFG-5acD', '2021-05-23', '2021-05-23', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Уличная беспроводная система MikroTik LDF 5 ac (Lite Dish Feed) со встроенной антенной предназначена для установки на офсетные параболические спутниковые антенны.', '/itpict/it0000067800.jpg', 0, 0, 0, 94, 0, 'it0000067820.jpg'),
(681, 'MikroTik LDF LTE6 kit', 12, 2, 'RBLDFR&R11e-LTE6', '2021-05-23', '2021-05-23', 1, 0, 0, NULL, NULL, NULL, '2030-01-01', '2030-01-01', '2030-01-01', 'Уличная беспроводная система со встроенной антенной предназначена для установки на любую спутниковую ТВ-антенну, которая будет выполнять функцию усиливающего сигнал рефлектора.', '/itpict/it0000068100.jpg', 0, 0, 0, 94, 0, 'it0000068120.jpg');
