INSERT INTO `news` (`news_id`, `name`, `firstdate`, `description`) VALUES
(1, 'Запуск проекта.', '2014-08-17 19:07:50', 'Сегодня состоялся запуск проекта.'),
(2, 'Юниты шкафа.', '2014-08-19 19:32:16', 'Добавлена возможность фиксировать расположение устройства в определенных юнитах шкафа.'),
(3, 'Форма представления устройства.', '2014-08-22 20:00:41', 'Изменена подробная форма представления устройства.'),
(4, 'Использование таблиц совместимости.', '2014-08-28 20:00:43', 'Добавлена возможность использования таблиц совместимости при добавлении и перемещении модулей.'),
(5, 'Добавлены вес, мощность и шум устройств.', '2015-06-02 09:28:38', 'Добавлены параметры вес, мощность и шум устройств. Теперь на странице шкафа эти параметры суммируются автоматически.'),
(6, 'Появилась возможность добавления сетевых параметров.', '2015-07-16 09:38:16', 'Появилась возможность добавления сетевых параметров: телефонные номера, ip-адреса и MAC-адреса.'),
(7, 'Редактирование номерного плана для атс', '2015-08-25 10:27:09', 'Появилась возможность редактирование номерного плана для атс.'),
(8, 'Журнал событий.', '2015-08-27 16:48:12', 'Добавлен журнал событий.'),
(9, 'Автоматическая регистрация событий', '2015-09-08 16:24:40', 'Добавлена автоматическая регистрация событий'),
(10, 'Загрузка прошивок устройств', '2019-10-23 14:38:50', 'Доступна загрузка прошивок устройств');
INSERT INTO `porttypes` (`porttype_id`, `name`, `description`, `speed`) VALUES
(1, 'FastEthernet 100BASE-TX', '100BASE-TX is the predominant form of Fast Ethernet, and runs over two wire-pairs inside a category 5 or above cable.', 100000),
(2, 'GigabitEthernet 1000BASE-T', 'Twisted-pair cabling (Cat-5, Cat-5e, Cat-6, or Cat-7).', 1000000),
(3, 'Ethernet 10BASE-T', 'Ethernet 10BASE-T', 10000),
(4, 'FastEthernet 100BASE-FX', '100BASE-FX is a version of Fast Ethernet over optical fiber. It uses a 1300 nm near-infrared (NIR) light wavelength transmitted via two strands of optical fiber, one for receive(RX) and the other for transmit(TX).', 100000),
(5, 'FastEthernet 100BASE-SX', '100BASE-SX is a version of Fast Ethernet over optical fiber. It uses two strands of multi-mode optical fiber for receive and transmit.', 100000),
(6, 'FastEthernet 100BASE-BX', '100BASE-BX is a version of Fast Ethernet over a single strand of optical fiber (unlike 100BASE-FX, which uses a pair of fibers).', 100000),
(7, 'FastEthernet 100BASE-LX10', '100BASE-LX10 is a version of Fast Ethernet over two single-mode optical fibers. It has a nominal reach of 10 km and a nominal wavelength of 1310 nm.', 100000),
(8, 'GigabitEthernet 1000BASE-SX', 'Multi-mode fiber. 220 to 550 meters dependent on fiber diameter and bandwidth.', 1000000),
(9, 'GigabitEthernet 1000BASE-LX MM', 'Multi-mode fiber. 550 meters.', 1000000),
(10, 'GigabitEthernet 1000BASE-LX SM', 'Single-mode fiber. 5 km.', 1000000),
(11, 'GigabitEthernet 1000BASE-LX10', 'Single-mode fiber using 1,310 nm wavelength. 10 km.', 1000000),
(12, 'GigabitEthernet 1000BASE-EX', 'Single-mode fiber at 1,310 nm wavelength. 40 km', 1000000),
(13, 'GigabitEthernet 1000BASE-ZX', 'Single-mode fiber at 1,550 nm wavelength. 70 km', 1000000),
(14, 'GigabitEthernet 1000BASE-BX10', 'Single-mode fiber, over single-strand fiber: 1,490 nm downstream 1,310 nm upstream. 10 km.', 1000000),
(15, 'GigabitEthernet 1000BASE-TX', 'Twisted-pair cabling (Cat-6, Cat-7). 100 meters.', 1000000),
(16, 'GigabitEthernet 1000BASE-CX', 'Shielded balanced copper cable. 25 meters.', 1000000),
(17, 'GigabitEthernet 1000BASE-KX', 'Copper backplane. 1 meter.', 1000000),
(18, 'TenEthernet 10GBASE-USR', 'Fiber multi-mode 850 nm wavelength. 100 or 150 m. Vendor-specific, identical to 10GBASE-SR except for lower performance/reach.', 10000000),
(19, 'TenEthernet 10GBASE-SR', 'Fiber multi-mode 850 nm wavelength. 400 m.', 10000000),
(20, 'TenEthernet 10GBASE-LR', 'Fiber single-mode 1310 nm wavelength. 10 km.', 10000000),
(21, 'TenEthernet 10GBASE-ER', 'Fiber single-mode 1550 nm wavelength. 40 km.', 10000000),
(22, 'TenEthernet 10GBASE-ZR', 'Fiber multi-mode 1550 nm wavelength. 80 km. Not covered by IEEE 802.3ae.', 10000000),
(23, 'TenEthernet 10GBASE-LX4', 'Fiber WDM multi-mode or single-mode 1310 nm wavelength. 300 m (multi-mode), 10 km (single-mode). Costly and complex, replaced by 10GBASE-LRM.', 10000000),
(24, 'TenEthernet 10GBASE-LRM', 'Fiber multi-mode 1310 nm wavelength. 220 m.', 10000000),
(25, 'TenEthernet 10GBASE-CX4', 'Copper InfiniBand 4X twinaxial 8-pair. 15 m. Four lanes, each at 3.125 Gbit/s.[15] Larger form factor, bulkier cables and more expensive than SFP+ Direct Attach.', 10000000),
(26, 'TenEthernet 10GBASE-T', 'Copper category 6, 6a or 7 twisted pair. 55 m (cat 6), 100 m (cat 6a or 7). Can reuse existing cables, high port density, relatively high power.', 10000000),
(27, 'TenEthernet 10GBASE-KX4', 'Copper PCB backplane. 1 m.', 10000000),
(28, 'TenEthernet 10GBASE-KR', 'Copper PCB backplane. 1 m.', 10000000),
(29, 'TenEthernet 10GBASE-PR', 'Fiber Passive Optical Network 1270 nm/1577 nm wavelength. 20 km. 10G EPON.', 10000000),
(30, 'ISDN T1/E1', 'ISDN T1/E1.', 2000),
(31, 'FXS - Foreign Exchange Station(Subscriber)', 'Голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 64),
(32, 'FXO - Foreign eXchange Office', 'Аналоговый интерфейс абонентских устройств телефонных станций. Устройства с таким интерфейсом подключаются к интерфейсу FXS. Так те же самые факсовые аппараты, телефоны, модемы реализуют интерфейс FXO.', 64),
(33, 'FastEthernet 100BASE-TX PoE output', '100BASE-TX is the predominant form of Fast Ethernet, and runs over two wire-pairs inside a category 5 or above cable.', 100000),
(34, 'GigabitEthernet 1000BASE-T PoE', 'Twisted-pair cabling (Cat-5, Cat-5e, Cat-6, or Cat-7).', 1000000),
(35, 'GigabitEthernet 1x1000BT PoE', '11W PoE Input', 1000000),
(36, 'ISDN BRI', 'ISDN BRI.', 128),
(37, 'FXS гибридный, Ericsson/Aastra', 'Проприетарный голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 64),
(38, 'FXS цифровой, Ericsson/Aastra', 'Проприетарный голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 64),
(39, 'IEEE 802.11n WiFi 2.5GHz', 'WiFi интерфейс по стандарту 802.11n. Теоретически 802.11n способен обеспечить скорость передачи данных до 600 Мбит/с брутто, применяя передачу данных сразу по четырём антеннам. По одной антенне — до 150 Мбит/с.', 150000),
(40, 'IEEE 802.11n WiFi 5GHz', 'WiFi интерфейс по стандарту 802.11n. Теоретически 802.11n способен обеспечить скорость передачи данных до 600 Мбит/с брутто, применяя передачу данных сразу по четырём антеннам. По одной антенне — до 150 Мбит/с.', 150000),
(41, 'IEEE 802.11n WiFi 2.5GHz 5GHz', 'WiFi интерфейс по стандарту 802.11n. Теоретически 802.11n способен обеспечить скорость передачи данных до 600 Мбит/с брутто, применяя передачу данных сразу по четырём антеннам. По одной антенне — до 150 Мбит/с.', 150000),
(42, 'RS232', 'Последовательный COM-порт', 115),
(43, 'Е1 DPNSS', 'E1 интерфейс с сигнализацией DPNSS.', 2000),
(44, 'Е1 CAS', 'E1 интерфейс с сигнализацией CAS.', 2000),
(45, 'FXS гибридный, Panasonic', 'Проприетарный голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 1),
(47, 'FXS цифровой, Panasonic', 'Проприетарный голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 1),
(48, 'FastEthernet 100BASE-TX PoE input', '100BASE-TX is the predominant form of Fast Ethernet, and runs over two wire-pairs inside a category 5 or above cable.', NULL),
(49, 'FXS цифровой, Coral', 'Проприетарный голосовой интерфейс, эмулирующий расширение интерфейса PBX, для подключения обычного телефона к PBX. Аббревиатура FXS применима к любому оборудованию, которое, с точки зрения телефона, является АТС.', 1),
(51, 'TenEthernet 10GBASE-X', 'TenEthernet 10GBASE-X', 10000000),
(53, 'GigabitEthernet 1000BASE-TX PoE input', 'GigabitEthernet 1000BASE-TX PoE input', 1000000);
